(8, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1', '2023-11-20', '2023-11-20', b'1', '2023-12-02', 0x74beaf5c1b96455da6affb4272ae0370, NULL, 2, 1),
(9, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1', '2023-11-20', '2023-11-20', b'1', '2023-12-08', 0x74beaf5c1b96455da6affb4272ae0370, NULL, 2, 1),
(10, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1', '2023-11-20', '2023-11-20', b'1', '2023-12-14', 0x74beaf5c1b96455da6affb4272ae0370, NULL, 2, 1),
(11, 'Спасибо огромное за сервис! Все понравилось! Встретили с улыбкой и проводили так же) + чистые и сухие вещи!👍🏻👍🏻👍🏻', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-11-30', 0x8b845c69d435477f9364e5368f74fefe, 22, 8, 2),
(12, 'Довольна химчисткой !', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-01', 0x8b845c69d435477f9364e5368f74fefe, 17, 8, 2),
(13, 'Спасибо огромное за пуховик для сына! Я думала что уже выбрасывать придётся. Пуховик как новый, все залоснения убрали. И даже пришитый мех не пострадал. Спасибо вам девочки огромное. Все быстро, качественно и не дорого! Я уже всем про вас рассказала! Мы довольны очень ! Теперь мы ваши клиенты!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-05', 0x8b845c69d435477f9364e5368f74fefe, 87, 8, 2),
(14, 'Осталась очень довольна данным местом))\r\nВсего за одни сутки спасли пуховик, который уже думала ничем не отстирать))\r\nДевушка принявшая у меня пуховик, очень милая)\r\nУдачи вам в дальнейшем🙂', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-11', 0x8b845c69d435477f9364e5368f74fefe, 43, 8, 2),
(15, 'Очень приятная и доброжелательная приемщица. Рассказала о цене, предупредила о возможных сложностях.  Чистое светлое помещение. Рекомендую\r\n', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-17', 0x8b845c69d435477f9364e5368f74fefe, 76, 8, 2),
(16, 'Помогают поддерживать мой гардероб в опрятном виде. Обходится мне это не так уж и дорого, зато одежду после чистки очень приятно носить.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-01', b'1', '2023-12-06', 0x4618473fa6754278b10f06dd69877458, 92, 7, 1),
(17, 'Очень позитивные сотрудники, было приятно пообщаться. Цены на чистку постельного белья лучшие в городе, сдаю только тут. Качество на высоте.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-01', b'1', '2023-12-07', 0x4618473fa6754278b10f06dd69877458, 86, 7, 1),
(18, 'Приносила пальто, девочки сделали все быстро и качественно. Отдельное спасибо за  удаления катышков. Пальто просто как новое, я довольна.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-05', b'1', '2023-12-05', 0x4618473fa6754278b10f06dd69877458, 52, 7, 1),
(19, 'Очень быстро отдают заказы, даже зимние вещи. Дубленку сделали хорошо!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-12', b'1', '2023-12-12', 0x4618473fa6754278b10f06dd69877458, 25, 7, 1),
(20, 'Первый раз обратилась в химчистку и не пожалела. Сдавала кашемировые джемпера, состояние после чистки идеальное. Обязательно приду еще.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-18', b'1', '2023-12-18', 0x4618473fa6754278b10f06dd69877458, 90, 7, 1),
(21, 'Отличная химчистка. Очистили пуховик испачканный отработанной автомобильной смазкой, который, как я считал, уже нет никаких шансов спасти.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-11-23', 0x9b327b384c344186bf76d367dabc2fcd, 73, 10, 2),
(22, 'Спасибо огромное за оперативность и качество, эко шубу сделали как новую!\r\n', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-02', 0x9b327b384c344186bf76d367dabc2fcd, 93, 10, 2),
(23, 'Прекрасное место, делают быстро и качественно, администратор вежливая, буду обращаться ещё и ещё! ☺\r\n', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-05', 0x9b327b384c344186bf76d367dabc2fcd, 11, 10, 2),
(24, 'Все прекрасно , персонал очень дружелюбен. Пообщалась с директором , были вопросы - Оксана Анатольевна , так держать !! Молодец ! Всё чётко, по делу. Спасибо за помощь! \r\n Советую!!!\r\n', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-13', 0x9b327b384c344186bf76d367dabc2fcd, 33, 10, 2),
(25, 'Очень удобное расположение, как раз недалеко работаю, поэтому заношу вещи, а после смс забираю уже чистые. Спасибо вам большое за работу!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-19', 0x9b327b384c344186bf76d367dabc2fcd, 60, 10, 2),
(26, 'Это того стоит. Моя одежда всегда выглядит почти как новая после чистки. Настоящие профессионалы.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-11-23', 0xed93902ed51c42c4b29cad4860d9a11d, 59, 9, 2),
(27, 'Сдавала почистить пуховик, оперативно справились, уже через 4 дня смогла забрать. Выглядит как новый, отстирались даже старые пятна. Спасибо за ваш труд, обязательно приду еще.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-03', 0xed93902ed51c42c4b29cad4860d9a11d, 81, 9, 2),
(28, 'Очень хорошее обслуживание, все нравится, устраивает, рекомендую, пользуюсь давно.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-05', 0xed93902ed51c42c4b29cad4860d9a11d, 28, 9, 2),
(29, 'Давно пользуюсь услугами данной химчисткой, сервис отличный, персонал приветливый. Очень хорошо чистят пуховики.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-14', 0xed93902ed51c42c4b29cad4860d9a11d, 61, 9, 2),
(30, 'Отличный сервис, быстрая химчистка, приветливый персонал. Класс!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-19', 0xed93902ed51c42c4b29cad4860d9a11d, 89, 9, 2),
(31, 'Хорошая химчистка, приветливый персонал. Все понравилось!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-11-23', 0x2da57190db72468aa36c8010f471cb0e, 95, 6, 2),
(32, 'Пользуюсь услугами данной организации очень давно, нареканий к качеству выполненных работ нет. Услуги всегда оказываются на самом высоком уровне. Персонал всегда приветлив и вежлив.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-03', 0x2da57190db72468aa36c8010f471cb0e, 44, 6, 2),
(33, 'Мне понравилось. Работают быстро, качественно. Люди приятные. Буду пользоваться еще.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-05', 0x2da57190db72468aa36c8010f471cb0e, 101, 6, 2),
(34, 'Сдавала детские вещи в химчистку первый раз. Девушка администратор очень вежливо и подробно рассказала об услуге. Отстирали все! Обязательно зайду ещё.', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-15', 0x2da57190db72468aa36c8010f471cb0e, 54, 6, 2),
(35, 'Добрый день. На днях пользовался услугами вашей химчистки. Очень доволен. Персонал знает свое дело. Результат порадовал. Непременно буду и в дальнейшем посещать вас!! Удачи ', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-20', 0x2da57190db72468aa36c8010f471cb0e, 6, 6, 2),
(36, 'Все отлично, мне понравилось. Персонал вежлив!) приду еще!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-11-23', 0xc5247b91f4114be18863c94e6fcb836a, 39, 11, 2),
(37, 'Добрый день, специально зарегистрировался , спасибо большое за качество и сервис , особенно отмечу администраторов ! Они нас встречают и провожают с Улыбкой !!!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-04', 0xc5247b91f4114be18863c94e6fcb836a, 63, 11, 2),
(38, 'Все понравилось! Приятное обслуживание, хорошее качество. Не навязчиво, а по делу предложения для достижения лучшего качества состояния одежды. Молодцы! Так держать! 👍🏼😉', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-05', 0xc5247b91f4114be18863c94e6fcb836a, 12, 11, 2),
(39, 'Являюсь постоянным клиентом данного филиала. Всегда довольна проделанной работой персонала. Перед началом зимнего сезона сдаю куртку и шубу, всегда все вовремя, все пятна выведены и цены приемлемые!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-11', 0xc5247b91f4114be18863c94e6fcb836a, 41, 11, 2),
(40, 'Спасибо большое за оперативность и качество 🙏🏼 Особая благодарность девушке Дарье, которая принимала вещи 👌🏻\r\nБольше благодарных клиентов и позитива !!!', 24, 155, 'Ответ на отзыв', '2023-11-22', '2023-12-22', b'1', '2023-12-17', 0xc5247b91f4114be18863c94e6fcb836a, 10, 11, 2),
(41, 'Очень люблю ваш салон. Много раз выручаете с быстрой доставкой на разные мероприятия.  Всегда свежие цветочки и красивые букеты)', 25, 156, 'Ответ на отзыв', '2023-11-30', '2023-12-02', b'1', '2023-12-02', 0x0728596ac0a64dcd8ac282487c40e5ca, 103, 15, 1),
