(90, 'Хочу вас поблагодарить за оперативное решение проблемы с продажей маркированной продукции.  Так же огромное спасибо за настройку 1с. Теперь будем работать только с вами!', 27, 161, 'Ответ на отзыв', '2023-12-03', '2023-12-30', b'1', '2023-12-30', 0x8f4ae494a6224a029e5717af73ae6a9b, 339, 20, 1),
(91, 'Я очень довольна детским садом \"Ладушки\"! Когда мне его посоветовала моя соседка, я решила попробовать, и не пожалела. Мы начали ходить с сентября в ясельную группу, и адаптация прошла очень быстро. Я очень беспокоилась о своем ребенке, поэтому сразу подключила услугу видеонаблюдения. Это дало мне огромный комфорт и уверенность в том, что мой малыш всегда под присмотром. Воспитатели здесь замечательные, они заботятся о каждом ребенке и создают теплую и дружескую атмосферу. Моему ребенку очень нравится ходить в детский сад \"Ладушки\", и я всем с уверенностью рекомендую этот чудесный детский сад.', 6, 165, 'Ответ на отзыв', '2023-12-04', '2023-12-22', b'1', '2023-12-04', 0x02744d289da44e4492c5c54c84689d4f, 32, 23, 2),
(92, 'Мы очень довольны частным детским садом \"Ладушки\"! Нам его посоветовал наш педиатр, и мы не пожалели о своем выборе. Нашему ребенку всего 2,2 года, и мы хотели найти место, где его развитие будет на первом месте. В \"Ладушках\" проводятся множество развивающих занятий, которые помогают малышам раскрыть свой потенциал. Особенно нам понравилось то, что каждый день они гуляют на свежем воздухе. Для нас это очень важно, потому что мы считаем, что дети должны проводить время на улице. Еще одним плюсом для нас стало то, что у нашего ребенка аллергия на молочку, и в \"Ладушках\" нам сразу предложили замену. Это показало нам, что персонал заботится о здоровье и благополучии каждого ребенка. Кроме того, питание в детском саду свое, а не привозное, что тоже очень удобно. Мы действительно довольны этим детским садом и рекомендуем его всем родителям!', 6, 165, 'Ответ на отзыв', '2023-12-04', '2023-12-22', b'1', '2023-12-10', 0x02744d289da44e4492c5c54c84689d4f, 79, 23, 2),
(93, 'Очень рада, что мы вернулись в детский сад \"Ладушки\"! Нашему сыну 4 года, и здесь у него так много занятий и возможностей. В \"Ладушках\" есть шахматы, капоэйра, подготовка к школе, театральные постановки и многое другое. Мы недавно приняли участие в празднике \"День мам\" и это было так трогательно, слезы навернулись на глаза. Большое спасибо всем сотрудникам детского сада за заботу и любовь к детям! Мы очень довольны!', 6, 165, 'Ответ на отзыв', '2023-12-04', '2023-12-22', b'1', '2023-12-16', 0x02744d289da44e4492c5c54c84689d4f, 42, 23, 2),
(94, 'Я привел ребенка в частный детский сад \"Ладушки\" и остался очень доволен своим выбором. Директор и весь персонал заслуживают самых лестных отзывов. Они очень заботятся о детях и создают теплую и дружественную атмосферу. У меня остались только положительные впечатления. Я с уверенностью могу сказать, что \"Ладушки\" - это лучший детский сад! Спасибо всем сотрудникам за их труд и любовь к детям!', 6, 165, 'Ответ на отзыв', '2023-12-04', '2023-12-22', b'1', '2023-12-22', 0x02744d289da44e4492c5c54c84689d4f, 61, 23, 2),
(95, 'Мы очень довольны детским садом \"Ладушки\"! Нашим детям там было так здорово, они каждый день с улыбкой отправлялись туда. Очень понравилось, что все прозрачно и открыто - всегда можно было посмотреть, что происходит в группе. Педагоги относятся к детям с любовью и заботой, всегда готовы выслушать и помочь. Мы оценили их профессионализм и внимание к деталям. Отличное место для детей, где они могут развиваться и чувствовать себя в безопасности. Спасибо за замечательное время в \"Ладушках\"!', 6, 165, 'Ответ на отзыв', '2023-12-04', '2023-12-28', b'1', '2023-12-28', 0x02744d289da44e4492c5c54c84689d4f, 46, 23, 2),
