(130, 'Ребенок занимается второй год, все нравиться,. Многое зависит от тренера, а нам с ним повезло. Уделяют много времени детям и передают свои знания и опыт ребятам. Рекомендую.', 29, 167, 'Ответ на отзыв', '2023-12-05', '2023-12-29', b'1', '2023-12-29', 0x3a200e40d5ca4ac1a8c1f20fc72cfca9, 113, 29, 1),
(131, 'Были впервые в ПарфюмерЪ посоветовали друзья. Большой ассортимент, прекрасный, знающий свое дело консультант Артем. Из всего многообразия выбрали аромат себе и на подарок. Спасибо!!!  Теперь только к вам 😍', 26, 160, 'Использовать имена Пётр, Артём, Анна. НЕ НА КАЖДЫЙ ОТЗЫВ', '2023-12-05', '2023-12-16', b'0', '2024-01-10', 0xa9519605ee0e4e03947241112799a704, 103, 30, 1),
(132, 'С сестрой были в отпуске в Калининграде , зашли абсолютно случайно в этот парфюмерный рай😍 Естественно глаза разбежались и мы купили духи себе и в подарок родным))) Духи просто космос!!! Заказываем сейчас всей Тюменью, у нас такого нет! Ребятам процветания и огромное спасибо♥️', 26, 160, 'Заменить на такой отзыв:\r\nС сестрой были в отпуске в Калининграде , зашли абсолютно случайно в этот парфюмерный рай😍 Естественно глаза разбежались и мы купили духи себе и в подарок родным))) Духи просто космос!!! Заказываем сейчас всей Тюменью, у нас такого нет! Ребятам процветания и огромное спасибо♥️', '2023-12-05', '2023-12-16', b'0', '2024-01-12', 0xa9519605ee0e4e03947241112799a704, 156, 30, 1),
(133, 'Прекрасный персонал, превосходный ассортимент :) проконсультировали, подобрали несколько ароматов. Не навязываются. Предложили нанести аромат, походить, подумать нравится ли. Вернулась купить :)', 26, 160, 'Ответ на отзыв', '2023-12-05', '2023-12-19', b'0', '2024-01-09', 0xa9519605ee0e4e03947241112799a704, 160, 30, 1),
(134, 'Открыла для себя совсем недавно прекрасные вкусные духи! Уже второй флакон, покупаю здесь. Спасибо Анне за доброжелательное внимательное обслуживание!  Наконец-то я могу подобрать себе парфюм с интересным ароматом!', 26, 160, 'Ответ на отзыв', '2023-12-05', '2023-12-24', b'0', '2024-01-05', 0xa9519605ee0e4e03947241112799a704, 142, 30, 1),
(135, 'Покупал перед Новым годом себе и своим близким  духи. Остались одни положительные эмоции. Место, куда хочется приходить, делать покупки и баловать себя :) Очень волшебный ПарфюмерЪ, где тебе  помогут сделать правильный выбор. Наверное, одно из любимых мест на сегодня :)', 26, 160, 'Ответ на отзыв', '2023-12-05', '2023-12-30', b'0', '2024-01-10', 0xa9519605ee0e4e03947241112799a704, 134, 30, 1),
(136, 'Компетентный и приветливый персонал. Защиту выдают. Трасса классная, скоростная. Машины крутые. Ребенок с удовольствием ходит на тренировки в Форсаж24, а мы родители время от времени гоняем там же)', 30, 168, '1 ОТЗЫВ В НЕДЕЛЮ', '2023-12-06', '2023-12-16', b'1', '2023-12-12', 0xb7d54c981b4749219b1b0db456316a5b, 142, 32, 1),
(137, 'Катались вместе с сыном . Очень понравилось. Зачётная трасса. Накатались от души. Перед заездом обязательный инструктаж. Потом одеваешь экипировку и только после в машину.Организаторам огромное спасибо за прекрасно проведенное время!', 30, 168, '1 ОТЗЫВ В НЕДЕЛЮ', '2023-12-06', '2023-12-19', b'1', '2023-12-19', 0xb7d54c981b4749219b1b0db456316a5b, 112, 32, 1),
(138, 'Сходили всей семьёй, ребенок сначала испугался, первый раз был, но тренер постоянно был рядом, подбадривал и подсказывал, поэтому сын быстро освоился и  попросил продлить катание ещё на 2 заезда! Спасибо. Очень вежливые и приятные ребята работают, инструктаж подробный провели.', 30, 168, '1 ОТЗЫВ В НЕДЕЛЮ', '2023-12-06', '2023-12-26', b'1', '2023-12-26', 0xb7d54c981b4749219b1b0db456316a5b, 128, 32, 1),
(139, 'За это, столь короткое время, я получил огромнейший взрыв эмоций, и выброс адреналина, планирую собрать команду и арендовать уже на час,', 30, 168, 'Ответ на отзыв', '2023-12-06', '2024-01-03', b'1', '2024-01-03', 0xb7d54c981b4749219b1b0db456316a5b, 351, 32, 1),
(140, 'Отличная трасса! Крутые мощные новые машины!  Картинг во всей своей красе! Костюмы и шлема всех размеров! Приветливый и грамотный персонал! Решил отметить с друзьями здесь день рождения! Спасибо! Порадовали всем! Отличное место!', 30, 168, 'Ответ на отзыв', '2023-12-06', '2023-12-12', b'0', '2024-01-09', 0xb7d54c981b4749219b1b0db456316a5b, 143, 32, 1),
(141, 'ЭМОЦИИ ВАААААУ! СКОРОСТЬ! Были с друзьями впервые и ошалели от того как здесь круто! Внутри картодрома тепло и комфортно, машины новые, экипировка крутая! Уже решили, что на рождественские праздники обязательно приедем компанией побольше )', 30, 168, 'Ответ на отзыв', '2023-12-06', '2023-12-09', b'1', '2023-12-08', 0xa3cc8cf9c5924d3a9d30ed635f9067e9, 132, 33, 1),
(142, 'Всё очень круто... Сделали сыну такой подарок на день рождения, ребёнок был очень доволен и не ожидал такого подарка. Персонал и инструктора очень вежливые всё доходчиво объясняли. Если что-то где-то было непонятно они с лёгкостью всё объясняли повторно', 30, 168, 'Ответ на отзыв', '2023-12-06', '2023-12-16', b'1', '2023-12-16', 0xa3cc8cf9c5924d3a9d30ed635f9067e9, 141, 33, 1),
(143, 'Обожаю это место за эмоции, скорость и крутую команду ребят, которые рядом на всем протяжении заезда. Катаемся всей семьёй (дочка 6 лет сама рулит).', 30, 168, 'Ответ на отзыв', '2023-12-06', '2023-12-23', b'1', '2023-12-23', 0xa3cc8cf9c5924d3a9d30ed635f9067e9, 166, 33, 1),
(144, 'Очень хорошо организованное место для покатушек на картингах! Квалифицированный персонал, доходчивый инструктаж, защитная экипировка.  Погонять компанией друзей просто ОГОНЬ 🔥', 30, 168, 'Ответ на отзыв', '2023-12-06', '2023-12-30', b'1', '2023-12-30', 0xa3cc8cf9c5924d3a9d30ed635f9067e9, 155, 33, 1),
(145, 'Название говорит за себя 💯\r\nЧасто катаемся с сыном  и друзьями. Максимум адреналина \r\nЧеткий инструктаж, хорошая экипировка ну и машины реально взрывные! А если застанете тренировку спортсменов, то ошалеете от скоростей, на которых гоняют ребята, даже маленькие дети 6❗️лет. Всем рекомендую попробовать! ', 30, 168, 'Ответ на отзыв', '2023-12-06', '2024-01-06', b'1', '2024-01-06', 0xa3cc8cf9c5924d3a9d30ed635f9067e9, 301, 33, 1),
(146, '30 ноября наращивала волосы, очень рада, что выбрала эту студию. Нарастили детские волосы. Качество просто волшебное! Особенное спасибо мастеру Анжеле за ее очень трепетное отношение.', 10, 63, 'Ответ на отзыв', '2023-12-08', '2023-12-08', b'1', '2023-12-08', 0xd424adf7e33a43e582de418e1b515797, 193, 37, 1),
(147, 'Сделала коррекцию волос после наращивания в другом салоне. Очень довольна работой мастера Елены. Капсулы супер маленькие и мега аккуратные. У них в студии капсулы делают на сцеп оборудовании. Нигде ничего подобного не видела)', 10, 63, 'Ответ на отзыв', '2023-12-08', '2023-12-14', b'1', '2023-12-14', 0xd424adf7e33a43e582de418e1b515797, 158, 37, 1),
(148, 'Срезали дочке волосы. Заплатили как и обещали. Бесплатная стрижка очень понравилась. Как снова  отрастут, непременно только к ним.', 10, 63, 'Ответ на отзыв', '2023-12-08', '2023-12-20', b'1', '2023-12-20', 0xd424adf7e33a43e582de418e1b515797, 117, 37, 1),
(149, 'Пришла с короткими волосами на нарашивание волос в студию Людмилы и не пожалела. В других салонах мне отказали из за длины, сказали, что будет очень некрасиво. Но, мастер Анжела просто волшебница! Нарастила абсолютно незаметно по своей технологии. Даже сняли меня на видео. Теперь это моя любимая студия.', 10, 63, 'Ответ на отзыв', '2023-12-08', '2023-12-26', b'1', '2023-12-26', 0xd424adf7e33a43e582de418e1b515797, 226, 37, 1),
(150, 'Я в восторге! Нарастила волосы к свадьбе. Невероятно мягкие, как свои. Волосы не путаются, из капсул не лезут, хотя капсулы были очень миниатюрные. Огромное спасибо за вашу работу, и за вкуснейший каппучино.', 10, 63, 'Ответ на отзыв', '2023-12-08', '2023-12-29', b'1', '2023-12-29', 0xd424adf7e33a43e582de418e1b515797, 299, 37, 1),
(151, 'Однозначно рекомендую эту компанию! Всё чётко, креативно. ', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-02', 0x7d6d5c9fa19140cca1ab5697d76e4310, 34, 38, 2),
(152, 'Хочу выразить свою благодарность Павлу! Все сделано шикарно и в кратчайшие сроки. Сразу видно, что Павел делает свою работу с любовью. Понравилось все: то как встречают, подробно все рассказывают, делают все в назначенные сроки, одним словом - молодцы!\r\n\r\n', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-03', 0x7d6d5c9fa19140cca1ab5697d76e4310, 40, 38, 2),
(153, 'Отличная мастерская, даже хотя бы потому, что действительно работают в субботу. Починку изделия сделали быстро.', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-04', 0x7d6d5c9fa19140cca1ab5697d76e4310, 88, 38, 2),
(154, 'Я уже постоянный клиент этого ювелира. Еще ни разу не подводил. Уменьшала колечки и чистку делала не раз 👌🏻 всё отлично. После очередного приятного посещения решила оставить отзыв ❤️', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-05', 0x7d6d5c9fa19140cca1ab5697d76e4310, 39, 38, 2),
(155, 'Лучшая ювелирная мастерская, с которой я знакома. Индивидуальный клиентоориентированный подход, высочайшее качество продуктов, колье копия изделия маджерит с топазами и хризолитами в белом золоте, рада, что узнала о тебе Павел. Жду кольцо и серьги как и обещал. ', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-06', 0x7d6d5c9fa19140cca1ab5697d76e4310, 18, 38, 2),
(156, 'Относил на ремонт и чистку украшения, выглядят как новые! Мастер своего дела! Не пожалел, что обратился именно к нему', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-07', 0x7d6d5c9fa19140cca1ab5697d76e4310, 88, 38, 2),
(157, 'Отличная компания. Заказывал корпоративную медаль  с нашим логотипом, все сделано качественно и быстро. Компанию рекомендую.', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-08', 0x7d6d5c9fa19140cca1ab5697d76e4310, 23, 38, 2),
(158, 'Отличный человек, хороший мастер. Уменьшаю кольца уже не первый раз. Только хорошие впечатления.', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-09', 0x7d6d5c9fa19140cca1ab5697d76e4310, 52, 38, 2),
(159, 'Отличное место, доступные цены, мастер очень быстро отремонтировал застёжку на браслете Пандора. Рекомендую!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-10', 0x7d6d5c9fa19140cca1ab5697d76e4310, 52, 38, 2),
(160, 'Делала на заказ. Сделали все шикарно,доверила поставить мои сапфиры, идеально, качественно! Влюблена!', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-11', 0x7d6d5c9fa19140cca1ab5697d76e4310, 59, 38, 2),
(161, 'Отдал колечко на уменьшение. Мастер справился на отлично, никакого следа даже не видно. Все вовремя, как и договаривались. Спасибо большое. Рекомендую!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-12', 0x7d6d5c9fa19140cca1ab5697d76e4310, 80, 38, 2),
(162, 'Большое спасибо за качественно выполненную работу! Заказала изготовление кольца, результатом довольна! Буду рекомендовать!', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-13', 0x7d6d5c9fa19140cca1ab5697d76e4310, 70, 38, 2),
(163, 'Быстро и оперативно отремонтировал подвеску. Ребята знают что делать!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-14', 0x7d6d5c9fa19140cca1ab5697d76e4310, 81, 38, 2),
(164, 'Отличная ювелирная мастерская! Мастер - профессионал. Все сделал даже быстрее, чем было озвучено изначально. Нужна была спайка кольца, все сделано отлично. Ещё и кольцо почистили, так что оно теперь как новое!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-15', 0x7d6d5c9fa19140cca1ab5697d76e4310, 50, 38, 2),
(165, 'Благодарю Павла за серьги, они получились шикарные😍😇! А также за тщательный и ответственный подход к реализации моей идеи и неизменно доброжелательное и внимательное отношение к таким требовательным клиентам как я) Всё профессионально и с душой)', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-16', 0x7d6d5c9fa19140cca1ab5697d76e4310, 7, 38, 2),
(166, 'Починили цепочку в моем присутствии, быстро, по цене демократично.', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-17', 0x7d6d5c9fa19140cca1ab5697d76e4310, 49, 38, 2),
(167, 'Второй раз обращаюсь в мастерскую. Передаю металлолом (потерянные сережки, неносибельные кольца) и получаю шикарные изделия по индивидуальному заказу. Профессиональные мастера работают со страстью к своему делу. Сотрудники студии очень внимательны к заказчикам. Рекомендую!', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-18', 0x7d6d5c9fa19140cca1ab5697d76e4310, 42, 38, 2),
(168, 'Отличная ювелирная мастерская! Нужно было уменьшить золотое кольцо почти на 2 размера,  сделали все очень качественно и ответственно. Никаких следов вмешательств не видно, все красиво и аккуратно. Советую!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-19', 0x7d6d5c9fa19140cca1ab5697d76e4310, 18, 38, 2);
INSERT INTO `reviews` (`review_id`, `review_text`, `review_category`, `review_subcategory`, `review_answer`, `review_created`, `review_changed`, `review_publish`, `review_publish_date`, `review_order_details`, `review_bot`, `review_filial`, `review_worker`) VALUES
(169, 'Паш, вот твои два кольца как и обещала, тебе спасибо за мои бриллиантики и спасибо что спас мой изумруд. ', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-20', 0x7d6d5c9fa19140cca1ab5697d76e4310, 54, 38, 2),
(170, 'Заказывали обручальные кольца. Получилось идеально, учли все наши пожелания. Спасибо вам большое ❤️ однозначно рекомендую!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-21', 0x7d6d5c9fa19140cca1ab5697d76e4310, 18, 38, 2),
(171, 'Профи своего дела. Сервис на высшем уровне. Рекомендую', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-22', 0x7d6d5c9fa19140cca1ab5697d76e4310, 79, 38, 2),
(172, 'Нужно было отремонтировать серьги для мамы, посоветовала подруга эту студию (заказывали с мужем обручальные кольца у них) - я была в шоке!)  Сделали все в срок - очень качественно и серьги стали будто новые!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-23', 0x7d6d5c9fa19140cca1ab5697d76e4310, 18, 38, 2),
(173, 'Выражаем огромную благодарность мастеру! Уменьшили кольцо до нужного размера,следов ремонта вообще незаметно,как из магазина!', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-24', 0x7d6d5c9fa19140cca1ab5697d76e4310, 11, 38, 2),
(174, 'Спасибо вам, что есть такие компании, которым можно довериться на все 100% !  Кольцо заказали с чёрным опалом в 750 пробе с горячей эмалью. Всё кто в списке 2гис отказались от такой работы, работа дорогая, времени запросил много, но взялся же и вот результат. Спасибо :)', 31, 169, 'ФОТО', '2023-12-08', '2024-01-02', b'0', '2024-01-25', 0x7d6d5c9fa19140cca1ab5697d76e4310, 21, 38, 2),
(175, 'Принесла почистить золото, забрала как новое через пол часа!) большое спасибо! :)', 31, 169, 'Ответ на отзыв', '2023-12-08', '2024-01-02', b'0', '2024-01-26', 0x7d6d5c9fa19140cca1ab5697d76e4310, 98, 38, 2),
(176, 'Очень понравилась клиника, была первый раз у дерматоонколога Малышева, удаляла родинку. Пока ожидала приема, общалась с директором клиники Леденевой Снежной Владимировной, посоветовала сделать пилинг. Меня записали на удобное время, и подобрали необходимый пилинг на проблему. Уже прошла курс пилингов, эффектом довольна.', 11, 170, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-08', 0x64911c4afa7041b69ab91094cf16dc60, 53, 39, 2),
(177, 'Обратилась в клинику для подбора уходовых средств, косметолог Инна посоветовала использовать несколько средств, а также рассказала о специалисте, который поможет скорректировать питание, ведь большинство высыпаний из-за питания. Меня записали на экспресс диагностику к нутрициологу Козыревой Наталье. На диагностике мы рассмотрели мой рацион, а также говорили о моей здоровье и определенных проблемах со здоровьем. Буду проходить курс. Консультацией довольна', 11, 170, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-14', 0x64911c4afa7041b69ab91094cf16dc60, 94, 39, 2),
(178, 'Фитобочка - это что-то необыкновенное! Уже второй год подряд хожу на курс процедур с фитобочкой. В период болезней она очень эффективна, ну по крайней мере мне очень помогает. Поддерживает иммунитет, да и эмоциональное состояние отличное. Рекомендую!!!', 11, 170, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-20', 0x64911c4afa7041b69ab91094cf16dc60, 25, 39, 2),
(179, 'В интернете увидела рекламу о плазмотерапии в гинекологии. Позвонила в клинику, меня записали на консультацию к гинекологу Исмаиловой Софико, а после сделали процедуру. После эпизиотомии (во время родов), шрам доставлял дискомфорт, а плазмотерапия помогла улучшить качество кожи, и шрам стал менее твердым, и перестал приносить дискомфорт. Спасибо Софико за помощь, буду рекомендовать!', 11, 170, 'Ответ на отзыв', '2023-12-08', '2023-12-26', b'1', '2023-12-26', 0x64911c4afa7041b69ab91094cf16dc60, 24, 39, 2),
(180, 'Профессиональная косметика, умелые руки Антонец Инны и отличный результат! Уже несколько лет хожу в клинику на процедуры по уходу за лицом. Делаю и пилинги, и чистку, и плазмотерапию и просто уходовые процедуры. Результатом довольна. Спасибо Вам! Все классно!!', 11, 170, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'0', '2024-01-01', 0x64911c4afa7041b69ab91094cf16dc60, 59, 39, 2),
(181, 'Сделали окна  качественно\r\nУстановщики очень вежливые, помогли с вещами, сторожили собаку, которая вечно убегала когда выносились старые окна 😃\r\nБольшое спасибо', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-08', 0x26213e58e6fb4805b0c56245f61a3a13, 21, 41, 2),
(182, 'Хочется выразить огромную, искреннюю благодарность!!! Проинформировали очень хорошо, доступно!\r\nМастера работали аккуратно, качественно, щепетильно относятся к своей работе! Очень человеческое отношение! Буду рекомендовать Вас!', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-11', 0x26213e58e6fb4805b0c56245f61a3a13, 29, 41, 2),
(183, 'Выражаю благодарность за установку окон высокого уровня. \r\nРебята Андрей и Сергей мастера своего дела и пример того, как нужно работать в любой сфере.\r\nДовольна обслуживанием и ценовой политикой.\r\nРекомендую от души .', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-14', 0x26213e58e6fb4805b0c56245f61a3a13, 38, 41, 2),
(184, 'Хотелось бы выразить огромную благодарность компании «Окна24», начиная с приёма заказа.\r\nЯ осталась довольна выполненной работой и претензий не имею. Спасибо!!! Моя оценка по пятибальной системе - 5 баллов.', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-17', 0x26213e58e6fb4805b0c56245f61a3a13, 89, 41, 2),
(185, 'Первичную информацию по остеклению балкона получила по телефону в корректной форме. Цена при замерах не превышала цену, озвученную предварительно по телефону.\r\nПо срокам все выдержано. Предупредили, что будет +- 2 дня. В день установки специалисты приехали ровно в 9.00, это приятно удивило. Работали чисто, аккуратно и быстро. Для меня были некоторые моменты принципиальны, обсудили, услышали. Благодарю компанию и специалистов Ильдара и Шамиля за работу. Качество самого изделия покажет себя во времени. Верю, что все будет хорошо.', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-22', b'1', '2023-12-20', 0x26213e58e6fb4805b0c56245f61a3a13, 98, 41, 2),
(186, 'Компания Окна24 установили качественно и в сроки окно. Всё от замера до установки прошло гладко, работают профессионалы. Рекомендую компанию!', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-23', b'1', '2023-12-23', 0x26213e58e6fb4805b0c56245f61a3a13, 30, 41, 2),
(187, 'Заказываю 3 раз, качество окон отличное, доставка в срок, цены приемлимые. Рекомендую 👍', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-26', b'1', '2023-12-26', 0x26213e58e6fb4805b0c56245f61a3a13, 49, 41, 2),
(188, 'Добрый день, заказала в этой фирме окно на кухню, сделали все на высшем уровне, качественный монтаж, быстрое и понятное составление договора, буду заказывать ещё.', 18, 108, 'Ответ на отзыв', '2023-12-08', '2023-12-29', b'1', '2023-12-29', 0x26213e58e6fb4805b0c56245f61a3a13, 81, 41, 2),
