(196, 'Работа выполнена быстро, а главное качественно. Спасибо большое) После обращения в три сервиса, профессионализм и стоимость работ приятно удивили. Отличная работа.', 17, 171, 'Ответ на отзыв', '2023-12-08', '2023-12-26', b'1', '2023-12-26', 0x31d60d0a96da4851930b1f481b14bb1e, 110, 42, 1),
(197, 'Обратился с поломкой двух ноутбуков. Сразу же договорились о времени встречи и цене. Цены, кстати, очень понравились. Работы выполнена была в срок и на высшем уровне, также сделана очистка и обслуживание всех систем ноутбуков, отремонтирована петля на экране и заменена матрица на втором ноуте. Навязывание работ не было, оговоренные цены не менялись. Очень порядочный и квалифицированный специалист.', 17, 171, 'Ответ на отзыв', '2023-12-08', '2023-12-29', b'1', '2023-12-29', 0x31d60d0a96da4851930b1f481b14bb1e, 172, 42, 1),
(198, 'Мастер своего дела. Делал ТО ноутбука. Сделал все быстро, качественно и с объяснением нюансов. Рекомендую однозначно.', 17, 171, 'Ответ на отзыв', '2023-12-08', '2023-12-29', b'1', '2023-12-29', 0x31d60d0a96da4851930b1f481b14bb1e, 328, 42, 1),
(199, 'Очень качественное обслуживание. Отремонтировали телефон очень быстро за день. Ремонт произведен качественно. Спасибо специалисту данного сервиса!!', 17, 171, 'Ответ на отзыв', '2023-12-08', '2024-01-05', b'1', '2024-01-05', 0x31d60d0a96da4851930b1f481b14bb1e, 273, 42, 1),
