(201, 'Работой доволен! 👍', 17, 171, 'Ответ на отзыв', '2023-12-08', '2023-12-13', b'0', '2024-01-10', 0x31d60d0a96da4851930b1f481b14bb1e, 201, 42, 1),
(202, 'Отличный сервис, обращались не раз с разной техникой, цены приемлемые, хорошо и очень оперативно выполняют свою работу. В последний раз обращались с ноутбуком, сломались крепления крышки и лопнул поддон. Восстановили крепления и поддон, хоть и ноутбук старенький. Рекомендую данный сервис.', 17, 171, 'Ответ на отзыв', '2023-12-08', '2023-12-13', b'0', '2024-01-10', 0x31d60d0a96da4851930b1f481b14bb1e, 152, 42, 1),
