(205, ' Отличный мастер на все руки, сделает быстро и не дорого. Обращаюсь не раз с различной техникой. Еще сдавал свой старый телефон с доплатой на новый. Рекомендую!', 17, 171, 'Ответ на отзыв', '2023-12-08', '2023-12-13', b'0', '2024-01-16', 0x31d60d0a96da4851930b1f481b14bb1e, 149, 42, 1),
(206, 'Спасибо большое «Альфа-Дом» за помощь в выборе дома, это действительно стоящий вариант, так же спасибо за всю проделанную работу, очень хорошо что есть такие работники которые погружаются душой в работу🔥', 33, 172, 'Ответ на отзыв', '2023-12-08', '2023-12-14', b'1', '2023-12-13', 0xd42082ccd2a14e6ea1cbd8e7caf780ae, 143, 43, 1),
(207, 'Выражаю огромную благодарность риэлтору Анастасии за качественную работу, полное сопровождение сделки, профессионализм, за душевное отношение к делу и отзывчивость. Крайне приятно было работать с Вами. Спасибо Вам большое за Вашу корректность и искреннее желание помочь! Удачной деятельности вашему агентству и вменяемых клиентов!', 33, 172, 'Ответ на отзыв', '2023-12-08', '2023-12-16', b'1', '2023-12-16', 0xd42082ccd2a14e6ea1cbd8e7caf780ae, 213, 43, 1),
(208, 'Покупали коттедж с Бозоровым Фархадом, он проявил себя как первоклассный специалист. Предоставил достаточное количество домов и коттеджей на выбор, на каждом осмотре присутствовал. Открыто озвучивал, минусы, чем очень нам помог. Огромное спасибо за такое отношение к работе.', 33, 172, 'Ответ на отзыв', '2023-12-08', '2023-12-20', b'1', '2023-12-20', 0xd42082ccd2a14e6ea1cbd8e7caf780ae, 177, 43, 1),
(209, '«Альфа-Дом» — это определенно лучшее агентство в своем деле, с помощью него мы продали свою старую и приобрели новую квартиры. Нам настолько облегчили нашу участь, звонки, встречи, документация- все агентство взяли на себя. Спасибо, что так ответственно подходите к своей работе, будем Вас рекомендовать.', 33, 172, 'Ответ на отзыв', '2023-12-08', '2023-12-24', b'1', '2023-12-24', 0xd42082ccd2a14e6ea1cbd8e7caf780ae, 156, 43, 1),
(210, ' С нами работал риэлтор Бычкова Анастасия. Обратились мы к ней по рекомендации моей сестры, которая ранее покупала через нее квартиру. Хотим сказать искреннее спасибо! Очень приятный агент, было комфортно с ней общаться. Сделала все быстро, и главное к делу подошла ответственно. Сделкой и покупкой остались очень довольны.', 33, 172, 'Ответ на отзыв', '2023-12-08', '2023-12-27', b'1', '2023-12-27', 0xd42082ccd2a14e6ea1cbd8e7caf780ae, 245, 43, 1),
(211, 'Спасибо риелтору Оксане Шев и ее помощнику Дмитрию Клопову, все прошло отлично, продажа нашей дачи без лишних заморочек и покупка нового дома.', 33, 172, 'Ответ на отзыв', '2023-12-08', '2023-12-30', b'1', '2023-12-30', 0xd42082ccd2a14e6ea1cbd8e7caf780ae, 340, 43, 1),
