(250, 'Люблю людей которые держат слово и всегда стараются всячески помочь. Устанавливали камеры на дом в октябре. Сделали все быстро, спустя столько времени иногда звоню и меня рады слышать и всегда готовы помочь, что очень радует! Желаю больших успехов компании, ведь так и должен выглядеть хороший сервис.', 34, 174, 'Ответ на отзыв', '2023-12-09', '2023-12-22', b'0', '2024-01-15', 0x710bfb9676f248169e0b6df71b22be7c, 18, 50, 2),
(251, 'Хочу поблагодарить сотрудников компании за их работу! Нашла эту организацию в 2ГИС, посмотрела отзывы, решила позвонить. С момента звонка до завершения работы - все было идеально.\r\n1. Коммуникация с клиентом - 5!\r\n2. Работа техника и консультация по оборудованию - 5!\r\n3. Согласование деталей, и вся работа менеджера - 5!\r\n4. Установка, монтаж, запуск в работу - 5!\r\nСпасибо большое! С Вами очень приятно работать! Последнее время очень сложно найти компанию, которая бы предоставляла отличный сервис и качественно выполненную работу!', 34, 174, 'Ответ на отзыв', '2023-12-09', '2023-12-22', b'0', '2024-01-22', 0x710bfb9676f248169e0b6df71b22be7c, 10, 50, 2),
(252, 'Получил очень качественную услугу по монтажу видеооборудования в доме, от сотрудников фирмы. А так же консультацию по эксплуатации оборудования. Спасибо огромное, коллективу профессионалов желаю удачи и успехов в работе!', 34, 174, 'Ответ на отзыв', '2023-12-09', '2023-12-22', b'0', '2024-01-29', 0x710bfb9676f248169e0b6df71b22be7c, 18, 50, 2),
(253, 'Выражаю благодарность за настройку системы видеонаблюдения на складе компании в начале декабря . Сделано было все оперативно в установленные по договору сроки и качественно. Рекомендую данного подрядчика.', 34, 174, 'Ответ на отзыв', '2023-12-09', '2023-12-22', b'0', '2024-02-06', 0x710bfb9676f248169e0b6df71b22be7c, 29, 50, 2),
(254, 'Отличная компания! Отличные сервис-инженеры! обращались в \"Импульс \" за установкой тревожной сигнализации с выводом на пульт Вневедомственной охраны, ребята быстро профессионально помогли, все \"под ключ\"! Всем рекомендую!', 34, 174, 'Ответ на отзыв', '2023-12-09', '2023-12-22', b'0', '2024-02-12', 0x710bfb9676f248169e0b6df71b22be7c, 90, 50, 2),
