(257, '\r\nДолго не могли найти нужный дизайн кровати , который нам подойдет для спальни. Зашли к Вам, сразу были в восторге от большого ассортимента.Заказали для себя то , что хотели и остались довольны.', 12, 74, 'ФОТО ПРИКРЕПИТЬ!', '2023-12-09', '2023-12-22', b'1', '2023-12-22', 0xbf53961097964d25af3a6ac87d0da2f6, 189, 51, 1),
