(259, 'Очень профессиональная работа менеджера, согласовали всё от обивки и дизайна до последнего стежка на нашей кровати.Заказ выполнен в срок и бесплатно привезли.Всем советую!', 12, 74, 'Ответ на отзыв', '2023-12-09', '2023-12-28', b'1', '2023-12-28', 0xbf53961097964d25af3a6ac87d0da2f6, 202, 51, 1),
(260, 'Среди качественной и красивой, модной мебели у этой фирмы самая адекватная цена на кровати. Есть возможность изменения опций в конструкции кровати. Привезли ее раньше срока. Сборщики после себя упаковку и мусор даже компактно сложили. Кровать радует.Мы купили именно то, что хотели. Без всяких компромиссов. Уже целый месяц наслаждаемся ароматом древесины в комнате. Исходя из всего сказанного, советую всем ищущим качественную кровать или другую мебель.\r\n\r\n', 12, 74, 'ФОТО ПРИКРЕПИТЬ!', '2023-12-09', '2023-12-31', b'1', '2023-12-31', 0xbf53961097964d25af3a6ac87d0da2f6, 343, 51, 1),
(261, 'Очень довольна результатом работы данной компании 😍 заказывала кровать(было только примерное фото и образ в голове), помогли определиться с размерами, материалом. Очень быстро все было готово. Приехали, установили. И по сравнению с теми ценами что мне предлагали, оооочень дёшево. Огромная благодарность 🎀', 12, 74, 'ФОТО ПРИКРЕПИТЬ!', '2023-12-09', '2023-12-19', b'0', '2024-01-03', 0xbf53961097964d25af3a6ac87d0da2f6, 154, 51, 1),
(262, 'Добрый день!!! Заказывали кровать в детскую. Работой персонала фирмы остались довольны. Качество исполнения приятно удивило!\r\nДоставку не пришлось долго ждать. Мне заранее позвонили предупредили что будет доставка.  Собрали довольно быстро, я даже не ожидал. За пару часов все было готово. Протестировали, чтоб не было потом проблем.\r\nПо ценам могу сказать, что цены нормальные. Ребенок очень доволен.', 12, 74, 'ФОТО ПРИКРЕПИТЬ!', '2023-12-09', '2023-12-19', b'0', '2024-01-06', 0xbf53961097964d25af3a6ac87d0da2f6, 138, 51, 1),
(263, 'Долго и мучительно выбирал свою первую кровать. В итоге решил остановиться на продукции данной компании. Поначалу испугало обилие отрицательных отзывов, преимущественно связанных с сервисом, но, устав от выбора, решил рискнуть. И не прогадал!\r\nКровать прибыла даже раньше назначенного срока. В этот день, после предварительного звонка, бравые хлопцы приехали и собрали очень быстро.\r\nВсе мелкие нюансы, важные для меня, были учтены.\r\nПо качеству кровати рано делать глобальные выводы(возможно, дополню отзыв через n-нное время), но она выглядит добротно и привлекательно и радует меня.', 12, 74, 'Ответ на отзыв', '2023-12-09', '2023-12-19', b'0', '2024-01-09', 0xbf53961097964d25af3a6ac87d0da2f6, 235, 51, 1),
(264, 'Остался доволен, ребята знают свое дело👍сроки и качество соответствуют цене\r\n\r\n', 12, 74, 'Ответ на отзыв', '2023-12-09', '2023-12-19', b'0', '2024-01-12', 0xbf53961097964d25af3a6ac87d0da2f6, 228, 51, 1),
(265, 'Заказывали кровати для детей. Дети в полном восторге и мы тоже. Все сделано в срок, без задержек. Сама мебель качественная, смотрится великолепно и очень продумано использование пространства, . Рекомендую. ', 12, 74, 'ФОТО ПРИКРЕПИТЬ!', '2023-12-09', '2023-12-19', b'0', '2024-01-15', 0xbf53961097964d25af3a6ac87d0da2f6, 219, 51, 1),
(266, ' Консультировался по вопросу составления искового заявления. Адвокат  задала много уточняющих вопросов, которые другие юристы не спросили, грамотно предоставила полную информацию. Спасибо за консультацию. Однозначно рекомендую Сокол Лига!', 28, 166, 'Ответ на отзыв', '2023-12-09', '2023-12-22', b'1', '2023-12-21', 0xad943ce39328436f9042158e32b3494f, 168, 52, 1),
