(268, 'Отличная компания, Огромное спасибо за помощь! Главное - быстро и результат 100%. Куда не обращалась, все только обещали, а тут взялись за дело и сделали. Моя ситуация - подсунули в универе договор не рассрочки платежа за обучение, а потребительский кредита с огромной % ставкой. Я поняла, что надо всё читать, когда пришло смс с суммой 1 платежа. Разбирательства с банками - это не реально... Это единственная компания, которая реально решила вопрос. Спасибо Вам! Рекомендую всем!!!', 28, 166, 'Ответ на отзыв', '2023-12-09', '2024-01-03', b'1', '2024-01-02', 0xad943ce39328436f9042158e32b3494f, 212, 52, 1),
