(271, 'От всей нашей компании хочу поблагодарить Вас за отличный корпоратив!\r\nПрекрасная атмосфера, уютно, вкусная еда, заботливый персонал, все вообще ТОП! Даже подарки были . В общем всё было так как мы ожидали! Вы молодцы)', 35, 175, 'Ответ на отзыв', '2023-12-12', '2023-12-22', b'1', '2023-12-20', 0x7738d163786f4cb4aadc8eab9411631a, 26, 53, 2),
(272, 'Хочу выразить благодарность за прекрасную организацию нашего корпоративного вечера 15.12.2023 года и вкусный стол. Все было чётко, своевременно, очень вкусно. Администраторы очень внимательны к пожеланиям, помогли составить меню, учли все нюансы. Было очень вкусно! С наступающим Новым Годом! Желаем всем здоровья и энтузиазма, добрых надежд и радостных событий, счастливых улыбок и настоящих чудес.', 35, 175, 'Ответ на отзыв', '2023-12-12', '2023-12-22', b'1', '2023-12-22', 0x7738d163786f4cb4aadc8eab9411631a, 67, 53, 2),
