(274, 'Все прошло очень классно!!!!! Еда вкусная, обслуживание на высоте. Администратор понимает все с первого слова и выполнила все наши хотелки! Зал очень красивый и просторный! Оформление стильное! Вариантов сервировки стола очень много, все продумано до мелочей! Гости в восторге! Спасибо огромное за наш чудесный праздник! Вернемся еще.', 35, 175, 'Не публикуем. не оплатил', '2023-12-12', '2023-12-23', b'0', '2024-01-03', 0x7738d163786f4cb4aadc8eab9411631a, 96, 53, 2),
