(286, 'Совершенно отличный центр, помогли и моему мужу и мне с нашими проблемными моментами по здоровью. Внутри интересно все устроено, очень комфортно. Я на массаже не была, муж был, ему понравилось, помогли аккуратно с больной спиной. Планируем ходить с ребенком, но тут уже надо рассчитать время визитов.', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-22', b'1', '2023-12-14', 0xae62f9b4ffb348559d550811e33372c6, 40, 57, 2),
(287, 'Отличный салон, атмосферный и с пользой для здоровья. Открыла для себя Подводный вакуумный массаж 😍 по рекомендации подруги, очень довольна. После второго сеанса массажа результат - отпустило напряжение в шейно-воротниковой зоне и прекратились боли в спине. И самое главноу каждаю процедура дает снижение веса это Чудо. Приятная атмосфера и внимательный персонал на ресепшен. Рекомендую❤️', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-22', b'1', '2023-12-17', 0xae62f9b4ffb348559d550811e33372c6, 88, 57, 2),
(288, 'Оставлю отзыв о сеансе массажа  АкваТорнадо! Великолепно! Расслабление тела и наверное души. Ни одной мысли в голове, полная сосредоточенность на ощущениях в теле и фокус внимания на нем!\r\nОгромная благодарность массажисту!', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-22', b'1', '2023-12-20', 0xae62f9b4ffb348559d550811e33372c6, 18, 57, 2),
(289, 'Давно посещаю оздоровительный центр «Водный цветок». На ресепшене встречают мило и  доброжелательно. Хожу на подводный вакуумный массаж АкваТорнадо.  Очень довольна работой и профессионализмом оперетра.\r\nА главное результат с первой процедуру 900 грамм.', 10, 181, 'Ответ на отзыв ', '2023-12-13', '2023-12-23', b'1', '2023-12-23', 0xae62f9b4ffb348559d550811e33372c6, 33, 57, 2),
(290, 'Отличный оздоровительный центр! Прекрасный персонал, качественные оздоровительные процедуры, а АкваТорнадо идеально подходит для здоровья и отдыха душой и телом! Однозначно рекомендую для поддержания здоровья и продления активного долголетия', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-26', b'1', '2023-12-26', 0xae62f9b4ffb348559d550811e33372c6, 54, 57, 2),
(291, 'Я довольна всем с самого входа, начиная с ресепшн, обстановки и заканчивая процедурами. Понравилось отношение сотрудников, которые проводили мне массаж и обертывание. Я уже прошла три процедуры массажа, и меня полностью устроили результаты, поэтому буду посещать и дальше. Мастера разговаривают со мной во время процедур, общаются и отлично выполняют свою работу.', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-29', b'1', '2023-12-29', 0xae62f9b4ffb348559d550811e33372c6, 85, 57, 2),
