(293, 'Подводный вакуумный массаж это уникальныя очень эффективная процедура. В центре стерильно, чисто, аккуратно, профессионально. Спасибо огромное массажисту, все понравилось, буду ходить. ', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-22', b'0', '2024-01-04', 0xae62f9b4ffb348559d550811e33372c6, 53, 57, 2),
