(295, 'Уютно, приветливый персонал, большой выбор услуг но рекомендую подводный вакуумный массаж АкваТорнадо. Цены, скорее, средние. Рекомендую.', 10, 181, 'Ответ на отзыв', '2023-12-13', '2023-12-22', b'0', '2024-01-10', 0xae62f9b4ffb348559d550811e33372c6, 12, 57, 2),
(296, 'Спасибо вам большое !неделю мне ни кто не мог оформить  осаго и в главном офисе пробовали и по мелким компаниям ходили все было безрезультатно,а нам машину на учёт без полиса ни кто не хотел ставить ! Здесь же за 30 минут решила нашу проблему !Всем сосоветую', 36, 178, 'Ответ на отзыв', '2023-12-13', '2023-12-17', b'1', '2023-12-17', 0xdb4f8a2656f2441ba4c006c7efb19fc3, 220, 56, 1),
(297, 'Отличный уровень обслуживания: быстро, и главное, реально дешевле чем у многих! Делал страховку на свои 3 машины, 2 жены и 2 у брата - всем рекомендую👍', 36, 178, 'Ответ на отзыв', '2023-12-13', '2023-12-21', b'1', '2023-12-21', 0xdb4f8a2656f2441ba4c006c7efb19fc3, 123, 56, 1),
(298, 'Приехал оформлять страховку ребенку для соревнований. Адекватные и доброжелательные люди. Документы приняли и сказали что необходимо донести. А так же сказали, что можно отправить по электронной почте, не приходя к ним. Оформил в общем удаленно у них без потери времени. Спасибо огромное! ', 36, 178, 'Ответ на отзыв', '2023-12-13', '2023-12-24', b'1', '2023-12-24', 0xdb4f8a2656f2441ba4c006c7efb19fc3, 250, 56, 1),
(299, 'Закончилась страховка,на выходных почти все отдыхают. Обратился в Art-страхование , без очереди и нервов сделали страховку, все быстро и вежливо объяснили.Спасибо за Вашу работу!', 36, 178, 'Ответ на отзыв', '2023-12-13', '2023-12-27', b'1', '2023-12-27', 0xdb4f8a2656f2441ba4c006c7efb19fc3, 283, 56, 1),
(300, 'Оформлял страховку по ипотеке. Всё быстро и чётко за приятный ценник. Еще и скидку сделали. Спасибо', 36, 178, 'Ответ на отзыв', '2023-12-13', '2023-12-29', b'1', '2023-12-29', 0xdb4f8a2656f2441ba4c006c7efb19fc3, 214, 56, 1),
(301, 'Хочу выразить благодарность за юридическую консультацию компании Юристер! Я обратилась с запросом по банкротству и после консультации мы оформили договор. Будет работать дальше! Здесь готовы выслушать и учесть все ваши пожелания, хорошо разбираются в своей области и предоставляют достоверную информацию. ', 28, 182, 'ШАРИФ БАКИРОВИЧ И АННА ВАСИЛЬЕВНА', '2023-12-13', '2023-12-19', b'1', '2023-12-19', 0x93067b5c713e47129c2e956774fd053b, 151, 58, 1),
(302, 'Данная юридическая компания уже не раз нас выручала в сложных юридических вопросах. На консультациях Шариф Бакирович все грамотно и четко объясняет, и помогает с решением проблем. Безмерно благодарны.', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-22', b'1', '2023-12-22', 0x93067b5c713e47129c2e956774fd053b, 280, 58, 1),
(303, 'Обратилась в Юристер за помощью при оформлении сделки с недвижимостью. Адвокат  Анна Васильевна подошла к вопросу очень индивидуально, разобрала все тонкости вопроса и постаралась максимально подробно объяснить все важные моменты. Искреннее выражаю благодарность за такое отношение к работе и людям.', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-25', b'1', '2023-12-25', 0x93067b5c713e47129c2e956774fd053b, 133, 58, 1),
(304, 'Выражаю благодарность сотрудникам компании за высокий профессионализм. Первая встреча очень важна для клиента. Четкое исполнение сроков приема посетителей, практически без ожидания в холле. Доброе, внимательное отношение к клиенту. Убедительно и доказательно объяснили  проведение бракоразводной процедуры . Рассмотрели различные варианты и заключили договор. Надеюсь, что наше сотрудничество -завершится благополучно для обеих сторон.', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'1', '2023-12-28', 0x93067b5c713e47129c2e956774fd053b, 176, 58, 1),
(305, 'Выражаю огромную благодарность  \"Юристер\" !!! Вы очень надёжная и сплоченная команда! Всё чётко, ясно, грамотно! Рекомендую всем, кто сомневался! Не пожалеете!!!! Команде успехов в дальнейшем! 💐👍👏', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-30', b'1', '2023-12-30', 0x93067b5c713e47129c2e956774fd053b, 144, 58, 1),
(306, ' Месяц назад обратилась ы Юристер, по поводу развода и раздела имущества. В этом я толком не разбиралась, в начале я получила грамотную консультацию у Шарифа Бакировича,  проговорили все пути решения. Первым делом мне помогли оформить развод, вели меня по всем вопросам от начала до конца, а потому начали процесс раздела имущества. В итоге суд был на моей стороне, и большую часть имущества, как я в принципе и заслуживала, получила в свою собственность. Спасибо , Вы профессионалы!', 28, 182, 'Ответ на отзыв', '2023-12-13', '2024-01-03', b'1', '2024-01-03', 0x93067b5c713e47129c2e956774fd053b, 313, 58, 1),
(307, 'Хотим выразить огромную благодарность компании \"Юристер\"\r\n за оказанную юридическую помощь и представительство в суде\r\nПрофессиональный, качественный и подробный ответ на наши вопросы и доброжелательное отношение!!! Вы-команда профессионалов!!! Мы рады, что попали к Вам, в Ваши надежные руки! Наши трудности успешно разрешились! \r\nУдачи Вам! И еще раз огромное СПАСИБО!!! Мы рекомендуем именно Вас!', 28, 182, 'Ответ на отзыв', '2023-12-13', '2024-01-06', b'1', '2024-01-06', 0x93067b5c713e47129c2e956774fd053b, 208, 58, 1);
INSERT INTO `reviews` (`review_id`, `review_text`, `review_category`, `review_subcategory`, `review_answer`, `review_created`, `review_changed`, `review_publish`, `review_publish_date`, `review_order_details`, `review_bot`, `review_filial`, `review_worker`) VALUES
(308, 'У нас была ситуация, связанная с определением прав в отношении ребенка, которую очень долго не могли решить. Длились наши судебные разбирательства почти 4 года. После того как мы обратились к Анне Васильевне все сдвинулось с мертвой точки и все решается так как нужно. Мы очень благодарны этой компании. В дальнейшем у нас планы на долгосрочное сотрудничество с Вами. У нас есть еще несколько вопросов которые необходимо решить а в этой компании я теперь уверена на все 100%', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-19', b'0', '2024-01-09', 0x93067b5c713e47129c2e956774fd053b, 212, 58, 1),
(309, 'Однозначно рекомендую эту компанию. Не единожды помогали по разным вопросам, к делу относятся очень ответственно. Доброжелательное отношение, и при высоком уровне профессионализма цены более чем адекватные. В такую правовую компанию приятно обращаться!', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-19', b'0', '2024-01-12', 0x93067b5c713e47129c2e956774fd053b, 161, 58, 1),
(310, 'После подключения компании Юристер в лице Шарифа Бакировича, спор с работодателем разрешился в пользу работника в досудебном порядке, с выплатой всех причитающихся сумм. Спасибо огромное, за вашу помощь.', 28, 182, 'Ответ на отзыв', '2023-12-13', '2023-12-19', b'0', '2024-01-15', 0x93067b5c713e47129c2e956774fd053b, 222, 58, 1),
(311, 'Достойная компания с достойными сотрудниками.\r\nОдни из немногих в городе кто ответственно подходит к производственному процессу.  Осуществили строительство автомойки в установленный срок.\r\nСпасибо огромное за проделанную работу, ребята мастера своего дела.', 18, 183, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'1', '2023-12-28', 0x5ab4b8714a33433298d546110133bcbb, 26, 59, 2),
(312, 'Хочу поблагодарить компанию ПРОМСИСТЕМА-ЛСТК  за своевременно и качественно сделанный для нас автосервис. И по хорошей цене! Процветания и успехов вашей компании- будем вас с удовольствием рекламировать и советовать нашим знакомым и друзьям ! Спасибо !', 18, 183, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-03', 0x5ab4b8714a33433298d546110133bcbb, 89, 59, 2),
(313, 'Покупал здесь ЛСТК профиль. Хороший ассортимент и качество.', 18, 183, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-09', 0x5ab4b8714a33433298d546110133bcbb, 65, 59, 2),
(314, 'Заказывали здесь строительство автосервиса.\r\nОтличная компания! Адекватные цены! Сделали проект и построили с учетом всех наших пожеланий!!! Отдельная благодарность за профессионализм, выдержку и коммуникабельность!!! Всегда на связи!!!\r\nОднозначно продолжим строительство с этой компанией!!!', 18, 183, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-15', 0x5ab4b8714a33433298d546110133bcbb, 37, 59, 2),
(315, 'Хочу оставить положительный отзыв о работе данной организации. Занимались строительством автомойки. Мне все посчитали, предложили несколько вариантов. Качество меня полностью устроило. Все получилось как я и хотел, спасибо большое!!!', 18, 183, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-21', 0x5ab4b8714a33433298d546110133bcbb, 69, 59, 2),
(316, 'Здравствуйте, приобретали измельчитель веток, очень довольны техникой. А сервис приветливый и всегда готовы помочь. Рекомендую данную компанию!', 37, 184, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'1', '2023-12-28', 0x422695a653014c5197f5248ab2bcccb5, 69, 62, 2),
(317, 'Пару месяцев назад купили измельчитель деревьев, измельчитель соответствует заявленным характеристикам, сейчас планируем взять ещё несколько. У компании большой выбор оборудования, сотрудники подробно все показывают и всегда советуют с выбором. В общем полный спектр товаров и услуг! Молодцы!', 37, 184, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-03', 0x422695a653014c5197f5248ab2bcccb5, 12, 62, 2),
(318, 'Доброго времени суток! Обратился в данную организацию для приобретения техники измельчитель древесины Торнадо. Все прошло хорошо. ', 37, 184, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-09', 0x422695a653014c5197f5248ab2bcccb5, 28, 62, 2),
(319, 'Нужен был измельчитель деревьев для нужд ЖКХ. Позвонил, обсудили, подобрали нужный размер техники. Показали как пользоваться, подсказали все нюансы. ', 37, 184, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-15', 0x422695a653014c5197f5248ab2bcccb5, 9, 62, 2),
(320, 'Текст отзыва', 37, 184, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'0', '2024-01-21', 0x422695a653014c5197f5248ab2bcccb5, 78, 62, 2),
(321, 'С Деметра Digital  и его командой работаем уже несколько лет. У нас 3 сайта, которые нуждаются в постоянном продвижении. Очень довольны как стоимостью, так и качеством предоставляемых услуг.', 38, 185, 'Ответ на отзыв', '2023-12-13', '2023-12-28', b'1', '2023-12-27', 0x54a0134d59a647ddae2e774557d61f07, 87, 63, 2),
(322, 'Хочу выразить свою благодарность компании Деметра Digital за долгие годы сотрудничества! Спасибо вам за решение всех возникших вопросов, за оперативную поддержку, клиентоориентированность и знание своего дела! Лучшая it компания по продвижению сайта. С удовольствием порекомендую услуги Евгения своим друзьям.', 38, 185, 'Ответ на отзыв', '2023-12-13', '2023-12-27', b'0', '2024-01-02', 0x54a0134d59a647ddae2e774557d61f07, 69, 63, 2),
(323, 'Обращались за рекламой вконтакте. Подобрали хороший вариант, оперативно запустили рекламную кампанию! Большое спасибо сотрудникам!', 38, 185, 'Ответ на отзыв', '2023-12-13', '2023-12-27', b'0', '2024-01-08', 0x54a0134d59a647ddae2e774557d61f07, 83, 63, 2),
