(326, 'Благодарю за проделанную работу!!! За теплое отношение, предупредительность по многим вопросам подготовки к сделкам. За месяц две успешно проведенные сделки- все грамотно, четко и оперативно! Высочайший уровень организации и профессионализма. Признательна за участие и помощь в решении других жизненных вопросах. Качество работы на высшем уровне! Побольше бы таких профессионалов! РЕКОМЕНДУЮ!!!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'1', '2023-12-19', 0xdbd30187ca42446b9f6c70af00023067, 23, 64, 2),
(327, 'Остались только положительные впечатления от сотрудничества с ЖИЦ . Продавали и покупали квартиры сделки были не простыми ,НО всё прошло отлично !', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'1', '2023-12-20', 0xdbd30187ca42446b9f6c70af00023067, 46, 64, 2),
(328, 'Добрый день, покупала квартиру с ЖИЦ Южный дом . Квартира была непростая, да ещё и в ипотеку, но Виктория- молодец! Все организовала, постоянно на связи, поддержала в трудные моменты. Спасибо огромное!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'1', '2023-12-21', 0xdbd30187ca42446b9f6c70af00023067, 40, 64, 2),
(329, 'Покупал квартиру в новостройке через Южный дом с помощью Дмитрия. Был проведен по всем этапам от осмотра и до регистрации прав на недвижимость с удобством и полным удовлетворением от общения.\r\nЕсли не хотите волноваться за итоги сделки - рекомендую обращаться сюда.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'1', '2023-12-22', 0xdbd30187ca42446b9f6c70af00023067, 59, 64, 2),
(330, 'Хочется выразить огромную благодарность прекрасной команде Жиц Южный дом , в частности Константину за быструю и профессиональную работу, а также душевную чуткость и терпение при работе с пожилым клиентами. Большое Вам человеческое Спасибо, успехов и процветания! С большим удовольствием будем рекомендовать Вас как грамотных специалистов и хороших людей всем близким и знакомым.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-23', b'1', '2023-12-23', 0xdbd30187ca42446b9f6c70af00023067, 32, 64, 2),
(331, 'Спасибо Софие за хорошую и четкую работу. Ею было всё подробно объяснено, всё в сроки и даже быстрее чем думали. Тактичный, аккуратный и грамотный сотрудник! Очень довольны и будем обращаться ещё. Спасибо!!!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-24', b'1', '2023-12-24', 0xdbd30187ca42446b9f6c70af00023067, 83, 64, 2),
(332, 'Хотим поблагодарить Викторию! При изначально не очень выгодном положении, благодаря опыту, советам и профессионализму Вики приобрели квартиру своей мечты в хорошем районе!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-25', b'1', '2023-12-25', 0xdbd30187ca42446b9f6c70af00023067, 71, 64, 2),
(333, 'Для покупки большей площади квартиры обратились в ЖИЦ к Сергею, он очень грамотный специалист очень быстро помог в покупке жилья, на тот момент было ограничение по количеству вариантов, так же сумма была ограничена, но благодаря Никите удалось купить квартиру с большой площадью и в удачном месте. Также хотелось бы отметить грамотное сопровождение сделки юристом.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-26', b'1', '2023-12-26', 0xdbd30187ca42446b9f6c70af00023067, 37, 64, 2),
(334, 'В конце октября купили квартиру в новостройке через Южный дом. В связи с этим хочу поблагодарить агента Дмитрия за помощь в выборе квартиры. Дмитрий - ответственный и грамотный профессионал, было очень приятно с ним работать. На протяжении всего процесса выбора и приобретения благодаря Дмитрию мы чувствовали, что мы в надежных руках и что все под контролем.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-27', b'1', '2023-12-27', 0xdbd30187ca42446b9f6c70af00023067, 56, 64, 2),
(335, 'От всей души выражаю благодарность коллективу ЖИЦ Южный дом за проделанную высококвалифицированную работу по подбору квартиры в новом ЖК, подготовке документов и оформлению сделки.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-28', b'1', '2023-12-28', 0xdbd30187ca42446b9f6c70af00023067, 86, 64, 2),
(336, 'Огромное спасибо Константину за отличную работу, за профессионализм в решении проблем в поиске вариантов продажи и покупки квартиры. В команде с юристом они проявили себя как слаженная и грамотная команда.\r\nСпасибо им большое!!!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-29', b'1', '2023-12-29', 0xdbd30187ca42446b9f6c70af00023067, 100, 64, 2),
(337, 'Огромная благодарность работникам ЖИЦ. Подобрали отличную квартиру по отличной цене. Юрист осуществила\r\nпрекрасное сопровождение наших сделок. Это суперсервис!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-30', b'1', '2023-12-30', 0xdbd30187ca42446b9f6c70af00023067, 31, 64, 2),
(338, 'Два месяца назад решили купить квартиру, воспользовались услугами данной компании. Покупатели мы оказались привередливые, но наша агент - Дарья- все же смогла подобрать вариант. Помогла со всеми документами, встречами, все было во время и в срок.  Сделка прошла замечательно, мы довольны. Говорим спасибо и выражаем благодарность за профессионализм и верность делу!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-31', b'1', '2023-12-31', 0xdbd30187ca42446b9f6c70af00023067, 72, 64, 2),
(339, 'Здравствуйте! Хочу поделиться своим впечатлением о работе замечательных людей из Южного дома! Работа наша была кропотливой и сложной, но даже в такой ситуации помощь была всегда на высоком уровне, самое главное, что сотрудники тебе помогают, всегда можешь переспросить, задать вопрос и тебе ответят в развёрнутой форме, за что и ценятся такие люди... Сделка прошла раньше намеченного срока почти на 2 недели!!! Это просто очень приятно и для меня было очень важно! Хочу сказать спасибо и поблагодарить за работу. Я очень рад, что у нас все получилось, ваше отношение к работе впечатляет!) Ещё раз спасибо за вашу работу!!!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-01', 0xdbd30187ca42446b9f6c70af00023067, 16, 64, 2),
(340, 'Совершили сложную сделку по купле и продаже квартиры через ЖИЦ. Специалисты компании помогли подобрать хорошие варианты, составить грамотный договор, организовать встречи с клиентами, сопровождали нас по всем возникающим вопросам.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-02', 0xdbd30187ca42446b9f6c70af00023067, 61, 64, 2),
(341, 'Пользовался услугами данной компании при покупке квартиры в новостройке. Ни разу не пожалел, что обратился именно к ним! Сделку провели достаточно быстро. С меня сняли всю головную боль, помогли со всеми документами и т.д. Работал с агентом Никитой. Выражаю ему благодарность за профессионализм!\r\nОднозначно рекомендую \"\"ЖИЦ Южный дом\"\"!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-03', 0xdbd30187ca42446b9f6c70af00023067, 53, 64, 2),
(342, 'Жилищно-ипотечный центр- отличная компания, в чём мне приходилось убедиться ни один раз! Очень доволен, все быстро и гладко, грамотные специалисты!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-04', 0xdbd30187ca42446b9f6c70af00023067, 41, 64, 2),
(343, 'Хотим выразить сердечную благодарность риэлтору Дмитрию за профессионализм и прекрасную работу, за оперативность в решении сложных вопросов. Успехов и процветания Вам и Вашему коллективу! С уважением семья Юдаковых-Антипенко!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-05', 0xdbd30187ca42446b9f6c70af00023067, 101, 64, 2),
(344, 'Хочу выразить огромную благодарность Софие. Выслушала, поняла и учла все пожелания по подбору квартиры. Сработала оперативно и профессионально. В кратчайшие сроки подобрала варианты, один из которых подошел идеально, на нем и остановились. Подготовила все документы к сделке. Все было сделано в короткий срок и на высшем уровне. Очень приятно было работать с таким профессионалом. Спасибо Сифии и компании Южный дом!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-06', 0xdbd30187ca42446b9f6c70af00023067, 23, 64, 2),
(345, 'Хотим выразить благодарность специалистам компании Жилищно-ипотечный центр Южный дом. По рекомендации знакомых обратились к вам по поводу покупки квартиры в новом ЖК, было получено полное консультирование по всем вопросам и оказана помощь в получении и оформление ипотечного кредита. В кратчайшие сроки была найдена квартира, подходящая нам по всем параметрам. Спасибо большое за терпение и профессионализм! Всем буду рекомендовать данную компанию!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-07', 0xdbd30187ca42446b9f6c70af00023067, 27, 64, 2),
(346, 'Спасибо огромное за незаменимую помощь на пути к квартире нашей мечты!) ...помогли решить абсолютно все вопросы, сопровождали до последней подписи! Приятно было сотрудничать, рекомендуем всем, кто в поисках новой квартиры👍🏻', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-08', 0xdbd30187ca42446b9f6c70af00023067, 51, 64, 2),
(347, 'Хочу поблагодарить и порекомендовать отличных специалистов своего дела. У нас была сложная продажа ( перепланировка) и две покупки. Квартира продавалась в другом агентстве безрезультатно 1,5 года, в ЖИЦ смогли продать квартиру за 2 месяца. Нашли подходящий вариант в доме который нам понравился, сэкономила нам 300 тысяч на покупке .После покупки и продажи в \"ЖИЦ\" в другое АН уже идти не хочется. Буду рекомендовать друзьям!!!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-09', 0xdbd30187ca42446b9f6c70af00023067, 38, 64, 2),
(348, 'Очень благодарны Виктории за быструю, качественную и четкую работу! Было очень легко и конструктивно общаться, у нее легко находились ответы на все вопросы! Работа выполнена очень профессионально! Будем рекомендовать всем знакомым.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-10', 0xdbd30187ca42446b9f6c70af00023067, 87, 64, 2),
(349, 'Хочу поделиться со Всеми радостной новостью месяц назад я познакомилась с очень дружной и ответственной командой ЖИЦ. Это профессионалы своего дела, помогли мне выбрать и купить квартиру в прекрасном ЖК. Я даже не поняла как это вышло)))))) зато теперь я счастливый обладатель недвижимости))). Обращайтесь))) всем советую)', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-11', 0xdbd30187ca42446b9f6c70af00023067, 89, 64, 2),
(350, 'Хотим поблагодарить компанию ЖИЦ, в частности Константина, за продажу и покупку квартиры в новостройке. За добросовестный подход и внимательное отношение к клиентам. К нему мы обращаемся не первый раз. Приятно работать с профессионалом своего дела. Рекомендуем!!!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-12', 0xdbd30187ca42446b9f6c70af00023067, 45, 64, 2),
(351, 'Хотелось бы сказать огромное спасибо Дарье. Мы в первый раз занялись поиском покупки квартиры. Ожидали что это все будет долго и сложно, но все прошло гладко, чуть менее чем за месяц!! Сразу же в первый день сотрудничества подобрали идеальный вариант. В целом сложилось очень приятное мнение о компании. Теперь только к вам и только к Виктории. 💚👌🏾', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-13', 0xdbd30187ca42446b9f6c70af00023067, 30, 64, 2),
(352, 'Хочу выразить благодарность Дарье. Обращалась к ней не раз и всегда была довольна ее результатом. Она с пониманием и большой ответственностью подходит к личным требованиям клиента. Быстро и качественно оказала мне помощь в продаже и покупке квартиры. Советую обращаться именно к ней.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-14', 0xdbd30187ca42446b9f6c70af00023067, 93, 64, 2),
(353, 'Покупали квартиру с помощью компании ЖИЦ, сделку проводил Никита. Спасибо Вам за вашу работу. Понравилось все и скорость проведения сделки и качество оказания услуг. В следующий раз только в ЖИЦ! :)', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-15', 0xdbd30187ca42446b9f6c70af00023067, 86, 64, 2),
(354, 'При поиске квартиры мне довелось познакомиться с риэлтором Даниилом. Хотелось бы отметить пунктуальность, этого человека, очень хорошее качество любого человека, а риэлтора тем более. Его советы дают возможность проанализировать предложенные варианты при выборе квартиры. Вежлив, обходителен, энергичен. Вообщем очень довольна услугами предоставленными мне. Желаю Вашей компании побольше таких кадров.', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-16', 0xdbd30187ca42446b9f6c70af00023067, 24, 64, 2),
(355, 'Продавали и покупали квартиру через ЖИЦ. Риэлтор Натальей. Всю информацию о интересующих вариантах предоставляла оперативно, просмотры были согласованы на один день по несколько вариантов (что для нас было очень удобно). Спасибо Вам большое за Ваш профессионализм!', 33, 186, 'Ответ на отзыв', '2023-12-16', '2023-12-22', b'0', '2024-01-17', 0xdbd30187ca42446b9f6c70af00023067, 11, 64, 2),
(356, 'Работу свою выполнили очень хорошо. Все организовали. Спасибо.', 39, 187, 'Ответ на отзыв', '2023-12-16', '2023-12-24', b'1', '2023-12-24', 0xf16020c392634695a7f60c4c9837c00e, 164, 65, 1),
(357, 'Огромное спасибо за помощь! Вы делаете очень доброе дело! Очень хорошо что можно доверить эти хлопоты и достойные прощальные проводы самого близкого человека профессионалам!', 39, 187, 'Ответ на отзыв', '2023-12-16', '2023-12-27', b'1', '2023-12-27', 0xf16020c392634695a7f60c4c9837c00e, 191, 65, 1),
