(371, 'Любим Мажорики! Широкий выбор и ассортимент.Сезонные скидки. Персонал приветливый,очень заинтересованы в продажах,предложат кучу вариантов.Уйти без покупки сложно! По качеству претензий нет.Покупаем у них верхнюю одежду,блузки и брюки, свитера и т.д.Спасибо,что ВЫ есть!👍', 14, 83, 'Ответ на отзыв', '2023-12-17', '2023-12-21', b'1', '2023-12-21', 0x1af28a2d895845798e095f2d364a8eba, 126, 67, 1),
(372, 'Магазин детской и подростковой одежды.  Фасоны одежды отличаются от остальных магазинов - много прикольных красивых вещичек. Цены весьма демократичные. Ребенок любит одеваться именно здесь.', 14, 83, 'Ответ на отзыв', '2023-12-17', '2023-12-25', b'1', '2023-12-25', 0x1af28a2d895845798e095f2d364a8eba, 258, 67, 1),
(373, 'Качество одежды и обуви отличное. Детям удобно , комфортно и носят с удовольствием.', 14, 83, 'Ответ на отзыв', '2023-12-17', '2023-12-27', b'1', '2023-12-27', 0x1af28a2d895845798e095f2d364a8eba, 173, 67, 1),
(374, 'Выбора много, хорошее качество и часто акции. Удобно, что недалеко от дома и время работы магазина даёт возможность посетить его вечером, когда поменьше покупателей, а не только в выходной. Товар разбирают быстро. ', 14, 83, 'Ответ на отзыв', '2023-12-17', '2023-12-29', b'1', '2023-12-29', 0x1af28a2d895845798e095f2d364a8eba, 254, 67, 1),
(375, 'Супер цены, Супер качество, давно одеваю детей в этом магазине. После стирки все отменного качества, что важно!', 14, 83, 'Ответ на отзыв', '2023-12-17', '2024-01-04', b'1', '2024-01-04', 0x1af28a2d895845798e095f2d364a8eba, 304, 67, 1),
(376, 'Самая лучшая студии тату, где работают реально профессионалы своего дела 👍боже по молодости не думаешь о том, чего творишь и кажется круто, но проходят года ты взрослеешь и понимаешь какой косяк на твоём теле 🤦🤷так что если у вас есть ошибки молодости или Вы реально хотите достойную тату и не стадно её показать то Вам исключительно сюда.', 10, 188, 'мастера ОЛЬГА ЗУЕВА             АЛЕКСАНДР КЛИНОВКИН        ПЁТР МАВРЕНКОВ      ДМИТРИЙ БЛАГОВЕЩЕНСКИЙ НИКА ЛОГАЧЕВА                                                            ПЁТР МОИСЕЕВ                               МАКС МРЯСОВ', '2023-12-17', '2023-12-24', b'1', '2023-12-24', 0x5bb8b5e9a5054fd9adb059fd72796a2d, 227, 68, 1),
(377, 'я делала здесь первое в жизни тату, было страшновато, но мастер Александр так надежно взял всë в свои руки,что я сразу перестала бояться - помог с эскизом, подобрал размер, объяснил, как подготовиться... на следующую тату решиться будет уже намного проще и делать ее приду обязательно сюда❤', 10, 188, 'Ответ на отзыв', '2023-12-17', '2023-12-30', b'1', '2023-12-30', 0x5bb8b5e9a5054fd9adb059fd72796a2d, NULL, 68, 1),
(378, 'Не скажу за качество, но мои потребности закрыли полностью.  Подход к клиенту очень адекватный. Макс своё дело знает. Мне его работа понравилась на 100%.', 10, 188, 'Ответ на отзыв', '2023-12-17', '2024-01-05', b'1', '2024-01-05', 0x5bb8b5e9a5054fd9adb059fd72796a2d, 190, 68, 1),
(379, 'Всё отлично. Помогли, посоветовали. Сделали всё в срок, быстро качественно. Всё чисто, аккуратно. Рекомендую. ', 10, 188, 'Ответ на отзыв', '2023-12-17', '2023-12-24', b'0', '2024-01-11', 0x5bb8b5e9a5054fd9adb059fd72796a2d, 185, 68, 1),
(380, 'Не задумывалась о татуировке. И когда много их , честно скажу, мне не нравится. Люди в «гепюре» я их называю. Но что-то пошло не так. И в очередной раз, плавая в бассейне с подругами, у которых есть по одной-две татуировки, я озадачилась. Сработал стадный инстинкт. У всех есть! А я что, рыжая что ли?\r\n И я загорелась. Причём мне было надо все и сразу.Записалась на консультацию и мы с Ольгой  быстро решили какого размера, что это будет. Мне понравилось, что мастер поддержала мою идею. Процесс прошел не так болезненно как ожидала. Все ОК. Вот теперь думаю, смогу ли я остановиться?', 10, 188, 'Ответ на отзыв', '2023-12-17', '2023-12-24', b'0', '2024-01-17', 0x5bb8b5e9a5054fd9adb059fd72796a2d, 269, 68, 1),
(381, 'Огромное спасибо Александре за удаление тату. Очень приятная! Это был первый мой сеанс, особо каких-то болезненных ощущений не было. И сама студия очень понравилась! Благодарю Вас! Оборудование новейшее. Очень все красиво! И до встречи уже на последующих сеансах!', 10, 189, 'Ответ на отзыв', '2023-12-17', '2023-12-24', b'1', '2023-12-24', 0xd50429a96df64768a6337fd3a58c08c6, 195, 69, 1),
(382, 'В процессе удаления татуировки в \"Битом небитого\".Очень грамотный,приятный и квалифицированный специалист..Лазерное удаление не самый приятный процесс,но с таким подходом,консультациями и рекомендациями всё проходит максимально хорошо) Рекомендую!!!', 10, 189, 'Ответ на отзыв', '2023-12-17', '2023-12-30', b'1', '2023-12-30', 0xd50429a96df64768a6337fd3a58c08c6, 332, 69, 1),
(383, 'Я выражаю огромную благодарность Александре..я удаляла стрелочки лазером, процедура не из очень приятных, но чувствовала себя безопасно и полностью доверилась профессионалу.. все таки это глаза..все терпимо. 😊', 10, 189, 'Ответ на отзыв', '2023-12-17', '2024-01-05', b'1', '2024-01-05', 0xd50429a96df64768a6337fd3a58c08c6, 305, 69, 1),
(384, 'Респект и благодарность Дмитрию, удалял у него тату, результатом оказался доволен, очень качественный сервис, чуткое внимание к клиентам, тактичность, хотя бы ради этого хочется вернуться ещё. Прайс лист вполне норм. А администратор  вообще супер. Остались приятные впечатления после посещения салона.', 10, 189, 'Ответ на отзыв', '2023-12-17', '2023-12-24', b'0', '2024-01-11', 0xd50429a96df64768a6337fd3a58c08c6, 166, 69, 1),
(385, 'Все отлично. Администратор, мастер, условия , оборудование.\r\nАлександра -  большой профессионал своего дела. Удаляла татуаж бровей, болевые ощущения не сильные, отека почти не было. Результат отличный.', 10, 189, 'Ответ на отзыв', '2023-12-17', '2023-12-24', b'0', '2024-01-17', 0xd50429a96df64768a6337fd3a58c08c6, 165, 69, 1),
