(388, 'Отличное место. Прекрасный отдых в любое время года! Ходим уже постоянно и много лет всей семьей. ', 40, 190, 'Ответ на отзыв', '2023-12-17', '2023-12-31', b'1', '2023-12-31', 0x902da399e5554617aef2d34c92222c10, 33, 70, 2),
(389, 'Проводили корпоративный вечер в этом замечательном месте. Всё очень понравилось! Отличный ведущий. Красивый, комфортный зал, достаточно просторный. Зал светлый, декор приятный. Красивая посуда, скатерти, чехлы на стулья. Приветливый персонал. Вкусная еда. Красивая сервировка. Всё очень достойно! Работаю ведущей праздников, была во многих заведениях города, есть с чем сравнить. Однозначно, рекомендую для торжеств!', 40, 190, 'Ответ на отзыв', '2023-12-17', '2023-12-22', b'0', '2024-01-06', 0x902da399e5554617aef2d34c92222c10, 82, 70, 2),
(390, 'Нравится мне здесь. Всегда улыбаются, всегда приветливый персонал. Красиво, чисто, видно, что стараются. Отдыхали здесь с женой несколько раз. Ни разу не пожалел.\r\n', 40, 190, 'Ответ на отзыв', '2023-12-17', '2023-12-22', b'0', '2024-01-12', 0x902da399e5554617aef2d34c92222c10, 13, 70, 2),
