(396, 'Отличный выбор мебели. Долго искал что поставить на кухню. Понравилась расцветка так и взял на заказ по размеру.', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'1', '2023-12-20', 0x685015e370d941b9861032728b7becf9, 13, 72, 2),
(397, 'Заказали кухню.\r\nПолный восторг! Всё на высшем уровне. Уже на этапе знакомства с менеджером Марией, которая внимательно отнеслась к заказу, я решила, что не имеет смысла искать другие фирмы. Что касается формирования ценовой политики и системы оплаты, так тут реально имеет место индивидуальный подход.\r\nКухня установлена в срок. Очень красиво и аккуратно. Ещё попользоваться в полной мере не успели, но по всей мебели однозначно буду обращаться сюда', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'1', '2023-12-26', 0x685015e370d941b9861032728b7becf9, 56, 72, 2),
(398, 'Спасибо коллективу фабрики \"Портал\"  за изготовленный шкаф в детскую. Очень понравился дизайн, очень красиво получилось. Также хочется отметить работу замерщиков и сборщика Ивана.', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-21', b'0', '2024-01-01', 0x685015e370d941b9861032728b7becf9, 82, 72, 2),
