(400, 'Текст отзыва', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-21', b'0', '2024-01-13', 0x685015e370d941b9861032728b7becf9, 99, 72, 2),
(401, 'Хочу выразить благодарность компании\r\nПортал и ее сотрудникам за\r\nпроделанную работу, начиная от\r\nпроекта и заканчивая установкой\r\nмебели! На всех этапах всё выполнено\r\nпрофессионально и в срок.\r\nБелоснежные шкафы-купе в\r\nклассическом стиле отлично вписались\r\nв спальню. Результат\r\nоказался на высоте!', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-23', b'1', '2023-12-23', 0x568dab806b154aee82bbae55c869a55f, 7, 73, 2),
(402, 'Заказывали кухонный гарнитур. Все сделали в срок, что не маловажно. Мебель качественная, монтаж профессиональный. Менеджеры отвечают на любые вопросы, практически в любое время суток. Считаю, что главная характеристика данной компании - это клиентоориентированность. Есть, конечно, нюансы, но, более чем уверен, что совместно мы их решим. С удовольствием придем в данную организацию за новой мебелью!', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'1', '2023-12-26', 0x568dab806b154aee82bbae55c869a55f, 79, 73, 2),
(403, 'Хвалю компанию, молодцы!! Сколько мы объездили мебельных салонов, прежде чем обратиться сюда, зря только тратили свое драгоценное время. Шкаф-купе просто класс! Замерщику и дизайнеру респект. Будем рекомендовать друзьям и знакомым.', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-01', 0x568dab806b154aee82bbae55c869a55f, 9, 73, 2),
(404, 'Мы с мужем заказывали дизайнерскую кухню в новую квартиру. Изготовили быстро, меньше сроков думаю и не бывает. Доставили и через пару дней собрали на месте. Мы ничего не контролировали, а только приняли уже конечный результат. Ребята молодцы, сработали на 5+, аккуратно. Материалы отличные, без нареканий по качеству.', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-07', 0x568dab806b154aee82bbae55c869a55f, 22, 73, 2),
(405, 'Заказала у них шкаф в прихожую. Важно было качество и экологичность материалов. Проверила по стандартам, да они действительно изготавливают мебель из экологичного сырья. Мебель качественная, аккуратная, без дефектов и недочетов.', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-13', 0x568dab806b154aee82bbae55c869a55f, 72, 73, 2),
(406, 'Хорошая фабрика. Заказывала шкаф в спальню. Менеджер Анна грамотно помогла с дизайном. Все полочки, ящички, дверцы обговорили, нарисовали. Материалы подобрали. Перед изготовлением приходили парни на замер, учли все нюансы, внесли коррективы. После изготовления согласовали дату монтажа, пришли и установили. Всё профессионально, согласованно. Я очень довольна. Пользуюсь и радуюсь. Спасибо!', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-24', b'1', '2023-12-24', 0xc7bf6f0a15774436bd237a1ab1347921, 57, 74, 2),
(407, 'Спасибо мебельной фабрике Портал за мой новый шкаф! Большое спасибо дизайнеру Марии и сборщику мебели Виталию. Контакт на 5. 😊', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'1', '2023-12-26', 0xc7bf6f0a15774436bd237a1ab1347921, 99, 74, 2),
(408, 'Спасибо большое сотрудникам компании за воплощение мечты в реальность!!! Шкаф вышел лучше, чем я себе представляла. Особая благодарность дизайнеру Анне за то, что поняла мои идеи и сборщикам за их профессионализм. Молодцы!!!', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-01', 0xc7bf6f0a15774436bd237a1ab1347921, 58, 74, 2),
