(416, 'Летом искала компанию в сети интернет для установки ворот на нашем участке, наткнулась на компанию с большим опытом работы -  и обратилась в офис с просьбой о замере. Приехали, выполнили замер, посчитали на месте и озвучили цену - вполне приемлемая. Монтаж сделали в сентябре, бригада приехала в обозначенное время и быстро все установила. Красиво, быстро, аккуратно, спасибо Вам большое!', 18, 191, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'1', '2023-12-26', 0x75a6264a71464a9ea50728848e55fc29, 39, 71, 2),
(417, 'Выражаю благодарность всем работникам «Абсолютстрой» за слаженную работу, а особенно замерщику, который посоветовал, какой именно потолок подойдет к моим обоям, шторам и всей обстановке. Получилось очень хорошо. Ольга Федоровна.', 18, 191, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-01', 0x75a6264a71464a9ea50728848e55fc29, 86, 71, 2),
(418, 'Заказывали здесь окна на дом. Все сделали в указанный срок. Очень понравился профиль \"КBE\". Монтажники установили все быстро и хорошо. Выбирали по отзывам и не прогадали!', 18, 191, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-07', 0x75a6264a71464a9ea50728848e55fc29, 49, 71, 2),
(419, 'Снова пишу отзыв про Абсолютстрой))) Год назад делали потолки в комнатах, а теперь заказывали в коридор и прихожую. Все тот же грамотный приятный замерщик, все такие же аккуратные и старательные монтажники. Вот молодцы, честное слово, делая ремонт редко кого встретишь, кто без косяков работает.', 18, 191, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-13', 0x75a6264a71464a9ea50728848e55fc29, 61, 71, 2),
(420, 'Здравствуйте! Благодарю компанию за качественную работу и профессионализм в своем деле! Сделала заказ на окно и дверь, поставили все ровненько, аккуратно ,чисто ,мусор убрали. Поставили 7 сентября. Спасибо!', 18, 191, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-19', 0x75a6264a71464a9ea50728848e55fc29, 26, 71, 2),
(421, 'Обратились в компанию сделать потолок в гостиную, заказ выполнили точно и в срок. Бригада монтажников свою работу выполнили быстро и качественное. В будущем планирую ещё обращаться в данную компанию, а так же рекомендую всем желающим изменить свои потолки. Большое спасибо за работу.', 22, 193, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'1', '2023-12-26', 0x7667c956e90c40e9b1550bcaaa6d2dc3, 44, 76, 2),
(422, 'Добрый день! Хотели бы сказать большое спасибо менеджерам данной организации за свою работу! С супругой приобретали ворота в гараж! Очень переживали за качество и сроки ( менеджеры оповестили, что сроки в сезон увеличены), но уведомили что все сделают в срок по договору! Так и получилось, качеством довольны, все работает на ура! Изделие установили в срок!) Порекомендовали всем соседям)))', 22, 193, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-01', 0x7667c956e90c40e9b1550bcaaa6d2dc3, 39, 76, 2),
(423, 'Сделали потолки в квартире быстро качественно по адекватным ценам, рекомендую всём 🤝🤝🤝🤝🤝👍👍👍👍', 22, 193, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-07', 0x7667c956e90c40e9b1550bcaaa6d2dc3, 32, 76, 2),
(424, 'Покупал себе на предприятие несколько ворот и себе домой в этой компании. Всё было сделано отлично и быстро. Начиная от замеров и заканчивая монтажом. Уложились всего в 2 недели, что было для меня очень критичным! Ребята справились на УРА!', 22, 193, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-13', 0x7667c956e90c40e9b1550bcaaa6d2dc3, 19, 76, 2),
(425, 'Сегодня сделали монтаж потолка сложный, с лестницей и колонкой , монтажник Сергей молодец ,очень внимательный до мелочей и аккуратный . Хорошая фирма рекомендую .', 22, 193, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'0', '2024-01-19', 0x7667c956e90c40e9b1550bcaaa6d2dc3, 86, 76, 2),
(426, 'Выражаю свою благодарность за хорошо выполненные работы мебельной фабрике \"Портал\" в особенности менеджеру Марии. Благодарю за оперативное изготовление нашей кухни. Все сделали в срок и очень качественно за доступную цену. Компанию \"Портал\" Буду рекомендовать своим друзьям и близким. Спасибо Вам большое.\r\n', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-25', b'1', '2023-12-25', 0x06ed5c8558a8418092f5888c8440d3df, 73, 75, 2),
(427, 'Делала кухню в Портале.\r\nУ меня маленькая кухня-гостиная, больше всего боялась, что мебель будет грубо и тяжело смотреться. Но, спасибо менеджеру проекта,\r\nЖанне, которая помогла быстро подобрать оптимальное решение для моих площади и пожеланий.', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-26', b'1', '2023-12-26', 0x06ed5c8558a8418092f5888c8440d3df, 58, 75, 2),
(428, 'Заказала в компании \"Портал\" кухню для квартиры-студии, хотелось небольшую и не сильно \"кухонную\": результат меня устроил, сроки переносила я, так как не успевала с ремонтом. Спасибо менеджерам и мастерам по монтажу кухни, надеюсь, что в эксплуатации кухня будет меня радовать!\r\n', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-01', 0x06ed5c8558a8418092f5888c8440d3df, 78, 75, 2),
(429, 'Искали компанию для изготовления нам кухни. Проштудировали интернет и случайно наткнулись на вашу компанию. Очень хорошо, что у вас своё производство. Спасибо мастеру Юрию за его работу. Результатами ваших трудов теперь любуемся каждый день. Очень рады, что обратились к вам!\r\n', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-07', 0x06ed5c8558a8418092f5888c8440d3df, 82, 75, 2),
(430, 'Текст отзыва', 12, 192, 'Ответ на отзыв', '2023-12-19', '2023-12-22', b'0', '2024-01-13', 0x06ed5c8558a8418092f5888c8440d3df, 12, 75, 2),
