(433, 'Купил новый автомобиль Haval. У дилера озвучили цену тонировки в районе 20к за заднюю полусферу, У ребят гораздо дешевле и при этом сделали все очень аккуратно и качественно. Я очень доволен! ', 2, 194, 'Рады стараться, приезжайте!', '2023-12-20', '2023-12-27', b'1', '2023-12-27', 0x894f763862414f94a5a9d1aeac93ee98, 264, 77, 1),
(434, 'Притемнил  оптику переднюю и заднюю на своем Land Rover. Показали варианты, посоветовали как будет лучше. Сделали все качественно и красиво.', 2, 194, 'Рады стараться! ', '2023-12-20', '2023-12-30', b'1', '2023-12-30', 0x894f763862414f94a5a9d1aeac93ee98, 270, 77, 1),
(435, 'Материалы отличного качества. Для меня было очень важно чтобы пленка была не корейская. Спасибо за достойно выполненную работу. Обязательно буду рекомендовать Вас свои знакомым!', 2, 194, 'Спасибо, ждем вас снова!', '2023-12-20', '2024-01-04', b'1', '2024-01-04', 0x894f763862414f94a5a9d1aeac93ee98, 114, 77, 1),
(436, 'Купил вторую машину в семью Gelly Coolray, первая haval f7, спустя два года на бампере и капоте сколы, так как у нас дороги посыпают гравием, по этому горькому опыту на Gelly решил защитить кузов, заехал к ребятам, они мне оклеили полиуретановой плёнкой всю фронтальную часть. Теперь морда в безопасности ) Ребята молодцы сделали всё четко, чувствуется рука профессионалов )', 2, 195, 'Спасибо за подробный отзыв, будем ждать вас снова!', '2023-12-20', '2023-12-25', b'1', '2023-12-25', 0xa997ee6740b94c31bc4fed6fc3fc0501, 281, 78, 1),
(437, 'Притемнил фары на своей  бмвешечке 5-ке, теперь фары защищены и смотрятся круто ) Спасибо ребятам за работу )', 2, 195, 'Рады помочь)', '2023-12-20', '2023-12-27', b'1', '2023-12-27', 0xa997ee6740b94c31bc4fed6fc3fc0501, 135, 78, 1),
(438, 'Оклеил свой Lincoln в круг в полиуретановую плёнку, ребята подошли очень серьезно к делу, забронировали так же хромированные молдинги и решетку радиатора, я оценил . Сделали все аккуратно, уложились в поставленные сроки. ', 2, 195, 'Рады стараться, приезжайте еще!', '2023-12-20', '2023-12-29', b'1', '2023-12-29', 0xa997ee6740b94c31bc4fed6fc3fc0501, 274, 78, 1),
(439, 'Надоел цвет своей машины, красить не хотелось, специалиста найти сложно, посоветовали ребят из Fedenko wrap. Помогли определиться с цветом, у них на этот случай много вееров, с самыми разными вариантами, от черного матового до хамелеона. Оклеили всю машину с проемами, работой доволен, вид огонь, крутые ребята! Оклеить машину проще чем покрасить, да и пленку можно будет снять через время', 2, 195, 'Рады помочь)', '2023-12-20', '2024-01-03', b'1', '2024-01-03', 0xa997ee6740b94c31bc4fed6fc3fc0501, 307, 78, 1),
(440, 'Оклеил машину полиуретановой пленкой, очень красиво выглядит, ребята сделали всё чётко, без косяков. Спасибо вам за работу', 2, 195, 'Ответ на отзыв', '2023-12-20', '2023-12-25', b'0', '2024-01-07', 0xa997ee6740b94c31bc4fed6fc3fc0501, 219, 78, 1),
