(446, 'Всегда печатаю здесь. Могу сказать, что соотнесения цены и качества устроило. Сначала думала не разберусь, но все гораздо проще, чем я думала. . ', 41, 197, 'Ответ на отзывыМы не типография, книги не печатаем.   К нам услуги только копирования, сканирования , распечатка с телеграмм бота и USB.   Первый отзыв совершенно не подходит . Всегда печатаю здесь. Могу сказать, что соотнесения цены и качества устроило. Сначала думала не разберусь, но все гораздо проще, чем я думала. . ', '2023-12-24', '2024-01-05', b'1', '2023-12-26', 0x208988e1bb304dce91ba6340780f7e90, 134, 80, 1),
