(454, 'Рекомендую это место. Не думала, что будет сложно найти красивые и свежие цветы со срочной доставкой в 6 утра. Написала в 5 разных компаний в центре: мне либо не отвечали (хотя было написано, что работают круглосуточно), либо отвечали долго, либо цветов не было в наличии (это как?), либо доставка только с 9 утра (тоже странно), я начинала психовать. В общем, я рада, что нашла этих ребят - им не нужно ничего долго объяснять, сработали быстро и красиво.', 25, 156, 'Ответ на отзыв', '2023-12-26', '2023-12-26', b'0', '2024-01-04', 0x5cbc6ec8583b46bd859862d9c7d25813, 17, 81, 2),
