(521, 'С детьми приезжали на соревнования в Орел и жили в \"Прянике\". Очень все понравилось. Нас разместили в новом корпусе. В идеальном состоянии, все новое, чисто, уютно и очень тепло. Дети жили на первом этаже в общих номерах в стиле хохлома. На этаже есть душевая очень светлая, большая и чистая. Есть чайник, микроволновка. Тренера останавливались в люксе хохлома. Номер очень приятный и уютный, в русском стиле. С душевой  и санузлом в номере. Все есть для комфортного проживания.  Было приятно отдыхать после трудного дня соревнований в таком уютном месте. Спасибо Вам! ', 5, 35, 'Ответ на отзыв', '2023-12-28', '2023-12-29', b'0', '2024-01-08', 0x277e933896f24794a85f95dce6fe6299, 261, 25, 1),
