(523, 'Мы с командой жили в этом хостеле и в первом и во втором корпусе и я могу сказать, что каждый раз нам и уютно и комфортно останавливаться у Вас. В номерах и общей зоне есть все самое необходимое(чайник, микроволновка, чай, вкусняшки). Интерьер у каждого номера свой, персонал всегда приветлив и идет тебе навстречу при каких-то форс-мажорных обстоятельствах. Максимум удобств за небольшие деньги. Рекомендуем!', 5, 35, 'Ответ на отзыв', '2023-12-28', '2023-12-29', b'0', '2024-01-13', 0x277e933896f24794a85f95dce6fe6299, 132, 25, 1),
