(551, 'Сдала ненужное золото, быстро, с ценами на сайте все совпало. Спасибо', 31, 202, 'Ответ на отзывСпасибо вам за отзыв!', '2023-12-29', '2023-12-30', b'0', '2024-01-20', 0x7dc50ffc39d043148954c62de51d9546, 27, 88, 2),
(552, 'Все прошло отлично! Очень удачно и выгодно удалось избавиться от старых украшений, которые много лет лежали «мёртвым грузом»:)) спасибо за помощь, быстрое и вежливое обслуживание👍🏼', 31, 202, 'Ответ на отзывЖдем вас снова! Спасибо за отзыв!', '2023-12-29', '2023-12-30', b'0', '2024-01-23', 0x7dc50ffc39d043148954c62de51d9546, 64, 88, 2),
(553, 'Сдавал недавно старый порванный золотой браслет.\r\nДолго правда проверяли, но тем не менее приняли по стоимости указанной на сайте.\r\nЦена реально выше чем у других!', 31, 202, 'Ответ на отзывСпасибо за отзыв, ждем вас снова!', '2023-12-29', '2023-12-30', b'0', '2024-01-26', 0x7dc50ffc39d043148954c62de51d9546, 95, 88, 2),
(554, 'Поменяли колодки быстро, а так же обнулили ошибку сервиса по колодкам, спасибо огромное ребятам)', 2, 158, 'Ответ на отзыв', '2023-12-29', '2023-12-30', b'0', '2024-01-10', 0x212c1145157e4f93b78936e7b18e4d3b, 23, 17, 2),
(555, 'Сервис отличный, ребята знают свое дело. Вчера менял у них тормозные диски, все быстро, четко, профессионально. Теперь буду обращаться только к ним. Спасибо за качественную работу', 2, 158, 'Ответ на отзыв', '2023-12-29', '2023-12-30', b'0', '2024-01-16', 0x212c1145157e4f93b78936e7b18e4d3b, 42, 17, 2),
(556, 'Третий раз заезжаю и пока мнение только положительные, а именно: быстро работают, качество работы устраивает, лишнего ничего не навязывают. Сделали машинку, ходит отлично. Рекомендую.', 2, 158, 'Ответ на отзыв', '2023-12-29', '2023-12-30', b'0', '2024-01-22', 0x212c1145157e4f93b78936e7b18e4d3b, 70, 17, 2),
(557, 'Вчера загорелась красная лампочка на приборной панели и появился какой-то скрип во время езды. Решила заехать в SKR Service . Все чётко разобрались, поменяли колодки и все проблемы ушли. Спасибо большое', 2, 158, 'Ответ на отзыв', '2023-12-29', '2023-12-30', b'0', '2024-01-27', 0x212c1145157e4f93b78936e7b18e4d3b, 38, 17, 2),
(558, 'Пригоняли РХ-350 на диагностику, плавали обороты на холодную. Оставили авто на ночь, в течение первой половины дня неисправность была выявлена. Решили устранить самостоятельно. Автомобиль вернули в целости и сохранности.\r\nСервис очень понравился. Однозначно рекомендую данную организацию за очень статусный сервис и компетентный подход. Вернусь за переустановкой парктроников. Очень приятно иметь с вами дело!!!', 2, 158, 'Ответ на отзыв', '2023-12-29', '2023-12-30', b'0', '2024-02-02', 0x212c1145157e4f93b78936e7b18e4d3b, 29, 17, 2),
(559, 'В детскую купили безопасный обогреватель, который работает в нескольких режимах, отключается при опрокидывании и не пересушивает воздух. Сложно было определиться среди большого количества моделей, хорошо что консультант сравнить помог.', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 52, 89, 2),
(560, 'Отличный выбор и специалисты, все грамотно посоветуют и покажут в климате профессионалы, подобрали кондиционер и установили все отлично, я доволен, следующим летом буду кайфовать)', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 88, 89, 2),
(561, 'Инфракрасный обогреватель с комбинированной установкой купили в Адель. Моделей было достаточно, поэтому смогли подобрать и по внешнему виду приличный прибор и по стоимости в пределах своего бюджета. Консультант грамотный, на все вопросы ответил, приятно было общаться', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 59, 89, 2),
(562, 'Хорошие впечатления о компании, заказывал у них тепловую завесу с доставкой и монтажом, все сделали в соответствии с договоренностью. Нашел сравнительно недорогую модель, но по функционалу отличную и гарантию на нее мне предоставили.', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 65, 89, 2),
(563, 'В прошлом месяце установили кондиционер, все нормальные люди это летом делают, но мы не из тех, кто сани готовит летом) Нашли хорошую модель, заказали установку. Монтаж выполнили хорошо, даже мусора после себя не оставили. В холода будем кондиционером обогреваться и к жаре уже готовы)\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 50, 89, 2),
(564, 'Подготовились к сезону холодов, заказали теплый пол с установкой. Нам составили проект, по нему предоставили расчет итоговой суммы и согласовали проведение монтажа. Специалисты все сделали в аккурат, проверили работу перед сдачей, никаких недочетов не обнаружили', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 56, 89, 2),
(565, 'По всем правилам и в соответствии с проектом сделали нам теплый пол. Хорошая компания, в которой и купить комплектующие сразу можно и воспользоваться профессиональным монтажом. Результатом довольны, уже не представляем как раньше без теплого пола жили', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 16, 89, 2),
(566, 'Новый функциональный терморегулятор с управлением по вай-фай купили в магазине. Понравился выбор, а также грамотная консультация, за счет которой смогли выбрать подходящую модель. Думала что они подешевле стоят, но конечно за такие опции и заплатить не жалко.\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 57, 89, 2),
(567, 'Для гаража заказывал через интернет-магазин компании тепловую пушку, выручала не раз за зиму в сильные морозы. Сравнивал по стоимости с другими магазинами и здесь нашел что самая выгодная она.', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 19, 89, 2),
(568, 'Не только качественный в плане своих свойств стеклянный обогреватель купила в магазине, но еще и красивый) Понравилась модель с красочным изображением, смотрится незаурядно, я люблю такие вещи. Сотрудник магазина меня проконсультировал по характеристикам, сомнений в покупке не было\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 32, 89, 2),
(569, 'Теплый пол в ванной комнате это настоящий кайф, нам его сделали под плитку, никаких намеков на то, что он там есть даже и не присутствует) Профессионально справились с работой, выполнили ее за 1 день, предварительно к нам выезжал их специалист по замеру, предоставили смету к которой не возникло вопросов', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 40, 89, 2),
(570, 'Кондиционер с монтажом получили в рабочем состоянии, теперь он у нас на гарантии, которую предоставила компания. Понравилось все от момента покупки, правда купить пришлось модель подороже, но не потому что нам ее навязать пытались, а потому что по функционалу подходила наилучшим образом\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 88, 89, 2),
(571, 'Тепловую завесу для своего магазина заказывал с последующей установкой, все сотрудники сделали оперативно и главное что без переносов сроков и претензий к качеству. Был выбор тепловых завес, консультировался предварительно, выбрал оптимальную, которую потом доставили и установили.', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 75, 89, 2),
(572, 'В компанию обращались по установке теплых полов во всей квартире, нам и проект составили и все сделали как подабает, в общем ответственно к этому делу специалисты компании подошли. На выполненные работы получили гарантию, сотрудник даже показал по настройкам как что устанавливать\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 30, 89, 2),
(573, 'Нагревательные маты для теплого пола заказывал через интернет в магазин по выгодной цене, они шли в комплекте с терморегулятором. После оформления заказа со мной связались, чтобы согласовать доставку или самовывоз, выбрал последнее, мне сказали что можно приезжать. Товар получил, к качеству претензий нет', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 96, 89, 2),
(574, 'Обогревателей выбор огромный, не только привычные всем конвекторы, которые только портят интерьер своим присутствием. Мы решили вопрос с теплом в квартире, купив подвесной инфракрасный обогреватель, нам его приехали и установили, все отлично в плане работы', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 7, 89, 2),
(575, 'Теперь и мы со сплит-системой) Смогли выбрать в магазине отличный вариант с учетом площади нашего дома, договорились на установку сразу при покупке и сумму нам включили в итог. Приехали с небольшим опозданием на монтаж, но сделали все культурно и аккуратно. Спасибо!', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 83, 89, 2),
(576, 'Заменил терморегулятор к теплому полу, который у нас вышел из строя. Приехал со старым в магазин и мне предложили несколько подходящих вариантов, среди которых нашел что выбрать с учетом стоимости и функций. Доволен покупкой, сотрудники здесь в ассортименте разбираются отлично\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 27, 89, 2),
(577, 'Купила в магазине приточно-вытяжную систему с монтажом, так как у меня ее устанавливать было некому, а компания сама занимается такими вопросами, так что доверила дело профессионалам. Не могу сказать дорого здесь или нет, но главное что работа была выполнена на совесть, не испортили ничего в помещении, где производилась установка', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 28, 89, 2),
(578, 'Мойку воздуха от бренда Электролюкс купила в Адель еще в прошлом месяце, хочу сказать что она реально справляется со своими задачами, дышать стало комфортнее и сухость кожи прошла. Выбор большой, сравнить разные модели мне помог их специалист, имени не запомнила, но работой довольна, ничего не навязывал\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 43, 89, 2),
(579, 'В совмещенном санузле решили сделать теплый пол, обратились в компанию, так как у нас знакомые тоже у них делали. Понравилось что все объяснили, приехал специалист, который произвел замеры и по ним расчеты. Монтаж проводили в удобный нам день, на который договаривались заранее', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 96, 89, 2),
(580, 'Всю зиму бед не знали с инфракрасным подогревателем, который купили здесь в комплекте с терморегулятором. Поменяли радиаторы и стало прям холодно, вот что значит чугунные были! Сотрудник магазина помог определиться с выбором, проконсультировал по товару и оформил покупку, тут же нам новый вынесли в коробке\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 69, 89, 2),
(581, 'Обращались по установке теплого пола в частный дом, нам все спроектировали, помогли определиться с типом нагревательных элементов, после чего предоставили смету. По работе все было выполнено в срок, конечно удовольствие это не бюджетно, но комфорт нас устраивает полученный', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 65, 89, 2),
(582, 'Хорошая клиентоориентированная компания, сделали все четко', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 88, 89, 2),
(583, 'Кровля всегда теперь без наледи и снега, установка обогрева прошла благополучно, выполнялась специалистами, а не дилетантами. И спроектировали монтаж и сделали все как надо. Установка еще на гарантии, поэтому не переживаю за ее работоспособность. Одно могу сказать что если задумались об обогреве кровли, то могу посоветовать эту компанию, индивидуальное решение для конкретного клиента предлагают', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 28, 89, 2),
(584, 'Поставили в доме 2 приточно-вытяжные вентиляции, которыми можно управлять с пульта. Доволен что нашли отличные приборы, благодаря которым в доме воздух не спертый и постоянно обновляется.\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 28, 89, 2),
(585, 'Выгодно приобрели комплект инфракрасного обогревателя с терморегулятором-пользоваться одно удовольствие) Предложение было выгодное в плане стоимости, прикинули в другом магазине во сколько встанет такая покупка и оформили заказ в Адель) Доставили в удобное время, проблем с качеством не было', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 90, 89, 2),
(586, 'Просто молодцы в плане установки теплого пола в ванную, я даже не думала что так оперативно все сделают, терморегулятор незамысловатый выбрали, за счет чего легко переключать режимы и менять температуру. Довольна всем начиная от консультации и заканчивая установкой. Когда работу выполнили забыли мне на подпись дать акт, так что мастерам пришлось возвращаться', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 46, 89, 2),
(587, 'Пользуемся уже полгода мойкой воздуха, которую приобретала в этом магазине. Заказывала через интернет, потому что на подходящую модель еще и скидка была, сравнивала стоимость на аналогичную в других магазинах и пришла к выводу что выгоднее чем здесь больше нигде ее не найду. Работает прибор отлично, заметно комфортнее стало дышать и воздух не сухой как обычно у нас.\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 40, 89, 2),
(588, 'Классный кондюк установили нам, модель с пультом, в общем все как надо. Нашли свой вариант по своему бюджету, хорошо что магазине еще предлагает установку, которую произвели они четко и даже обучение произвели, так что на всем готовеньком его получили) Хорошее отношение к делу, несмотря на то что немножко опоздали на монтаж произвели его быстро\r\n', 43, 199, 'Ответ на отзыв', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 76, 89, 2),
(589, 'Обогреватель из закаленного стекла смотрится просто отлично, и это помимо того что он хорошо справляется со своими обязанностями по поддержанию тепла. Выбор присутствовал в магазине, более оригинальных моделей я не нашел нигде, поэтому и решился на покупку здесь. Первый опыт покупки в этом магазине считаю успешным)', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 36, 89, 2),
(590, 'Больше не рискуем поскользнуться на крыльце за счет установленного подогрева, которое нам в прошлом году монтировали. Не так уж и затратно получилось по стоимости и текущему расходу энергии, наледь вся моментально превращается в воду. Толковые специалисты в компании работают, что по части консультирования, что по установке, не подвели с результатом', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 56, 89, 2),
(591, 'Умеют общаться с покупателями, сколько магазинов объехали и в итоге покупку совершили в Адель. Хороший ассортимент, ИК обогревателей. Выбрали модель которая совместима с терморегулятором, согласовали модель произвели оплату. Уже на следующий день к нам приехал наш обогреватель)\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 7, 89, 2),
(592, 'Теплый пол быстро и качественно был установлен в квартире, полностью все помещение обеспечили теплом и дали гарантию на свою работу. Работой доволен, специалисты серьезно относятся к работе.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 32, 89, 2),
(593, 'Отличный электрический конвектор приобрели, он и влагозащиту имеет и защиту от перегрева, так что в использовании безопасен. Забрали сразу его после оформления покупки, причем не витринный, а со склада\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 8, 89, 2),
(594, 'Посоветовали мне в этом магазине посмотреть тепловую завесу, как оказалось не зря, потому что выбор нашла приличный. Работает исправно, еще на гарантии прибор находится, не пожалела что купила эту модель\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 21, 89, 2),
(595, 'Умеют общаться с покупателями, сколько магазинов объехали и в итоге покупку совершили в Адель. Хороший ассортимент, ИК обогревателе. Выбрали модель которая совместима с терморегулятором, согласовали модель произвели оплату. Уже на следующий день к нам приехал наш обогреватель)\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 77, 89, 2),
(596, 'И купили и получили установку кондиционера, теперь дома прям комфортно независимо от погоды за окном.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 91, 89, 2),
(597, 'Консультант подобрал всё, что необходимо\r\nСтоимость всех комплектующих для тёплого пола очень порадовала', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 46, 89, 2),
(598, 'По выполненным работам проблем не возникает, еще в прошлом году нам произвели монтаж системы антиоблединения кровли, который хорошо показал себя в деле-больше нет необходимости заказывать услуги по сбросу снега с крыши и со стоком проблем нет. Хорошо справились со своей работой, в планах обогрев крыльца, по расходам установка недорого обходится в плане потребления электроэнергии.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 53, 89, 2),
(599, 'Много полезного в одном магазине продается. Не первый раз у них покупаю, пользуюсь уже 2 года увлажнителем воздуха, который помогает поддерживать комфортный микроклимат в квартире, а недавно купила обогреватель. ', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 65, 89, 2),
(600, 'Подобрали теплый пол на балкон, смонтировали. Отлично работает!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 7, 89, 2),
(601, 'Хорошие ребята работают, ни когда плохого товара не посоветуют', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 79, 89, 2),
(602, 'Выбор есть здесь обогревателей, так что смогли найти для себя самый подходящий вариант с учетом имеющегося бюджета. Искали инфракрасный с возможностью настенного крепления, продавец помог в этом плане показал какие варианты идут по нашему запросу. Перед тем как отопление дали хорошо обогревались, проблем не знали с холодом в квартире.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 41, 89, 2),
(603, 'Все рассчитали по мощности греющего кабеля и точному количеству материалов, не осталось лишнего, так что с этой компанией получилось без лишней переплаты сделать обогрев кровли. Опытные сотрудники, которые ответственно выполняют свою работу, результат получился без претензий к качеству. Гарантию дали, надеюсь она не пригодится\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 62, 89, 2);
INSERT INTO `reviews` (`review_id`, `review_text`, `review_category`, `review_subcategory`, `review_answer`, `review_created`, `review_changed`, `review_publish`, `review_publish_date`, `review_order_details`, `review_bot`, `review_filial`, `review_worker`) VALUES
(604, 'Спасибо за наш кондиционер, который и греет и холодит, а главное что поддерживает комфортные условия во всей квартире. ', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 98, 89, 2),
(605, 'Понравилось что на простом языке объяснили сложные вещи, на самом деле не такое это простое дело оказалось с теплым полом. но я доволен что обратились именно сюда и получили все что хотелось. Здесь хорошие специалисты, знают все по своей отрасли и помогают клиенту подобрать. По срокам все сделали нам быстро, результат нравится.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 55, 89, 2),
(606, 'Обратился в магазин с вопросом чистки кондиционера. Никогда не делали с момента покупки. Решил сам сделать, но оказалось сложновато. Ребята все объяснили. Обговорили стоимость и время. Процедура прошла достаточно быстро, человек знает своё дело. Теперь кондиционер работает как новый! Спасибо ребятам из компании Адель! Всем рекомендую!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 98, 89, 2),
(607, 'Обращался в компанию по вопросу обслуживания вентиляционных систем. Цену за услугу назвали приемлемую, сразу обсудили детали заявки по типу время/дата и способу оплаты. Приехали специалисты, посмотрели все, протестировали и сделали очистку, после которой она стала работать как новая. Быстро и качественно.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 16, 89, 2),
(608, 'Воспользовался их услугами по установке теплого пола с использованием кабеля. Дали профессиональную консультацию прежде чем мне сделать выбор, оценили все параметры, чтобы оборудование справлялось со своей прямой задачей. Сделали все технично и по плану', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 22, 89, 2),
(609, 'Для дома теплые полы нам спланировали и установили хорошо, все везде срабатывает и обеспечивает тепло. ', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 83, 89, 2),
(610, 'В магазине нашли отличный отопительный котел по сравнительно невысокой стоимости.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 21, 89, 2),
(611, 'Большой выбор сплит-систем. Стоимость действительно выгодная, установка считалась отдельно, но тоже получилась в пределах разумного. Специалисты работали с опытом, это видно, немного намусорили, но не без этого, главное что все сделали по правилам и дали гарантию.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 62, 89, 2),
(612, 'По отзывам поняла что этой компании люди доверяют, поэтому обратилась за теплым полом. Мне порекомендовали несколько самых подходящих вариантов, по стоимости оба разные, поэтому мне было из чего выбрать.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 86, 89, 2),
(613, 'Произвели нам замену терморегулятора к системе снеготаяния. Прежний служил бы еще если бы его не снесла служба доставки, когда вносила мебель. Подобрали нам нужный вариант, все сделали уже на следующий день. благо был выходной, а менеджер нашла окошко у мастера. Компания хорошая, убеждаюсь не в первый раз.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 91, 89, 2),
(614, 'Думала что подвесной обогреватель не будет давать такого эффекта как обычный, но не зря послушала менеджера, потому что на самом деле штука хорошая и удобная-не мешает совершенно. Обслуживает всю площадь комнаты, не вызывает статику, безопасный. В общем все что нужно. Установили мне меньше чем за час наверное, по деньгам все обошлось в рамках моего бюджета\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 67, 89, 2),
(615, 'Нашла у них хороший ассортимент моек и увлажнителей воздуха, среди которых выбрала самый подходящий.  Доставили сразу на следующий день в целой упаковке со всеми документами))) Спасибо.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 56, 89, 2),
(616, 'Спасибо менеджеру за консультацию и подборку товара теплого пола!!!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 94, 89, 2),
(617, 'Не могу ничего плохого сказать в адрес компании, знаю их уже ни дни год, потому что у нас стоит система антиобледенения и по любому вопросу из этой сферы обращаемся к ним. Команда профессионалов, работают слажено и по срокам соблюдают обещания, так что в этом плане с ними просто-можно спокойно отпрашиваться с работы', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 45, 89, 2),
(618, 'Мне нужен был кондиционер, чтобы никаких лишних приблуд, а только самое основное. Все это мне подобрали, заказала доставку и договорились сразу на монтаж, немного опоздали из-за того что к дому подъехать не могли. Их работа меня полностью устроила, без претензий\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 45, 89, 2),
(619, 'Выбор большой и главное что соотношение цена-качество адекватное, сужу это по нашему кондиционеру и рекуператору (вытяжке на кухню), которые хорошо работают и выполняют все свои непосредственные назначения. В плане выбора помогают, все подбирают так что это было действительно необходимо, а не так чтобы впулил деньги и получил кучу не нужных опций. Однозначно 5\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 86, 89, 2),
(620, 'Искал тёплый пол, оказалось он рядом. Продавец грамотно все объяснил, сам все смонтировал, теперь сижу и наслаждаюсь! Всем рекомендую!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 93, 89, 2),
(621, 'Компанию хочу отметить положительным отзывом. Уже неоднократно к ним приходилось обращаться по разным вопросам, у нас благополучно эксплуатируется теплый пол от их уже 3 года, а в этот раз решились на покупку с установкой кондиционера. Не подвели, все сделали в лучших своих традициях. За это я им благодарна, сейчас не часто встретишь компанию, работой которой останешься доволен.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 33, 89, 2),
(622, 'Ставили в кафе нам вытяжку. По устройствам здесь вариантов у них много, было из чего выбрать и с чем сравнить, а также с кем проконсультироваться по этому вопросу. Сразу при покупке договорились об установке, мне озвучили стоимость и она меня устроила. По установке мастера приехали вовремя и поставили все максимально аккуратно\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 60, 89, 2),
(623, 'Выгодно получилось сделать теплый пол. Предоставили смету на работу, на оборудование и эксплуатацию дали гарантию. Надеюсь будет длительное время радовать нас теплом, мне нравится и в управлении все просто.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 8, 89, 2),
(624, 'Покупали инфракрасный обогреватель в комнату. Обладает всеми необходимыми качествами по безопасности, автоматизирован, управляется дистанционно.\r\nРекомендую компанию Адель.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 67, 89, 2),
(625, 'Обратились за помощью в эту компанию что-бы обогреть беседку, все сделали грамотно! За это большое спасибо)\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 44, 89, 2),
(626, 'Приятно было иметь дело с хорошими специалистами, которые знают как правильно организовать работу теплого пола, делали нам под кафель и все работает без лишних вопросов к качеству. Хочу отметить здесь большой выбор материалов за счет чего можно подобрать вариант под свой бюджет. Сотрудники консультируют профессионально.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 32, 89, 2),
(627, 'Устанавливали в доме инверторную сплит-систему. Просто шикарная вещь. Работает на охлаждение, нагрев, вентиляцию и очищение воздуха.  Мы довольны.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 50, 89, 2),
(628, 'Ребята молодцы. Работа менеджера, логистика, качество товара, все на высшем уровне. Спасибо за вашу работу. Рекомендую всем!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 91, 89, 2),
(629, 'Отличные квалифицированные консультанты.\r\nТот случай когда подберут и посоветуют оптимальный вариант по приемлемой цене.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 42, 89, 2),
(630, 'Отлично сделали мне теплые полы. Главной проблемой было, что ремонт новый, а это все идет под покрытием. Мастера приехали, на месте все посмотрели, показали, как именно будут делать и где проходит вся система. Существенного изменения уровня пола не произошло, уложили все аккуратно, не гуляет. Спасибо за качественную работу, не пожалели, что обратились именно к вам.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 74, 89, 2),
(631, 'Прекрасно справились с задачей по установке тёплого пола к нам в квартиру. ', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 101, 89, 2),
(632, 'Приятно было закупится в этой компании. Менеджер все подробно рассказал про тёплый пол, скомплектовал под мой бюджет. В общем все чётко - пришёл, увидел и купил без лишней суеты.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 28, 89, 2),
(633, 'Мне в Адель обогреватели посоветовал посмотреть хороший знакомый. Кто много лет уже занимается теплосистемами и сам с ними сотрудничает. В свою очередь хочу своим отзывом дать им хорошую оценку. Масса вариантов по выбору, качественное сопровождение как в плане информации, так и по монтажу под ключ. С удовольствием пользуюсь их техникой.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 32, 89, 2),
(634, 'С фирмой познакомились при проектировании и строительстве загородного дома. Посоветовал подрядчик по установке вентиляционных систем. Гармонично вписались в изначальный проект. На деле могут выполнить любую задачу от заказчика под его условия. Предоставляют новейшее оборудование, которое годами не нуждается в обслуживании и замене. Все по официальному договору с гарантией.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 30, 89, 2),
(635, 'Работают грамотные специалисты, которые, действительно разбираются в том, чем занимаются. Советую', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 69, 89, 2),
(636, 'Профессионалы своего дела! грамотно объяснили расчитали и подобрали продукцию, а именно теплые полы! рекомендую!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 46, 89, 2),
(637, 'В плане обогрева рекомендую к ним обращаться в эту компанию, потому что у них есть все необходимое для этого и специалисты опытные. Сделали теплый пол на первом этаже, сейчас уже подумываем о втором этаже. Сроки соблюдают, предоставляют скидки, так что в этом плане с ними выгодно сотрудничать, все работает отлично\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 43, 89, 2),
(638, 'Прекрасная компания, помогли подобрать нужный вариант по бюджету, быстро и качественно установили . Спасибо!))\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 64, 89, 2),
(639, 'Заказывал инфракрасный настенный обогреватель. Очень большой выбор, по конкретным характеристикам. Выбрали с женой с фотоизображением. С виду смотрится обычным интерьерным изображением. И польза и красота. Сразу сориентировали по срокам доставки. Все проверили на месте. Оплатил по безналу при получении.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 52, 89, 2),
(640, 'Уже второй год как с кровлей в зимний период проблем нет, нам устанавливали специалисты от этой компании обогрев всей крыши и водосточной системы. Предварительно выезжали специалисты, снимали размеры и оценивали другие интересующие их факторы, после чего предоставили проект. Купили все необходимое для этого в плане греющего кабеля и прочих составляющих и в итоге получился практичный и безопасный способ избавления от снега и наледи', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 96, 89, 2),
(641, 'Самым удачным своим приобретением здесь считаю мойку воздуха . Все сомнения по поводу необходимости этого агрегата в доме отпадают, стоит только попробовать. Предусмотрено абсолютно все, а особенно экономия на расходниках. Отдельное спасибо специалистам фирмы Адель за подробную консультацию и помощь в выборе.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 24, 89, 2),
(642, 'Моя любимая фирма. Захотели водонагреватель-заказали здесь, понадобился кондиционер-тоже огромный выбор и установка, теплый пол- пожалуйста. Самая крупная компания по автоматизированным системам во всех направлениях. Работают и под монтаж и подключение к умному дому. Молодцы, что держите марку и идете в ногу со временем.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 91, 89, 2),
(643, 'Предлагают оборудование по конкурентной стоимости. Здесь брать во многих случаях гораздо выгоднее, чем у конкурентов. Кроме того с установкой и доставкой под ключ получается в разы меньше хлопот и затрат по времени. Персонал вежливый, сами звонят, стараются работать на репутацию, а не на торговлю. Выбор и отзывы говорят сами за себя.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 64, 89, 2),
(644, 'Компания помогла с выбором кондиционера, предоставила по ценам завода. Оперативно и бесплатно доставили кондиционера до дома. Когда встал вопрос покупки второго кондиционера не задумываясь обратились к ним.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 26, 89, 2),
(645, 'Не первый год покупаю теплый пол в этой компании, всегда подскажут и посоветуют оптимальное решение, люди работающие в компании специалисты своего дела. Отмечу скорость обработки заказов, есть доставка по городу, очень удобно так как занимаюсь отделочными работами.Советую всем.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 45, 89, 2),
(646, 'Хорошая консультация и знание предметной области, быстрый подбор и быстрая доставка товара, наличие различных брендов кабельных полов по доступным ценам. Спасибо Николаю за работу!\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 22, 89, 2),
(647, 'Помогли собрать комплект всего необходимого оборудования и расходных материалов для установки теплого пола под кафель. Ассортимент у них есть немаленький, поэтому и проблем с выбором не было. Хорошо работают, обратится снова захочешь.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 88, 89, 2),
(648, 'Компанию выбрал, чтоб хорошие отзывы и не первый год на рынке. Здесь уже по выбору можно многое понять, представляют самые популярные модели водонагревателей, причём можно и побюджетнее совсем не плохой вариант подобрать. Недорого не значит плохо, и мой нагреватель это только подтверждает. Гарантия на бесплатное техническое обслуживание.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 66, 89, 2),
(649, 'Компания предоставляла услуги по установке системы отапливаемого гаража. Хотелось изначально равномерное распределение и прогрев по всему помещению, низкую энергозатратность. Смогли грамотно проконсультировать именно по нужным мне вариантам. Все доставили и смонтировали всего за два дня. Ничего и разбирать не пришлось, конструкцией все изначально предусмотрено. Доволен работой специалистов.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 94, 89, 2),
(650, 'Хороший магазин в котором и с ассортиментом проблем нет и в плане помощи сотрудники не откажут. Покупали электрический полотенцесушитель, не думала что это будет сложно, но без помощи не обошлось. Ненавязчиво порекомендовали, быстро оформили покупку и сделали еще скидку, хорошее отношение к покупателям\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 62, 89, 2),
(651, 'Решил дома постелить наконец то теплый пол, а то квартира ужасно холодная, а ребенок постоянно на полу играет. Обратился сюда, нашел в интернете. Проконсультировался. Менеджер все хорошо объяснил, что как по ценам и что нужно брать. Приемлемые кстати ценники, думал будет гораздо дороже. Не плохой ассортимент, хорошее отношение располагают.  всем доволен)', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 96, 89, 2),
(652, 'По лету еще покупали у них кондиционер и сразу согласовали его установку. Здесь хороший ассортимент по этим приборам, нашли самый оптимальный вариант по функционалу с учетом стоимости, в этом плане помог их консультант, сразу записали нас на установку. Мастера приехали с небольшим опозданием, но по работе к ним замечаний не было.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 27, 89, 2),
(653, 'Ребята молодцы и работу свою знают назубок. Сам я когда-то недолгое время занимался установкой несложных кондиционеров. Тут, конечно, выбор просто шикарный. Не стал мудрить, все сделали профессионалы. Приятно было наблюдать за ходом их работ. Конечно и менеджеру и консультанту не могу не уделить внимания в отзыве, всегда были на связи и предоставили подробную информацию.\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 7, 89, 2),
(654, 'Нашли все что назвал мастер для теплого пола в этом магазине. Когда покупали оказалось что по списку одну важную деталь чуть не забыли, хорошо что консультант спросил про нее-вот что значит профессионал который не просто продает, но и знает что как устроено. Очень удобно в одном месте купить все и сразу, с гарантией.', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 20, 89, 2),
(655, 'Нашел у них нужную модель увлажнителя воздуха, которую выбрал для себя по отзывам, но найти не мог нигде. По доставке обошлось без опозданий, все в соответствии получил', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 65, 89, 2),
(656, 'Водосточная система у нас больше не застывает за счет правильной организации системы обогрева. Здесь нам все рассчитали по стоимости и подсказали что лучше выбрать, выполнялась установка по проекту, который разрабатывали инженеры, а не просто любители, именно поэтому проблем сейчас в этом плане нет. Компанию рекомендую\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 61, 89, 2),
(657, 'Все по уму нам спроектировали в плане теплого пола, проблем нет в плане работы, все функционирует и выполняет свои прямые назначения. Доволен тем что специалисты помогли подобрать все расходники, потому что вариантов было достаточно. Сделали все в срок и предоставили гарантию, не пожалели что выбрали эту компанию\r\n', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 86, 89, 2),
(658, 'Всегда мечтала себе теплый пол в ванную комнату, чтобы после душа ножкам было комфортно, да и вообще климат в помещении поддерживает. Постаралась все продумать заранее и наметила установку теплого пола к ремонту. Удобно, что все делают быстро, буквально за полторы недели мой вопрос был полностью решен и это вместе с предварительными замерами и монтажом. Классно получилось, спасибо!', 43, 199, ' ', '2023-12-30', '2024-01-03', b'0', '2024-01-03', 0xa6ed8f19c257440a947581c8b221edc8, 50, 89, 2),
