(677, 'Текст отзыва', 2, 203, ' ', '2024-01-03', '2024-01-03', b'0', NULL, 0x42bf5c7da1b946eebd882d06ad84d91b, 59, 91, 2),
(678, 'Текст отзыва', 2, 203, ' ', '2024-01-03', '2024-01-03', b'0', NULL, 0x42bf5c7da1b946eebd882d06ad84d91b, 90, 91, 2),
(679, 'Если вы ищете место, где сделают идеальное наращивание волос, то вам в эту студию! Волшебные руки Анжелы творят настоящее искусство. От души благодарна за ее труд и мастерство!\"', 10, 63, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'1', '2024-01-05', 0x678d7ae880eb4e4ca45589eca0bd04ca, 319, 37, 1),
(680, 'Не могу не поделиться восторгом от работы данного салона! Елена не только преобразила мой образ, но и подняла настроение на целый день. Огромная благодарность за качество волос  и индивидуальный и комплексный подход. Спасибо!!', 10, 63, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-11', 0x678d7ae880eb4e4ca45589eca0bd04ca, 295, 37, 1),
(681, 'Опыт наращивания волос у Лены был невероятным! Она выбирает идеальный оттенок и текстуру, внимательно прислушиваясь к пожеланиям клиента. Плюс ко всему, огромный ассортимент волос для наращивания поражает воображение. Теперь я знаю, что моя красота - в надежных руках)', 10, 63, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-17', 0x678d7ae880eb4e4ca45589eca0bd04ca, 342, 37, 1),
(682, 'В студии красоты магия рук мастера Лены сделала чудо с моей прической. Наращенные волосы смотрятся так естественно, словно они мои родные. Качество волос просто потрясающее. Перед наращиванием покрасила корни тон в тон с новыми наращенными. Только позитивные эмоции от этой студии!!', 10, 63, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-23', 0x678d7ae880eb4e4ca45589eca0bd04ca, 198, 37, 1),
(683, 'Снова влюблена в свои волосы благодаря профессионализму Анжелы из Салона Людмилы Шлегель! Мастерство и внимание к деталям,  а еще и превосходное качество волос для наращивания, превратили мой очередной визит в настоящее наслаждение.  Рекомендую всем, кто желает кардинально изменить свой образ!', 10, 63, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-29', 0x678d7ae880eb4e4ca45589eca0bd04ca, 221, 37, 1),
