(702, 'Текст отзыва', 28, 204, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', NULL, 0xfb4057f20e7e469cbde77146e6b18931, 13, 92, 2),
(703, 'Текст отзыва', 28, 204, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', NULL, 0xfb4057f20e7e469cbde77146e6b18931, 44, 92, 2),
(704, 'Жена решила помыть большие свечки в посудомоечной машине. Все каналы забились воском. Мастер привез с собой парогенератор. 3 часа на чистку машинки и всё опать работает. Спасибо большое, урок усвоен.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-05', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 20, 93, 2),
(705, 'Текст отзываОгромное СПАСИБО!!!!\r\nТакие суперские ребята, профессионалы своего дела. Все сделали быстро и качественно. Я очень довольна их работой. Советую их, не пожалеете. Теперь их номер в списке моего телефона навсегда!\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-06', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 25, 93, 2),
(706, 'Приехал, сделал всë меньше чем за полчаса, за что я очень благодарен и отдал копейки (в других местах говорили, что сделать было невозможно)\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-07', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 59, 93, 2),
(707, 'Вежливый молодой человек! Терпеливый, выдержанный. Сложилась внештатная ситуация. Духовой шкаф привезли на два часа позднее намеченного времени. Артемий дождался заказа. Оперативно и качественно подключил духовой шкаф. Очень благодарна мастеру. Советую к нему обращаться.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-08', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 21, 93, 2),
(708, 'Хочу отметить, что мастер Артемий оперативно отреагировал и появился по указанному адресу в течении 15мин. Оценив поломку, закупил необходимые материалы и с лёгкостью рассказывая истории в течении получаса выполнил работу за которую управляющая служба побоялась браться, якобы они не работают с медными трубами. Явно человек не гониться за заказами, работает на качество, т.к. ждали более часа аварийную службу для запуска воды. Очень довольны, остались самые приятные впечатления. Рекомендую данного специалиста всем пользователям.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-09', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 88, 93, 2),
(709, 'Мастер пунктуален, предупредил за час о том что выезжает, прибыл раньше назначенного времени, в наличии весь инструмент и дополнительные запчасти. Выслушал все жалобы и пожелания, проконсультровал как правильно обслуживать стиральную машину. Спасибо большое за помощь.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-10', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 32, 93, 2),
(710, 'Работа оказалась значительно сложнее, чем я думала, не просто заменить прокладку, а разобрать бойлер, слить воду, снять, промыть от грязи и только потом установить новую прокладку. Но всё сделано, мастер сориентировался в сложной ситуации, работу выполнил, больше не протикает, что сильно радует!\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-11', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 45, 93, 2),
(711, 'Выражаю огромную благодарность за проделанную работу. Задача стояла не простая, демонтировать старый водонагреватель, поставить новый и при этом не испортить ремонт в ванной комнате. Артемий замечательный мастер, профессионал своего дела, работа выполнена очень аккуратно и качественно. Я очень довольна результатом, теперь буду обращаться только к нему! Однозначно рекомендую!!! Огромное спасибо! 5+!\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-12', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 21, 93, 2),
(712, 'В день обращения мастер подъехал оценить фронт работ, через час вернулся с конфорками к плите. Подсказал, что необходимо сделать, что бы подобной поломки не повторилось. Выполнил заказ на отлично. \r\nМинимум разговоров, максимум дела. Аккуратно, быстро. Гаранию дал на 2 года. Очень довольна, буду обращаться ещё. \r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-13', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 53, 93, 2),
(713, 'Стиральная машинка перестала воащать барабан, думали надо заказывать новый двигатель. Оказалось, что слетел ремень, поставили на место, отбаллансировали барабан. Спасибо за подарок, мешки для стирки белья нам как раз были необходимы.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-14', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 39, 93, 2),
(714, 'К специалисту обратилась впервые, выбрала по отзывам. Ожидания оправдались. Первое,что хочется отметить-это пунктуальность и готовность предоставить услугу в ближайшее время в Тулому. Работа была выполнена аккуратно, качественно, все было проверено. Цена адекватная и приемлемая, знаю, потому что до этого мне по знакомству данную услугу предоставляли дороже. Также Артемий оказался приятным и общительным человеком, всё объяснил и проконсультировал. Рекомендую и сама буду обращаться. \r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-15', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 42, 93, 2),
(715, 'Очень вежливый человек! Через час после заказа приехал! Сделал всё чётко и быстро! За деньгами не гонится, работает на качество. Однозначно рекомендую! Буду обращаться ещё!!\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-16', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 17, 93, 2),
(716, 'В общем самый крутой мастер которого я встречал. Во первых - единственный кто приехал в позднее время, во вторых - у меня было очень все сложно с посудомойкой, было почти все забито жиром и остатками пищи, но он смог найти засор, все прочистить, короче волшебник.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-17', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 69, 93, 2),
(717, 'Мастера с Егорова 13 сняли переключатель духовки и пропали на месяц, то заняты, то в область уехали, то заболели, в итоге трубки не берут. После себя оставили не подключенные клеммы штук 20 висели провода в воздухе не заизолированные, ни один не подписан, куда какой подходит. Обратились в данный сервис по рекомендации. Мастер приехал с нужным переключателем режимов духовки, установил, разобравшись куда от чего идет каждый провод, проверил, дал гарантию 2 года. Спасибо большое, кспели сделать до нового года.', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-18', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 89, 93, 2),
(718, 'Сломалась стиралка – не крутился барабан. После недолгих поисков остановились на данном сервисе, оформили заявку на вызов мастера. Приехал Артемий через 40 мин, сразу провел диагностику, определил причину – износ приводного ремня. Нужный ремень был у него с собой в машине, сразу заменил. Придраться не к чему, машина снова в работе. Надежный сервис!', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-19', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 23, 93, 2),
(719, 'Машина не набирала воду, пришлось вызвать мастера в Зверосовхоз. Приехал Артемий, его работой остались довольны – и приехал точно в оговоренное время и деталь нужная для замены у него уже была с собой. Сразу видно, что у вас работают профессионалы. Мастер поменял клапан подачи воды за полчаса, очень оперативно! Спасибо за быструю помощь! Гарантию в квитанции дал 3 года.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-20', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 10, 93, 2),
(720, 'Мастера прислали сразу после звонка, проблема в модуле управления. Сразу назвал цену ремонта, вполне приемлемую. Отремонтировал всё на месте, гарантию выписал 2 года. Я довольна работой, буду обращаться, рекомендую.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-21', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 16, 93, 2),
(721, 'Стиралка «Аристон» стала издавать посторонние звуки. Я уж думала, она приказала долго жить, лет-то ей уже много. Но оказалось просто монеты, которую забыли в кармане одежды, выпала при стирке и попала между баком и барабаном. В Первомайку мастер приехал быстро, разобрал машину и эту помеху убрал. Машинка снова работает как надо! Спасибо!\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-22', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 79, 93, 2),
(722, 'Мастер Артем Исправил протечку в стиральной машинке. Также устранил шум в подшипниках и прочистил фильтра, что изначально не обговаривалось.\r\n', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-23', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 57, 93, 2),
(723, 'Приехал мастер к нам в Мурмаши. Быстро выявил проблему. Детали под замену были у мастера с собой. Ремонт и тестирование заняли очень мало времени. Оперативно. Профессионально. Доброжелательный настрой мастера тоже повлиял на оценку. Два года гарантии. Рекомендую. Спасибо Артемий!', 18, 205, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-24', 0xf9323e5220fb4efaa0bd8d7a4b3663c1, 27, 93, 2),
(724, 'Поскольку потребовались срочно деньги, я пришла сюда, чтобы продать свой старый смартфона и получить за них деньги. Мне понравилось, что оценку они провели быстро и достойно, деньги выдали сразу.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-05', 0x1588f779a3494d28b896e3081fa7b1f6, 52, 94, 2),
(725, 'Отличный персонал !Вошли в положение !', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-08', 0x1588f779a3494d28b896e3081fa7b1f6, 45, 94, 2),
(726, 'В этом ломбарде я на прошлой неделе взял себе классный смартфон с достойными характеристиками, а также планшет для сына с большим дисплеем. Цены на технику тут по-настоящему приятные.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-11', 0x1588f779a3494d28b896e3081fa7b1f6, 13, 94, 2),
(727, 'Недавно мне понадобились дополнительные средства, и я решил обратиться в этот ломбард. Тут мне в залог ноутбука выдали необходимую сумму денег. Процентная ставка меня вполне устроила.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-14', 0x1588f779a3494d28b896e3081fa7b1f6, 38, 94, 2),
(728, 'Мне понравился данный комиссионный магазин. Здесь весьма демократичные цены на гаджеты бывшего использования. Недавно купил здесь айфон 12 в отличном состоянии по очень выгодной цене. Рад, что заглянул сюда.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-17', 0x1588f779a3494d28b896e3081fa7b1f6, 68, 94, 2),
(729, 'На прошлой неделе обращалась в эту компанию, когда срочно нужны были деньги. Здесь довольно дорого оценили мой ноутбук, сразу выплатили деньги на руки. Условия вполне приемлемые.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-20', 0x1588f779a3494d28b896e3081fa7b1f6, 27, 94, 2),
(730, 'Магазин очень хороший , советую всем , очень выскоя комиссия, советую', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-23', 0x1588f779a3494d28b896e3081fa7b1f6, 13, 94, 2),
(731, 'отличный ломбард', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-26', 0x1588f779a3494d28b896e3081fa7b1f6, 42, 94, 2),
(732, 'Купил ноутбук и строительный пылесос. Цени ниже чем на авито. Спасибо.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-01-29', 0x1588f779a3494d28b896e3081fa7b1f6, 61, 94, 2),
(733, 'Хороший комиссионный магазин и персонал вежливый и доброжелательный! Пользуюсь их услугами, когда возникает необходимость в деньгах, а до зар.платы ещё далеко. Условия займа приемлемые.', 45, 206, 'Ответ на отзыв', '2024-01-05', '2024-01-05', b'0', '2024-02-01', 0x1588f779a3494d28b896e3081fa7b1f6, 72, 94, 2),
(734, 'Текст отзыва', 35, 207, 'Ответ на отзыв', '2024-01-06', '2024-01-06', b'0', NULL, 0xd0879ca8878744c7b464fbe6b0364774, 250, 95, 1),
(735, 'Текст отзыва', 35, 207, 'Ответ на отзыв', '2024-01-06', '2024-01-06', b'0', NULL, 0xd0879ca8878744c7b464fbe6b0364774, 212, 95, 1),
(736, 'Текст отзыва', 35, 207, 'Ответ на отзыв', '2024-01-06', '2024-01-06', b'0', NULL, 0xd0879ca8878744c7b464fbe6b0364774, 193, 95, 1),
(737, 'Текст отзыва', 35, 207, 'Ответ на отзыв', '2024-01-06', '2024-01-06', b'0', NULL, 0xd0879ca8878744c7b464fbe6b0364774, 347, 95, 1),
(738, 'Текст отзыва', 35, 207, 'Ответ на отзыв', '2024-01-06', '2024-01-06', b'0', NULL, 0xd0879ca8878744c7b464fbe6b0364774, 292, 95, 1);
INSERT INTO `reviews_archive` (`review_archive_id`, `review_archive_text`, `review_archive_category`, `review_archive_subcategory`, `review_archive_answer`) VALUES
(1, 'Текст отзыва', 6, 39, 'Ответ на отзыв1'),
(2, 'Текст отзыва1', 6, 39, 'Ответ на отзыв'),
(3, 'Текст отзыва1', 6, 39, 'Ответ на отзыв'),
(4, 'Текст отзыва1', 6, 39, 'Ответ на отзыв'),
(5, 'Текст отзыва1', 6, 39, 'Ответ на отзыв'),
(6, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1'),
(7, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1'),
(8, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1'),
(9, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1'),
(10, 'Текст отзыва1', 6, 39, 'Ответ на отзыв1'),
(11, 'Спасибо огромное за сервис! Все понравилось! Встретили с улыбкой и проводили так же) + чистые и сухие вещи!👍🏻👍🏻👍🏻', 24, 155, 'Ответ на отзыв'),
(12, 'Помогают поддерживать мой гардероб в опрятном виде. Обходится мне это не так уж и дорого, зато одежду после чистки очень приятно носить.', 24, 155, 'Ответ на отзыв'),
(13, 'Отличная химчистка. Очистили пуховик испачканный отработанной автомобильной смазкой, который, как я считал, уже нет никаких шансов спасти.', 24, 155, 'Ответ на отзыв'),
(14, 'Это того стоит. Моя одежда всегда выглядит почти как новая после чистки. Настоящие профессионалы.', 24, 155, 'Ответ на отзыв'),
(15, 'Хорошая химчистка, приветливый персонал. Все понравилось!', 24, 155, 'Ответ на отзыв'),
(16, 'Все отлично, мне понравилось. Персонал вежлив!) приду еще!', 24, 155, 'Ответ на отзыв'),
(17, 'Очень позитивные сотрудники, было приятно пообщаться. Цены на чистку постельного белья лучшие в городе, сдаю только тут. Качество на высоте.', 24, 155, 'Ответ на отзыв'),
(18, 'Довольна химчисткой !', 24, 155, 'Ответ на отзыв'),
(19, 'Очень люблю ваш салон. Много раз выручаете с быстрой доставкой на разные мероприятия.  Всегда свежие цветочки и красивые букеты)', 25, 156, 'Ответ на отзыв'),
(20, 'Спасибо огромное за оперативность и качество, эко шубу сделали как новую!\r\n', 24, 155, 'Ответ на отзыв'),
(21, 'Пользуюсь услугами данной организации очень давно, нареканий к качеству выполненных работ нет. Услуги всегда оказываются на самом высоком уровне. Персонал всегда приветлив и вежлив.', 24, 155, 'Ответ на отзыв'),
(22, 'Сдавала почистить пуховик, оперативно справились, уже через 4 дня смогла забрать. Выглядит как новый, отстирались даже старые пятна. Спасибо за ваш труд, обязательно приду еще.', 24, 155, 'Ответ на отзыв'),
(23, 'Добрый день, специально зарегистрировался , спасибо большое за качество и сервис , особенно отмечу администраторов ! Они нас встречают и провожают с Улыбкой !!!', 24, 155, 'Ответ на отзыв'),
(24, 'Я очень довольна детским садом \"Ладушки\"! Когда мне его посоветовала моя соседка, я решила попробовать, и не пожалела. Мы начали ходить с сентября в ясельную группу, и адаптация прошла очень быстро. Я очень беспокоилась о своем ребенке, поэтому сразу подключила услугу видеонаблюдения. Это дало мне огромный комфорт и уверенность в том, что мой малыш всегда под присмотром. Воспитатели здесь замечательные, они заботятся о каждом ребенке и создают теплую и дружескую атмосферу. Моему ребенку очень нравится ходить в детский сад \"Ладушки\", и я всем с уверенностью рекомендую этот чудесный детский сад.', 6, 165, 'Ответ на отзыв'),
(25, 'Прекрасное место, делают быстро и качественно, администратор вежливая, буду обращаться ещё и ещё! ☺\r\n', 24, 155, 'Ответ на отзыв'),
(26, 'Мне понравилось. Работают быстро, качественно. Люди приятные. Буду пользоваться еще.', 24, 155, 'Ответ на отзыв'),
(27, 'Все понравилось! Приятное обслуживание, хорошее качество. Не навязчиво, а по делу предложения для достижения лучшего качества состояния одежды. Молодцы! Так держать! 👍🏼😉', 24, 155, 'Ответ на отзыв'),
(28, 'Спасибо огромное за пуховик для сына! Я думала что уже выбрасывать придётся. Пуховик как новый, все залоснения убрали. И даже пришитый мех не пострадал. Спасибо вам девочки огромное. Все быстро, качественно и не дорого! Я уже всем про вас рассказала! Мы довольны очень ! Теперь мы ваши клиенты!', 24, 155, 'Ответ на отзыв'),
(29, 'Приносила пальто, девочки сделали все быстро и качественно. Отдельное спасибо за  удаления катышков. Пальто просто как новое, я довольна.', 24, 155, 'Ответ на отзыв'),
(30, 'Очень хорошее обслуживание, все нравится, устраивает, рекомендую, пользуюсь давно.', 24, 155, 'Ответ на отзыв'),
(31, 'Сервис отличный, ребята знают свое дело. Вчера менял у них тормозные диски, все быстро, четко, профессионально. Теперь буду обращаться только к ним. Спасибо за качественную работу', 2, 158, 'Ответ на отзыв'),
(32, 'Интересный интерьер со своими фишечками, красивая подача, вкусно. Вежливая официант. Провели приятный вечер с семьей', 19, 114, 'Ответ на отзыв'),
(33, 'Ребятам большое спасибо, разобрались помогли с настройкой и подключением сигнализации.', 1, 4, 'Ответ на отзыв'),
(34, 'Настроение всегда создают Ваши флористы. Ребята всегда добродушны, вежливы, помогут и подскажут при необходимости. Это мой любимый цветочный, самый атмосферный :-) ', 25, 156, 'Ответ на отзыв'),
(35, 'Отличный хостел. Местоположение удобное:  Персонал весьма приветлив и отзывчив, помогает во всём, откликается на просьбы. Условия проживания хорошие: удобная кухня, санузел в чистоте,  чистое постельное бельё. Принимают радушно.', 5, 35, 'Ответ на отзыв'),
(36, 'Хочу сказать огромное спасибо Аурике Евгеньевне за оказанную услугу в удаленном формате. Быстро, качественно, надежно! Рекомендую', 28, 166, 'Ответ на отзыв'),
(37, 'Ребята из КИТ работают на все 1000%. Профи в своем деле. Спасибо, что помогаете нам.', 27, 161, 'Ответ на отзыв'),
(38, 'В магазине понравилось всё: и ассортимент и компетентность продавца и качество приобретенной продукции.', 26, 160, 'Использовать имена Пётр, Артём, Анна  НЕ В КАЖДОМ ОТЗЫВЕ'),
(39, 'Вчера ребята натягивали потолок в студии. Приехали всё сделали быстро и профессионально. Очень доволен. Ситуация с потолком была не рядовая. Нужно было перекраивать на месте. Всё сделали идеально. Спасибо мастерам и компании. Рекомендую.', 18, 106, 'Ответ на отзыв'),
(40, '30 ноября наращивала волосы, очень рада, что выбрала эту студию. Нарастили детские волосы. Качество просто волшебное! Особенное спасибо мастеру Анжеле за ее очень трепетное отношение.', 10, 63, 'Ответ на отзыв'),
(41, 'Прекрасное место,всем советую! Добрые и отзывчивые люди работают тут! Удобное расположение. В любое время можно  попить чай или кофе, везде чисто и уютно. Надеюсь приеду сюда ещё раз и с выбором хостела уже не будет проблем! Спасибо вам.', 5, 35, 'Ответ на отзыв'),
(42, 'Полный восторг от заказа и цветов)! Получательница просто сражена таким сюрпризом)  НА.РОМАШКЕ - Молодцы, здорово работаете!', 25, 156, 'Ответ на отзыв'),
(43, 'Отличный автосервис,хороший\r\n всегда подскажут что лучше выбрать. Благодарю.', 1, 4, 'Ответ на отзыв'),
(44, 'Ходим третий год. Всё очень нравится. Очень  хороший тренер. Отношение к детям замечательное.', 29, 167, 'Ответ на отзыв'),
(45, 'ЭМОЦИИ ВАААААУ! СКОРОСТЬ! Были с друзьями впервые и ошалели от того как здесь круто! Внутри картодрома тепло и комфортно, машины новые, экипировка крутая! Уже решили, что на рождественские праздники обязательно приедем компанией побольше )', 30, 168, 'Ответ на отзыв'),
(46, 'Получала консультацию  очень понравилось! Вежливо и подробно разобрали мою ситуацию, приняли в удобное мне время, так что если мой вопрос дойдет до суда, я снова обращусь к этому специалисту.', 28, 166, 'Ответ на отзыв'),
(47, 'Большой выбор, Очень грамотный консультант Петр. Все показал , подобрал шикарнейший аромат. Рекомендую!!!', 26, 160, 'Ответ на отзыв'),
(48, 'Сделали окна  качественно\r\nУстановщики очень вежливые, помогли с вещами, сторожили собаку, которая вечно убегала когда выносились старые окна 😃\r\nБольшое спасибо', 18, 108, 'Ответ на отзыв'),
(49, 'Мы очень довольны частным детским садом \"Ладушки\"! Нам его посоветовал наш педиатр, и мы не пожалели о своем выборе. Нашему ребенку всего 2,2 года, и мы хотели найти место, где его развитие будет на первом месте. В \"Ладушках\" проводятся множество развивающих занятий, которые помогают малышам раскрыть свой потенциал. Особенно нам понравилось то, что каждый день они гуляют на свежем воздухе. Для нас это очень важно, потому что мы считаем, что дети должны проводить время на улице. Еще одним плюсом для нас стало то, что у нашего ребенка аллергия на молочку, и в \"Ладушках\" нам сразу предложили замену. Это показало нам, что персонал заботится о здоровье и благополучии каждого ребенка. Кроме того, питание в детском саду свое, а не привозное, что тоже очень удобно. Мы действительно довольны этим детским садом и рекомендуем его всем родителям!', 6, 165, 'Ответ на отзыв'),
(50, 'Очень понравилась клиника, была первый раз у дерматоонколога Малышева, удаляла родинку. Пока ожидала приема, общалась с директором клиники Леденевой Снежной Владимировной, посоветовала сделать пилинг. Меня записали на удобное время, и подобрали необходимый пилинг на проблему. Уже прошла курс пилингов, эффектом довольна.', 11, 170, 'Ответ на отзыв'),
(51, 'Осталась очень довольна данным местом))\r\nВсего за одни сутки спасли пуховик, который уже думала ничем не отстирать))\r\nДевушка принявшая у меня пуховик, очень милая)\r\nУдачи вам в дальнейшем🙂', 24, 155, 'Ответ на отзыв'),
(52, 'Хочется выразить огромную, искреннюю благодарность!!! Проинформировали очень хорошо, доступно!\r\nМастера работали аккуратно, качественно, щепетильно относятся к своей работе! Очень человеческое отношение! Буду рекомендовать Вас!', 18, 108, 'Ответ на отзыв'),
(53, 'Являюсь постоянным клиентом данного филиала. Всегда довольна проделанной работой персонала. Перед началом зимнего сезона сдаю куртку и шубу, всегда все вовремя, все пятна выведены и цены приемлемые!', 24, 155, 'Ответ на отзыв'),
(54, 'Хорошее СТО. И только потому что при обращении не стали навязывать ненужные работы, а даже от многих отговорили за ненадобностью. В других местах наоборот наговорил, наобещали, накрутили. Молодцы ребята.', 2, 158, 'Ответ на отзыв'),
(55, 'Хорошее обслуживание, доволен.', 19, 114, 'Ответ на отзыв'),
(56, 'Установил у них магнитолу с камерой. Все хорошо. Спасибо.', 1, 4, 'Ответ на отзыв'),
(57, 'Заказываю в данной компании потолок не первый раз, компания хорошая, специалисты квалифицированные, особенное спасибо монтажникам, очень рекомендую данную компанию !!!', 18, 106, 'Ответ на отзыв'),
(58, 'Очень быстро отдают заказы, даже зимние вещи. Дубленку сделали хорошо!', 24, 155, 'Ответ на отзыв'),
(59, 'Пол года делали ремонт, были и плюсы и минусы, о минусах не хочу говорить они ничтожны по сравнению с плюсом, самое главное положительное качество компании, они все доводят до конца ни смотря ни на что ремонт будет доделан!\r\nБлагодарю Николая за терпение!', 18, 157, 'Ответ на отзыв'),
(60, 'Огромное спасибо Вам, уважаемые работницы ателье!! Вы супер! Не первый раз обращаюсь сюда по мелочам, а тут решила реанимировать шубу из норки! Обрезали, отремонтировали, заменили и вернули шубку к новой жизни!!! СПАСИБО!!!', 14, 173, 'Ответ на отзыв'),
(61, 'Отдал джинсы, чтобы подшили и сделали манжеты. Через пару дней позвонили и сказали, что можно забирать. Всё сделали так, как я и хотел. Доволен, советую именно это ателье 👍🏼 Хороший сервис, демократичные цены 🔥', 14, 173, 'Ответ на отзыв'),
(62, 'вчера забрала жакет и очень рада вашей работой! всё идеально! огромное спасибо вашим сотрудникам, отныне буду ходить только сюда!', 14, 173, 'Ответ на отзыв'),
(63, 'Компетентный и приветливый персонал. Защиту выдают. Трасса не большая, но классная. Машины крутые. Ребенок с удовольствием ходит на тренировки в Форсаж24, а мы родители время от времени гоняем там же)', 30, 168, '1 ОТЗЫВ В НЕДЕЛЮ'),
(64, 'Цветы шикарные, заказывал композицию в коробке, собрали быстро, вежливый персонал.\r\nЗамечательный магазин! ', 25, 156, 'Ответ на отзыв'),
(65, 'Все более чем устраивает в работе с данной компанией. Прайс очень адекватный несмотря на объем работы', 27, 161, 'Ответ на отзыв'),
(66, 'Все прекрасно , персонал очень дружелюбен. Пообщалась с директором , были вопросы - Оксана Анатольевна , так держать !! Молодец ! Всё чётко, по делу. Спасибо за помощь! \r\n Советую!!!\r\n', 24, 155, 'Ответ на отзыв'),
(67, ' Заезжала приобрести известный и любимый многим аромат Baccarat 540. Очень понравилось обслуживание. Анна  как настоящий парфюмер, обо всём рассказала -  в какой концентрации лучше и как. Очень удобно, что на свой вкус можно выбрать любой флакон, объём, парфюм и по доступной стоимости.', 26, 160, 'Ответ на отзывСКОРРЕКТИРОВАНО!'),
(68, ' Ставлю все 5 звёзд! Разбила свой iPhone.  Ребятам большое спасибо, сделали все быстро и по приемлемой цене в отличии от других сервисов. Лишних услуг не навязывают очень лояльны и вежливы к клиентам. Вообщем я осталась довольна. Буду советовать друзьям и знакомым.', 17, 171, 'Ответ на отзыв'),
(69, 'Спасибо большое «Альфа-Дом» за помощь в выборе дома, это действительно стоящий вариант, так же спасибо за всю проделанную работу, очень хорошо что есть такие работники которые погружаются душой в работу🔥', 33, 172, 'Ответ на отзыв'),
(70, 'Не только тренировки, но  и другие мероприятия проводятся для детей, у меня двое ребятишек к ним ходят. Детям очень все нравится, хотя порой бывает и сложно. Конечно удовольствие это не самое бюджетное, но самое главное что дети при деле и спорт на пользу.', 29, 167, 'Ответ на отзыв'),
(71, 'Сделала коррекцию волос после наращивания в другом салоне. Очень довольна работой мастера Елены. Капсулы супер маленькие и мега аккуратные. У них в студии капсулы делают на сцеп оборудовании. Нигде ничего подобного не видела)', 10, 63, 'Ответ на отзыв'),
(72, 'Выражаю благодарность за установку окон высокого уровня. \r\nРебята Андрей и Сергей мастера своего дела и пример того, как нужно работать в любой сфере.\r\nДовольна обслуживанием и ценовой политикой.\r\nРекомендую от души .', 18, 108, 'Ответ на отзыв'),
(73, 'Давно пользуюсь услугами данной химчисткой, сервис отличный, персонал приветливый. Очень хорошо чистят пуховики.', 24, 155, 'Ответ на отзыв'),
(74, 'Очень понравилось данное ателье! Приятно удивило наличие прайса ( цены не берутся \"с потолка \"), чека и конечно же качество выполненной работы! Буду обращаться сюда снова! Спасибо большое!', 14, 173, 'Ответ на отзыв'),
(75, 'Приехал к ним установить сигнализацию. Помогли  с выбором , все объяснили. Теперь всегда буду приезжать только к этим ребятам ! Спасибо большое.\r\n', 1, 4, 'Ответ на отзыв'),
(76, 'Обратилась в клинику для подбора уходовых средств, косметолог Инна посоветовала использовать несколько средств, а также рассказала о специалисте, который поможет скорректировать питание, ведь большинство высыпаний из-за питания. Меня записали на экспресс диагностику к нутрициологу Козыревой Наталье. На диагностике мы рассмотрели мой рацион, а также говорили о моей здоровье и определенных проблемах со здоровьем. Буду проходить курс. Консультацией довольна', 11, 170, 'Ответ на отзыв'),
(77, 'Совершенно отличный центр, помогли и моему мужу и мне с нашими проблемными моментами по здоровью. Внутри интересно все устроено, очень комфортно. Я на массаже не была, муж был, ему понравилось, помогли аккуратно с больной спиной. Планируем ходить с ребенком, но тут уже надо рассчитать время визитов.', 10, 181, 'Ответ на отзыв'),
(78, 'Сдавала детские вещи в химчистку первый раз. Девушка администратор очень вежливо и подробно рассказала об услуге. Отстирали все! Обязательно зайду ещё.', 24, 155, 'Ответ на отзыв'),
(79, ' Принёс жёсткий диск в ремонт, сделали быстро на след день забрал сделали качественно всём советую.', 17, 171, 'Ответ на отзыв'),
(80, 'Хороший сервисный центр. Устранили проблему с телефоном за 5 минут! В другом сервисе даже отказались смотреть, а проблема была пустяковая. Рекомендую!', 17, 171, 'Ответ на отзыв'),
(81, 'Очень рада, что мы вернулись в детский сад \"Ладушки\"! Нашему сыну 4 года, и здесь у него так много занятий и возможностей. В \"Ладушках\" есть шахматы, капоэйра, подготовка к школе, театральные постановки и многое другое. Мы недавно приняли участие в празднике \"День мам\" и это было так трогательно, слезы навернулись на глаза. Большое спасибо всем сотрудникам детского сада за заботу и любовь к детям! Мы очень довольны!', 6, 165, 'Ответ на отзыв'),
(82, 'Несколько раз отдавала на ремонт кожаные изделия - перешить кожаные штаны, заменить рваные детали на рукаве, поменять подклад, и переделать переднюю деталь кожаного пуховика. Обращалась и с другими вопросами и всегда решали все с заботой и на все 100 процентов. Большое вам спасибо!', 14, 173, 'Ответ на отзыв'),
(83, 'Недавно покупала здесь цветы подруге. Очень понравился молодой человек флорист. Выполнил все\"капризы\"))) Спасибо ему большое за терпение. Очень шикарный букет получился. Благодарю!', 25, 156, 'Ответ на отзыв'),
(84, 'Всё очень круто... Сделали сыну такой подарок на день рождения, ребёнок был очень доволен и не ожидал такого подарка. Персонал и инструктора очень вежливые всё доходчиво объясняли. Если что-то где-то было непонятно они с лёгкостью всё объясняли повторно', 30, 168, 'Ответ на отзыв'),
(85, 'Выражаю огромную благодарность риэлтору Анастасии за качественную работу, полное сопровождение сделки, профессионализм, за душевное отношение к делу и отзывчивость. Крайне приятно было работать с Вами. Спасибо Вам большое за Вашу корректность и искреннее желание помочь! Удачной деятельности вашему агентству и вменяемых клиентов!', 33, 172, 'Ответ на отзыв'),
(86, 'Очень приятная и доброжелательная приемщица. Рассказала о цене, предупредила о возможных сложностях.  Чистое светлое помещение. Рекомендую\r\n', 24, 155, 'Ответ на отзыв'),
(87, 'Данный отзыв пишу прям из ресторана! Второй вечер подряд ужинаем тут семьей. Это невероятный гастрономический и визуальный экстаз!!! Блюда приготовлены настоящими профессионалами 💪🏻Приятное обслуживание… В Самаре проездом и рады, что удалось посетить это прекрасное заведение! Желаю процветания и адекватных посетителей!', 19, 114, 'Ответ на отзыв'),
(88, 'Здравствуйте! Хочу выразить благодарность работникам данного ателье! Все выполнено на 5+!Сотрудники все вежливые и очень аккуратно выполнили свою работу! Я осталась довольна результатом! Однозначно рекомендую данное ателье! И сама вернусь только к вам!', 14, 173, 'Ответ на отзыв'),
(89, 'Мне как обычному клиенту, надо было вчера))) прибежала с утра и меня спасли))) починили моё платюшко!! быстро и всё красиво )) благодарю!!!', 14, 173, 'Ответ на отзыв'),
(90, 'Спасибо большое за оперативность и качество 🙏🏼 Особая благодарность девушке Дарье, которая принимала вещи 👌🏻\r\nБольше благодарных клиентов и позитива !!!', 24, 155, 'Ответ на отзыв'),
(91, 'Случилась беда с моим авто. Позвонила на СТО, выслушав мою речь и жалобу на автомобиль предложили записаться на осмотр. Но мне срочно нужно было узнать что с машиной и желательно бы и починить в течении пары часов. Мне пошли на встречу и предложили подъехать сейчас ,сделали диагностику. И через 2 часа после звонка из СТО что всё готово, я уже катила по делам. Молодцы! Оперативно. Очень вежливые, спокойные парни. Спасибо огромное.', 2, 158, 'Ответ на отзыв'),
(92, 'Приехал за сигнализацией  динамиками, рассказали и записали на установку. Спасибо!\r\n', 1, 4, 'Ответ на отзыв'),
(93, 'Хотелось бы выразить огромную благодарность компании «Окна24», начиная с приёма заказа.\r\nЯ осталась довольна выполненной работой и претензий не имею. Спасибо!!! Моя оценка по пятибальной системе - 5 баллов.', 18, 108, 'Ответ на отзыв'),
(94, 'Отличный салон, атмосферный и с пользой для здоровья. Открыла для себя Подводный вакуумный массаж 😍 по рекомендации подруги, очень довольна. После второго сеанса массажа результат - отпустило напряжение в шейно-воротниковой зоне и прекратились боли в спине. И самое главноу каждаю процедура дает снижение веса это Чудо. Приятная атмосфера и внимательный персонал на ресепшен. Рекомендую❤️', 10, 181, 'Ответ на отзыв'),
(95, 'Большой выбор, всё красивенькое, очень соблазнительно пахнущее. Глаза разбегаются.', 26, 160, 'Ответ на отзыв'),
(96, 'Внимательные, вежливые администраторы. Чистота на 100%. Гостевая зона уютная. Номер отличный мы останавливались в Люксе с очень стильным и приятным интерьером. Очень красивые фоточки получились для Инстаграм в этом номере. Рекомендую 100%. Если буду в этом городе ещё, остановлюсь здесь обязательно! ', 5, 35, 'Ответ на отзыв'),
(97, 'Обращался за требуемыми услугами! Консультация на высоте, поэтому и начал работать с данным адвокатом.  Рекомендую, второй раз только сюда!', 28, 166, '\"Одно дело - 100% результат!\"  - Убрать из отзыва.'),
(98, 'Спасибо вам большое !неделю мне ни кто не мог оформить  осаго и в главном офисе пробовали и по мелким компаниям ходили все было безрезультатно,а нам машину на учёт без полиса ни кто не хотел ставить ! Здесь же за 30 минут решила нашу проблему !Всем сосоветую', 36, 178, 'Ответ на отзыв'),
(99, 'Первый раз обратилась в химчистку и не пожалела. Сдавала кашемировые джемпера, состояние после чистки идеальное. Обязательно приду еще.', 24, 155, 'Ответ на отзыв'),
(100, 'После работы с Николаем осталось только положительное впечатление, да и в целом работа выполнена хорошо, надеюсь качественно, время как говорится покажет,  поэтому отзыв пишу с опережением, желаю вам удачи вы молодцы!', 18, 157, 'Ответ на отзыв'),
(101, 'Работники пунктуальны, приезжают вовремя, вежливые. Отличная работа, сделали все в срок, собрали за собой мусор. Ребята молодцы! спасибо!', 18, 106, 'Ответ на отзыв'),
(102, 'Сделали все оперативно и качественно', 34, 174, 'Ответ на отзыв'),
(103, 'Отремонтировали дорогой ноутбук без развода на деньги. Лишнего не взяли, старые запчасти отдали.', 27, 161, 'Ответ на отзыв'),
(104, 'Очень удобное расположение, как раз недалеко работаю, поэтому заношу вещи, а после смс забираю уже чистые. Спасибо вам большое за работу!', 24, 155, 'Ответ на отзыв'),
(105, 'Отличный сервис, быстрая химчистка, приветливый персонал. Класс!', 24, 155, 'Ответ на отзыв'),
(106, 'Катались вместе с сыном . Очень понравилось. Зачётная трасса. Накатались от души. Перед заездом обязательный инструктаж. Потом одеваешь экипировку и только после в машину.Организаторам огромное спасибо за прекрасно проведенное время!', 30, 168, '1 ОТЗЫВ В НЕДЕЛЮ'),
(107, ' Относила телефон в ремонт. Сделали всё в течении 4-х часов. Пока нареканий нет, всё работает исправно. Думаю, что, если понадобится ещё помощь по ремонту техники, обращусь именно сюда.', 17, 171, 'Ответ на отзыв'),
(108, 'МОЛОДЦЫ!!! Сделали нам отличную кровать в гостевую комнату Очень довольны с женой результатом, теперь заказали у них еще один диванчик:) С удовольствием рекомендуем!)', 12, 74, 'Ответ на отзыв'),
(109, 'Хочу выразить благодарность за юридическую консультацию компании Юристер! Я обратилась с запросом по банкротству и после консультации мы оформили договор. Будет работать дальше! Здесь готовы выслушать и учесть все ваши пожелания, хорошо разбираются в своей области и предоставляют достоверную информацию. ', 28, 182, 'Ответ на отзыв'),
(110, 'Покупали верхнюю одежду для ребенка, есть выбор, , есть интересные модели, которых нет в сетевых магазинах  или детском мире, удобное расположение,  продавцы вежливые, внимательные)', 14, 83, 'Ответ на отзыв'),
(111, 'Благодарю за проделанную работу!!! За теплое отношение, предупредительность по многим вопросам подготовки к сделкам. За месяц две успешно проведенные сделки- все грамотно, четко и оперативно! Высочайший уровень организации и профессионализма. Признательна за участие и помощь в решении других жизненных вопросах. Качество работы на высшем уровне! Побольше бы таких профессионалов! РЕКОМЕНДУЮ!!!', 33, 186, 'Ответ на отзыв'),
(112, 'Отмечали тут корпоратив, помещение классное, еда огонь! Всё остались довольны! Спасибо большое вашим поварам!\r\nПроцветания и успехов!! Желаю Вам развиваться дальше!!!! 😘', 40, 190, 'Ответ на отзыв'),
(113, 'Замечательный магазин цветов, заказала в 10 утра, в 11 уже доставили, цветы свежие, букетик замечательный, цены приятно порадовали, надеюсь на дальнейшее сотрудничество!', 25, 156, 'Ответ на отзыв'),
(114, 'Покупала сигнализацию, продавцы помогли с ассортиментом, подсказали рассказали, очень понравилось, хороший автосервис, советую\r\n', 1, 4, 'Ответ на отзыв'),
(115, 'Вы меня просто спасаете каждый раз! Очень люблю ваше ателье и всех ее мастериц. Сколько было спасено вещей... Просто люблю.', 14, 173, 'Ответ на отзыв'),
(116, 'Оставлю отзыв о сеансе массажа  АкваТорнадо! Великолепно! Расслабление тела и наверное души. Ни одной мысли в голове, полная сосредоточенность на ощущениях в теле и фокус внимания на нем!\r\nОгромная благодарность массажисту!', 10, 181, 'Ответ на отзыв'),
(117, 'Всегда носила в это ателье только подшить/укоротить вещь, в этот раз принесла пуховик на реставрацию. Мастер спасла его: заменила темные вставки и кнопки, все очень аккуратно!!! Отличное ателье! Всем рекомендую!', 14, 173, 'Ответ на отзыв'),
(118, 'От всей нашей компании хочу поблагодарить Вас за отличный корпоратив!\r\nПрекрасная атмосфера, уютно, вкусная еда, заботливый персонал, все вообще ТОП! Даже подарки были . В общем всё было так как мы ожидали! Вы молодцы)', 35, 175, 'Ответ на отзыв'),
(119, 'Добрый день. На днях пользовался услугами вашей химчистки. Очень доволен. Персонал знает свое дело. Результат порадовал. Непременно буду и в дальнейшем посещать вас!! Удачи ', 24, 155, 'Ответ на отзыв'),
(120, 'Фитобочка - это что-то необыкновенное! Уже второй год подряд хожу на курс процедур с фитобочкой. В период болезней она очень эффективна, ну по крайней мере мне очень помогает. Поддерживает иммунитет, да и эмоциональное состояние отличное. Рекомендую!!!', 11, 170, 'Ответ на отзыв'),
(121, 'Первичную информацию по остеклению балкона получила по телефону в корректной форме. Цена при замерах не превышала цену, озвученную предварительно по телефону.\r\nПо срокам все выдержано. Предупредили, что будет +- 2 дня. В день установки специалисты приехали ровно в 9.00, это приятно удивило. Работали чисто, аккуратно и быстро. Для меня были некоторые моменты принципиальны, обсудили, услышали. Благодарю компанию и специалистов Ильдара и Шамиля за работу. Качество самого изделия покажет себя во времени. Верю, что все будет хорошо.', 18, 108, 'Ответ на отзыв'),
(122, 'Остались только положительные впечатления от сотрудничества с ЖИЦ . Продавали и покупали квартиры сделки были не простыми ,НО всё прошло отлично !', 33, 186, 'Ответ на отзыв'),
(123, 'Рада покупке, спасибо, ещё приеду обязательно :-)', 26, 160, 'Ответ на отзыв'),
(124, 'Срезали дочке волосы. Заплатили как и обещали. Бесплатная стрижка очень понравилась. Как снова  отрастут, непременно только к ним.', 10, 63, 'Ответ на отзыв'),
(125, 'Покупали коттедж с Бозоровым Фархадом, он проявил себя как первоклассный специалист. Предоставил достаточное количество домов и коттеджей на выбор, на каждом осмотре присутствовал. Открыто озвучивал, минусы, чем очень нам помог. Огромное спасибо за такое отношение к работе.', 33, 172, 'Ответ на отзыв'),
(126, 'Отличное место для развития детского спорта. Ходим с дочерью на спортивную акробатику и растяжку к прекрасному тренеру , все довольны. Комфортный зал. Рады, что попали в такую дружную и активную команду!!!', 29, 167, 'Ответ на отзыв'),
(127, 'Отличный уровень обслуживания: быстро, и главное, реально дешевле чем у многих! Делал страховку на свои 3 машины, 2 жены и 2 у брата - всем рекомендую👍', 36, 178, 'Ответ на отзыв'),
(128, 'Любим Мажорики! Широкий выбор и ассортимент.Сезонные скидки. Персонал приветливый,очень заинтересованы в продажах,предложат кучу вариантов.Уйти без покупки сложно! По качеству претензий нет.Покупаем у них верхнюю одежду,блузки и брюки, свитера и т.д.Спасибо,что ВЫ есть!👍', 14, 83, 'Ответ на отзыв'),
(129, 'Приехал к ребятам на тонировку. Цены адекватные. Качество на высоте! Пленка хорошая', 2, 194, 'Рады помочь!'),
(130, 'Отличный выбор мебели. Долго искал что поставить на кухню. Понравилась расцветка так и взял на заказ по размеру.', 12, 192, 'Ответ на отзыв'),
(131, 'Я привел ребенка в частный детский сад \"Ладушки\" и остался очень доволен своим выбором. Директор и весь персонал заслуживают самых лестных отзывов. Они очень заботятся о детях и создают теплую и дружественную атмосферу. У меня остались только положительные впечатления. Я с уверенностью могу сказать, что \"Ладушки\" - это лучший детский сад! Спасибо всем сотрудникам за их труд и любовь к детям!', 6, 165, 'Ответ на отзыв'),
(132, 'Отличное ателье.', 14, 173, 'Ответ на отзыв'),
(133, 'Хочу выразить благодарность за прекрасную организацию нашего корпоративного вечера 15.12.2023 года и вкусный стол. Все было чётко, своевременно, очень вкусно. Администраторы очень внимательны к пожеланиям, помогли составить меню, учли все нюансы. Было очень вкусно! С наступающим Новым Годом! Желаем всем здоровья и энтузиазма, добрых надежд и радостных событий, счастливых улыбок и настоящих чудес.', 35, 175, 'Ответ на отзыв'),
(134, 'Добрый день, покупала квартиру с ЖИЦ Южный дом . Квартира была непростая, да ещё и в ипотеку, но Виктория- молодец! Все организовала, постоянно на связи, поддержала в трудные моменты. Спасибо огромное!', 33, 186, 'Ответ на отзыв'),
(135, ' Консультировался по вопросу составления искового заявления. Адвокат  задала много уточняющих вопросов, которые другие юристы не спросили, грамотно предоставила полную информацию. Спасибо за консультацию. Однозначно рекомендую Сокол Лига!', 28, 166, 'Ответ на отзыв'),
(136, 'Покупал квартиру в новостройке через Южный дом с помощью Дмитрия. Был проведен по всем этапам от осмотра и до регистрации прав на недвижимость с удобством и полным удовлетворением от общения.\r\nЕсли не хотите волноваться за итоги сделки - рекомендую обращаться сюда.', 33, 186, 'Ответ на отзыв'),
(137, '\r\nДолго не могли найти нужный дизайн кровати , который нам подойдет для спальни. Зашли к Вам, сразу были в восторге от большого ассортимента.Заказали для себя то , что хотели и остались довольны.', 12, 74, 'ФОТО ПРИКРЕПИТЬ!'),
(138, 'Данная юридическая компания уже не раз нас выручала в сложных юридических вопросах. На консультациях Шариф Бакирович все грамотно и четко объясняет, и помогает с решением проблем. Безмерно благодарны.', 28, 182, 'Ответ на отзыв'),
(139, 'Все просто супер! Помогли с выбором и заказом цветов. Удачи во всех начинаниях.', 25, 156, 'Ответ на отзыв'),
(140, 'Хочу поблагодарить Харину Аурику! Грамотный специалист, помогла мне с сестрой в решении вопроса по поводу жилищного сертификата, всё подробно рассказала,объяснила как действовать, какие документы собрать. В итоге все получилось.', 28, 166, 'Ответ на отзыв'),
(141, ' Сломался у меня ноут сони вайо. Отвез в другой сервис, сломали окончательно гнездо зарядки и нарушили цепь питания. Приехал в «Мастер сервис GSM», всё починили и денег взяли не много. А очень важно то, что объяснили и даже почистили комп внутри. Очень благодарен и буду ещё обращаться.', 17, 171, 'Ответ на отзыв'),
(142, 'Обожаю это место за эмоции, скорость и крутую команду ребят, которые рядом на всем протяжении заезда. Катаемся всей семьёй (дочка 6 лет сама рулит).', 30, 168, 'Ответ на отзыв'),
(143, ' Атмосфера дружелюбная. Находится в центре где приятно погулять вечерком в парке . Для хостела очень даже хорошо.', 5, 35, 'Ответ на отзыв'),
(144, 'Вкусно, атмосферно, официант (имени не помню) большая молодец!', 19, 114, 'Ответ на отзыв'),
(145, 'Давно посещаю оздоровительный центр «Водный цветок». На ресепшене встречают мило и  доброжелательно. Хожу на подводный вакуумный массаж АкваТорнадо.  Очень довольна работой и профессионализмом оперетра.\r\nА главное результат с первой процедуру 900 грамм.', 10, 181, 'Ответ на отзыв '),
(146, 'Поменял тут антифриз, специалист мне попался ответственный, других тут не бывает. Все сделал чисто, аккуратно, промыл систему, все прошло быстро.', 2, 158, 'Ответ на отзыв'),
(147, 'Поменял акустику и сделали шумоизоляцию дверей. Благодарен.', 1, 4, 'Ответ на отзыв'),
(148, 'Компания Окна24 установили качественно и в сроки окно. Всё от замера до установки прошло гладко, работают профессионалы. Рекомендую компанию!', 18, 108, 'Ответ на отзыв'),
(149, 'Хочется выразить огромную благодарность прекрасной команде Жиц Южный дом , в частности Константину за быструю и профессиональную работу, а также душевную чуткость и терпение при работе с пожилым клиентами. Большое Вам человеческое Спасибо, успехов и процветания! С большим удовольствием будем рекомендовать Вас как грамотных специалистов и хороших людей всем близким и знакомым.', 33, 186, 'Ответ на отзыв'),
(150, 'Хочу выразить благодарность компании\r\nПортал и ее сотрудникам за\r\nпроделанную работу, начиная от\r\nпроекта и заканчивая установкой\r\nмебели! На всех этапах всё выполнено\r\nпрофессионально и в срок.\r\nБелоснежные шкафы-купе в\r\nклассическом стиле отлично вписались\r\nв спальню. Результат\r\nоказался на высоте!', 12, 192, 'Ответ на отзыв'),
(151, 'Отдали на внешнее управление системное администрирование  (аутсорс). Реакция на подключение и выезды быстрая. Сотрудники вежливые, все объясняют на доступном языке. Провели модернизацию наших серверов и сети. Мы довольны. Спасибо вам!', 27, 161, 'Ответ на отзыв'),
(152, 'Обожаю это место! В этот раз подбирала аромат маме. Консультантом все сделано грамотно и со вкусом.Спасибо', 26, 160, 'СКОРРЕКТИРОВАНО!'),
(153, 'Приехал оформлять страховку ребенку для соревнований. Адекватные и доброжелательные люди. Документы приняли и сказали что необходимо донести. А так же сказали, что можно отправить по электронной почте, не приходя к ним. Оформил в общем удаленно у них без потери времени. Спасибо огромное! ', 36, 178, 'Ответ на отзыв'),
(154, '«Альфа-Дом» — это определенно лучшее агентство в своем деле, с помощью него мы продали свою старую и приобрели новую квартиры. Нам настолько облегчили нашу участь, звонки, встречи, документация- все агентство взяли на себя. Спасибо, что так ответственно подходите к своей работе, будем Вас рекомендовать.', 33, 172, 'Ответ на отзыв'),
(155, 'Отличное ателье! Сколько раз ни обращалась, все всегда на высшем уровне! Внимательность и аккуратный результат. Причем приходила сюда и с вещами, требующими деликатного подхода. Однозначно рекомендую. Успехов вам!', 14, 173, 'Ответ на отзыв'),
(156, 'Обратились в данную компанию и остались очень довольны! Спасибо большое, сделали всё на высшем уровне, мы в восторге👍🏻', 18, 106, 'Ответ на отзыв'),
(157, 'Моему восторгу нет предела!!! Купил новую куртку, просто шикарную. И на второй день носки вырвал клок кожи на рукаве. Я доверился и обратился сюда. Ожидал всякое, но такое.... Я не думал что не будет замётано и следа. Выражаю искреннюю благодарность мастеру и руководству ателье за столь оперативную аккуратно выполненную работу!', 14, 173, 'Ответ на отзыв'),
(158, 'Спасибо Софие за хорошую и четкую работу. Ею было всё подробно объяснено, всё в сроки и даже быстрее чем думали. Тактичный, аккуратный и грамотный сотрудник! Очень довольны и будем обращаться ещё. Спасибо!!!', 33, 186, 'Ответ на отзыв'),
(159, 'Хорошая фабрика. Заказывала шкаф в спальню. Менеджер Анна грамотно помогла с дизайном. Все полочки, ящички, дверцы обговорили, нарисовали. Материалы подобрали. Перед изготовлением приходили парни на замер, учли все нюансы, внесли коррективы. После изготовления согласовали дату монтажа, пришли и установили. Всё профессионально, согласованно. Я очень довольна. Пользуюсь и радуюсь. Спасибо!', 12, 192, 'Ответ на отзыв'),
(160, 'Всем привет. Была на процедуре холодная плазма. Процедура достаточно болезненная, но терпимая. Хочу отметить по результатам, прошло уже 3 месяца, могу сказать что, холодная плазма отлично поднимает верхнее веко. Спасибо, буду рекомендовать однозначно!\r\n', 10, 177, 'Ответ на отзыв'),
(161, 'Очень хороший салон! Приветливый и квалифицированный персонал.\r\nВсе просто супер !!!!\r\nВидно, что мастера с душой к любимому делу. Огромное спасибо.', 10, 176, 'Ответ на отзыв'),
(162, 'Отличное место, девочки-специалисты своего дела. Сделала чистку лица- очень аккуратно, бережно, эффективно. Мне понравилось. Обязательно приду ещё. 🙂', 10, 177, 'Ответ на отзыв'),
(163, 'Работу свою выполнили очень хорошо. Все организовали. Спасибо.', 39, 187, 'Ответ на отзыв'),
(164, 'Огромное спасибо Александре за удаление тату. Очень приятная! Это был первый мой сеанс, особо каких-то болезненных ощущений не было. И сама студия очень понравилась! Благодарю Вас! Оборудование новейшее. Очень все красиво! И до встречи уже на последующих сеансах!', 10, 189, 'Ответ на отзыв'),
(165, 'Самая лучшая студии тату, где работают реально профессионалы своего дела 👍боже по молодости не думаешь о том, чего творишь и кажется круто, но проходят года ты взрослеешь и понимаешь какой косяк на твоём теле 🤦🤷так что если у вас есть ошибки молодости или Вы реально хотите достойную тату и не стадно её показать то Вам исключительно сюда.', 10, 188, 'мастера ОЛЬГА ЗУЕВА             АЛЕКСАНДР КЛИНОВКИН        ПЁТР МАВРЕНКОВ      ДМИТРИЙ БЛАГОВЕЩЕНСКИЙ НИКА ЛОГАЧЕВА                                                            ПЁТР МОИСЕЕВ                               МАКС МРЯСОВ'),
(166, ' Решил затонироваться в Тонире 54.   Сделать антихром вокруг стекол. Все сделали очень добротно. Красиво! Теперь только к вам! ', 2, 194, 'Будем ждать вас снова!'),
(167, 'Обслуживание хорошее, заселили раньше времени. В хостеле  чисто, есть место для отдыха,на кухне чай,кофе, печеньки вкусные. Вода горячая, холодная напор хороший. Матрасы мягковаты как для меня, постельное чистое. Ночью тихо никто не шумит. Все рядом. Однозначно рекомендую', 5, 35, 'Ответ на отзыв'),
(168, 'Обратилась в Юристер за помощью при оформлении сделки с недвижимостью. Адвокат  Анна Васильевна подошла к вопросу очень индивидуально, разобрала все тонкости вопроса и постаралась максимально подробно объяснить все важные моменты. Искреннее выражаю благодарность за такое отношение к работе и людям.', 28, 182, 'Ответ на отзыв'),
(169, 'Отличная детская одежда', 14, 83, 'Ответ на отзыв'),
(170, 'Магазин детской и подростковой одежды.  Фасоны одежды отличаются от остальных магазинов - много прикольных красивых вещичек. Цены весьма демократичные. Ребенок любит одеваться именно здесь.', 14, 83, 'Ответ на отзыв'),
(171, 'Цена - качество очень соответствует. Презентабельные дизайны. Большой выбор актуальных изголовий (в т.ч. бесконечное). Возможность изменения конструкции кровати под клиента. Настоящая свобода выбора размера кровати. Все это про Shimkor . Нам все очень понравилось )', 12, 74, 'ФОТО ПРИКРЕПИТЬ!'),
(172, 'Купил вторую машину в семью Gelly Coolray, первая haval f7, спустя два года на бампере и капоте сколы, так как у нас дороги посыпают гравием, по этому горькому опыту на Gelly решил защитить кузов, заехал к ребятам, они мне оклеили полиуретановой плёнкой всю фронтальную часть. Теперь морда в безопасности ) Ребята молодцы сделали всё четко, чувствуется рука профессионалов )', 2, 195, 'Спасибо за подробный отзыв, будем ждать вас снова!'),
(173, 'Задача была подготовить в общежитии комнату для студента, все договоренности в том числе договор заключался дистанционно, потом сын принимал работу, был в восторге 😁🤗😍 все очень понравилось, мы рады, что есть такие компании, которые оказывают весь комплекс услуг и при том делают это хорошо, рекомендую компанию Roko.', 18, 157, 'Ответ на отзыв'),
(174, 'Отличная компания. Инженеры приехали быстро, все рассказали и показали. Ценник достаточно адекватный. Вежливый персонал, оперативный монтаж. Спасибо за сотрудничество.', 34, 174, 'Ответ на отзыв'),
(175, 'Выражаю свою благодарность за хорошо выполненные работы мебельной фабрике \"Портал\" в особенности менеджеру Марии. Благодарю за оперативное изготовление нашей кухни. Все сделали в срок и очень качественно за доступную цену. Компанию \"Портал\" Буду рекомендовать своим друзьям и близким. Спасибо Вам большое.\r\n', 12, 192, 'Ответ на отзыв'),
(176, 'Салон замечательный, мастер \r\nзамечательно сделала пудровые брови, мастер работает с лицом, брови очень омолодили взгляд. Спасибо! Рекомендую! Хотите что то поменять, на тему лучше выглядеть! Вам сюда\r\nУдачи!', 10, 177, 'Ответ на отзыв'),
(177, 'Любимый салон! Салон с приятной ценовой категорией, внимательность к клиенту.', 10, 176, 'Ответ на отзыв'),
(178, 'Очень нравится салон! Абсолютно комфортное место, мастера профессионалы🤩\r\n', 10, 177, 'Ответ на отзыв'),
(179, 'Хотим поблагодарить Викторию! При изначально не очень выгодном положении, благодаря опыту, советам и профессионализму Вики приобрели квартиру своей мечты в хорошем районе!', 33, 186, 'Ответ на отзыв'),
(180, 'Спасибо большое за всё! Здесь очень круто! Корпоратив прошел на отлично! Безумно понравилась Ваша вовлеченность в организацию праздника! Очень вкусная еда, ненавязчивое обслуживание, помощь в любых вопросах! Спасибо! Вернёмся обязательно!', 40, 190, 'Ответ на отзыв'),
(181, 'Был на выходных этих. Ребята помогли подобрать сигнализацию  на автомобиль. Всё очень понравилось, ребята молодцы.', 1, 4, 'Ответ на отзыв'),
(182, 'В интернете увидела рекламу о плазмотерапии в гинекологии. Позвонила в клинику, меня записали на консультацию к гинекологу Исмаиловой Софико, а после сделали процедуру. После эпизиотомии (во время родов), шрам доставлял дискомфорт, а плазмотерапия помогла улучшить качество кожи, и шрам стал менее твердым, и перестал приносить дискомфорт. Спасибо Софико за помощь, буду рекомендовать!', 11, 170, 'Ответ на отзыв'),
(183, 'Спасибо мебельной фабрике Портал за мой новый шкаф! Большое спасибо дизайнеру Марии и сборщику мебели Виталию. Контакт на 5. 😊', 12, 192, 'Ответ на отзыв'),
(184, 'Заказываю 3 раз, качество окон отличное, доставка в срок, цены приемлимые. Рекомендую 👍', 18, 108, 'Ответ на отзыв'),
(185, 'Очень уютно, приветливые сотрудники. Удалила старый татуаж за одно посещение. Очень рекомендую, кто мучается со старым татуажем.', 10, 176, 'Ответ на отзыв'),
(186, 'Современный ,уютный салон .Вежливый и приветливый персонал .Была на первичной консультации у косметолога, и сделала комбинированную чистку лица, результатом и консультацией очень довольна . Буду с удовольствием ходить на все процедуры именно сюда !\r\n', 10, 177, 'Ответ на отзыв'),
(187, 'Отличный оздоровительный центр! Прекрасный персонал, качественные оздоровительные процедуры, а АкваТорнадо идеально подходит для здоровья и отдыха душой и телом! Однозначно рекомендую для поддержания здоровья и продления активного долголетия', 10, 181, 'Ответ на отзыв'),
(188, 'Для покупки большей площади квартиры обратились в ЖИЦ к Сергею, он очень грамотный специалист очень быстро помог в покупке жилья, на тот момент было ограничение по количеству вариантов, так же сумма была ограничена, но благодаря Никите удалось купить квартиру с большой площадью и в удачном месте. Также хотелось бы отметить грамотное сопровождение сделки юристом.', 33, 186, 'Ответ на отзыв'),
(189, 'Заказали кухню.\r\nПолный восторг! Всё на высшем уровне. Уже на этапе знакомства с менеджером Марией, которая внимательно отнеслась к заказу, я решила, что не имеет смысла искать другие фирмы. Что касается формирования ценовой политики и системы оплаты, так тут реально имеет место индивидуальный подход.\r\nКухня установлена в срок. Очень красиво и аккуратно. Ещё попользоваться в полной мере не успели, но по всей мебели однозначно буду обращаться сюда', 12, 192, 'Ответ на отзыв'),
(190, 'Заказывали кухонный гарнитур. Все сделали в срок, что не маловажно. Мебель качественная, монтаж профессиональный. Менеджеры отвечают на любые вопросы, практически в любое время суток. Считаю, что главная характеристика данной компании - это клиентоориентированность. Есть, конечно, нюансы, но, более чем уверен, что совместно мы их решим. С удовольствием придем в данную организацию за новой мебелью!', 12, 192, 'Ответ на отзыв'),
(191, 'Делала кухню в Портале.\r\nУ меня маленькая кухня-гостиная, больше всего боялась, что мебель будет грубо и тяжело смотреться. Но, спасибо менеджеру проекта,\r\nЖанне, которая помогла быстро подобрать оптимальное решение для моих площади и пожеланий.', 12, 192, 'Ответ на отзыв'),
(192, 'Рекомендую) я заказывала здесь платье, ремонтировали, ушивали, подшивали разную одежду, все отлично, спасибо!', 14, 173, 'Ответ на отзыв'),
(193, 'Пришла с короткими волосами на нарашивание волос в студию Людмилы и не пожалела. В других салонах мне отказали из за длины, сказали, что будет очень некрасиво. Но, мастер Анжела просто волшебница! Нарастила абсолютно незаметно по своей технологии. Даже сняли меня на видео. Теперь это моя любимая студия.', 10, 63, 'Ответ на отзыв'),
(194, ' Детям в Невесомости очень нравится заниматься. Тренер крутой, очень отзывчивый, доступно объясняет. Приходишь в зал чувствуешь уют и доброжелательность. Всегда подскажет, посоветует, как быть в той или иной ситуации. Дочь занимается всего полгода, а результаты уже отличные. Рекомендую друзьям.', 29, 167, 'Ответ на отзыв'),
(195, 'Работа выполнена быстро, а главное качественно. Спасибо большое) После обращения в три сервиса, профессионализм и стоимость работ приятно удивили. Отличная работа.', 17, 171, 'Ответ на отзыв'),
(196, 'Сходили всей семьёй, ребенок сначала испугался, первый раз был, но тренер постоянно был рядом, подбадривал и подсказывал, поэтому сын быстро освоился и  попросил продлить катание ещё на 2 заезда! Спасибо. Очень вежливые и приятные ребята работают, инструктаж подробный провели.', 30, 168, '1 ОТЗЫВ В НЕДЕЛЮ'),
(197, '.\r\n\r\nВсегда печатаю здесь. Могу сказать, что соотнесения цены и качества устроило. Сначала думала не разберусь, но все гораздо проще, чем я думала. . ', 41, 197, 'Ответ на отзывыМы не типография, книги не печатаем.   К нам услуги только копирования, сканирования , распечатка с телеграмм бота и USB.   Первый отзыв совершенно не подходит . Всегда печатаю здесь. Могу сказать, что соотнесения цены и качества устроило. Сначала думала не разберусь, но все гораздо проще, чем я думала. . '),
(198, 'Обратились в компанию сделать потолок в гостиную, заказ выполнили точно и в срок. Бригада монтажников свою работу выполнили быстро и качественное. В будущем планирую ещё обращаться в данную компанию, а так же рекомендую всем желающим изменить свои потолки. Большое спасибо за работу.', 22, 193, 'Ответ на отзыв'),
(199, 'Брала цветы подруге на день рождения. Задумка была сложная, но сотрудники справились без труда! Получилось очень нежно и красиво, отличное место!', 25, 156, 'Ответ на отзыв'),
(200, 'Летом искала компанию в сети интернет для установки ворот на нашем участке, наткнулась на компанию с большим опытом работы -  и обратилась в офис с просьбой о замере. Приехали, выполнили замер, посчитали на месте и озвучили цену - вполне приемлемая. Монтаж сделали в сентябре, бригада приехала в обозначенное время и быстро все установила. Красиво, быстро, аккуратно, спасибо Вам большое!', 18, 191, 'Ответ на отзыв'),
(201, 'Очень приятен  в общении Артем.  Грамотен и очень интересно рассказывает про парфюмерные бренды.\r\nВ принципе, я как любитель парфюма могу рекомендовать этот магазин, много нишевой парфюмерии, на все вкусы и кошельки', 26, 160, 'Ответ на отзыв'),
(202, 'Являюсь постоянным покупателем, достойная цена, отличное качество, приятные флористы!', 25, 156, 'Ответ на отзыв'),
(203, ' С нами работал риэлтор Бычкова Анастасия. Обратились мы к ней по рекомендации моей сестры, которая ранее покупала через нее квартиру. Хотим сказать искреннее спасибо! Очень приятный агент, было комфортно с ней общаться. Сделала все быстро, и главное к делу подошла ответственно. Сделкой и покупкой остались очень довольны.', 33, 172, 'Ответ на отзыв'),
(204, 'Хорошее адвокатское бюро. Помогли мне взыскать деньги, которые отказалась выплачивать страховая после ДТП.', 28, 166, 'Ответ на отзыв'),
(205, 'Волшебный салон красоты✨ \r\nПрохожу курс корректирующего массажа тела, результат просто потрясающий, я даже не ожидала, что такое возможно!😍\r\nТакже делала пилинг лица, эффект заметен сразу! Все стерильно, чистенько, сервис на высоте! Спасибо большое за Ваш труд и умение расположить к себе клиента. Я Ваша навеки😅❤️', 10, 176, 'Ответ на отзыв'),
(206, 'В конце октября купили квартиру в новостройке через Южный дом. В связи с этим хочу поблагодарить агента Дмитрия за помощь в выборе квартиры. Дмитрий - ответственный и грамотный профессионал, было очень приятно с ним работать. На протяжении всего процесса выбора и приобретения благодаря Дмитрию мы чувствовали, что мы в надежных руках и что все под контролем.', 33, 186, 'Ответ на отзыв'),
(207, 'Рассказываю. Решил я почистить ноутбук самостоятельно и замкнул все! Обратился на следующий день в этот сервис (на работе посоветовали). Прогноз был не утешительный.... т.к я матрицу отключал с подключенной батарейкой (объяснил мастер, что этого категорически делать нельзя). В общем, восстановили за три дня, сказали повезло... Вывод: не умеешь, не лезь! Каждый должен заниматься своим делом. Огромное спасибо мастеру своего дела. Урок усвоен)', 17, 103, 'Ответ на отзыв'),
(208, 'Закончилась страховка,на выходных почти все отдыхают. Обратился в Art-страхование , без очереди и нервов сделали страховку, все быстро и вежливо объяснили.Спасибо за Вашу работу!', 36, 178, 'Ответ на отзыв'),
(209, 'Огромное спасибо за помощь! Вы делаете очень доброе дело! Очень хорошо что можно доверить эти хлопоты и достойные прощальные проводы самого близкого человека профессионалам!', 39, 187, 'Ответ на отзыв'),
(210, 'Купил новый автомобиль Haval. У дилера озвучили цену тонировки в районе 20к за заднюю полусферу, У ребят гораздо дешевле и при этом сделали все очень аккуратно и качественно. Я очень доволен! ', 2, 194, 'Рады стараться, приезжайте!'),
(211, 'Притемнил фары на своей  бмвешечке 5-ке, теперь фары защищены и смотрятся круто ) Спасибо ребятам за работу )', 2, 195, 'Рады помочь)'),
(212, 'Качество одежды и обуви отличное. Детям удобно , комфортно и носят с удовольствием.', 14, 83, 'Ответ на отзыв'),
(213, 'Часто забегаю в кофейню поработать, провести встречу, всегда приветливые ребята!', 35, 196, 'Ответ на отзыв'),
(214, 'Выражаю благодарность сотрудникам компании за высокий профессионализм. Первая встреча очень важна для клиента. Четкое исполнение сроков приема посетителей, практически без ожидания в холле. Доброе, внимательное отношение к клиенту. Убедительно и доказательно объяснили  проведение бракоразводной процедуры . Рассмотрели различные варианты и заключили договор. Надеюсь, что наше сотрудничество -завершится благополучно для обеих сторон.', 28, 182, 'Ответ на отзыв');
INSERT INTO `reviews_archive` (`review_archive_id`, `review_archive_text`, `review_archive_category`, `review_archive_subcategory`, `review_archive_answer`) VALUES
(215, 'Понравился основательный подход, находилась за пределами РФ, решили вопрос дистанционно, точно в срок, благодарю!', 28, 166, 'Ответ на отзыв'),
(216, 'Уже давно покупаем одежду и форму для ребёнка в Мажориках. . Товар отличный, качество пошива на высоте. Ну а цены 😄', 14, 83, 'Ответ на отзыв'),
(217, 'Очень профессиональная работа менеджера, согласовали всё от обивки и дизайна до последнего стежка на нашей кровати.Заказ выполнен в срок и бесплатно привезли.Всем советую!', 12, 74, 'Ответ на отзыв'),
(218, 'Сходила я на чистку зубов в эту стоматологию и осталась очень довольна. Персонал профессиональный, оборудование новое, а главное - зубы после лечения блестят, как жемчуг! Я даже подумала, что мне надо ходить на чистку зубов чаще, чтобы они всегда были такими белоснежными.', 11, 66, 'Ответ на отзыв'),
(219, 'Мы очень довольны детским садом \"Ладушки\"! Нашим детям там было так здорово, они каждый день с улыбкой отправлялись туда. Очень понравилось, что все прозрачно и открыто - всегда можно было посмотреть, что происходит в группе. Педагоги относятся к детям с любовью и заботой, всегда готовы выслушать и помочь. Мы оценили их профессионализм и внимание к деталям. Отличное место для детей, где они могут развиваться и чувствовать себя в безопасности. Спасибо за замечательное время в \"Ладушках\"!', 6, 165, 'Ответ на отзыв'),
(220, 'Организовали праздник нашему коллективу к Новому году. Всё понравилось! Обслуживание на высшем уровне. Цены очень демократичные. Еда вкуснейшая. Сорок с лишним человек - всем было вкусно! В зале очень уютно. Есть фото зона. Хочется приехать ещё даже просто с семьёй посидеть.', 35, 175, 'Не публикуем. не оплатил'),
(221, 'Самый любимый салон. Спасибо , благодаря девочкам из салона, я нравлюсь себе в зеркале!', 10, 176, 'Ответ на отзыв'),
(222, 'Достойная компания с достойными сотрудниками.\r\nОдни из немногих в городе кто ответственно подходит к производственному процессу.  Осуществили строительство автомойки в установленный срок.\r\nСпасибо огромное за проделанную работу, ребята мастера своего дела.', 18, 183, 'Ответ на отзыв'),
(223, 'Здравствуйте, приобретали измельчитель веток, очень довольны техникой. А сервис приветливый и всегда готовы помочь. Рекомендую данную компанию!', 37, 184, 'Ответ на отзыв'),
(224, 'С Деметра Digital  и его командой работаем уже несколько лет. У нас 3 сайта, которые нуждаются в постоянном продвижении. Очень довольны как стоимостью, так и качеством предоставляемых услуг.', 38, 185, 'Ответ на отзыв'),
(225, 'От всей души выражаю благодарность коллективу ЖИЦ Южный дом за проделанную высококвалифицированную работу по подбору квартиры в новом ЖК, подготовке документов и оформлению сделки.', 33, 186, 'Ответ на отзыв'),
(226, 'Отличный сервисный центр. Приходил сюда пару дней назад, чтобы заменить дисплей на айфоне, который я ранее разбил. Мастер с этой задачей справился за 20 минут, всё сделал качественно, я остался доволен.', 17, 103, 'Ответ на отзыв'),
(227, 'За качеством следят. Очень чисто, аккуратно. Общаются вежливо. Цены высоковаты, но езжу сюда. Качество услуг на уровне у них.', 2, 158, 'Ответ на отзыв'),
(228, 'Спасибо за совет - десерт просто невероятный 😍.', 19, 114, 'Ответ на отзыв'),
(229, 'Отремонтировали автозапуск. Очень вовремя перед холодными. Спасибо.', 1, 4, 'Ответ на отзыв'),
(230, 'Добрый день, заказала в этой фирме окно на кухню, сделали все на высшем уровне, качественный монтаж, быстрое и понятное составление договора, буду заказывать ещё.', 18, 108, 'Ответ на отзыв'),
(231, 'Я довольна всем с самого входа, начиная с ресепшн, обстановки и заканчивая процедурами. Понравилось отношение сотрудников, которые проводили мне массаж и обертывание. Я уже прошла три процедуры массажа, и меня полностью устроили результаты, поэтому буду посещать и дальше. Мастера разговаривают со мной во время процедур, общаются и отлично выполняют свою работу.', 10, 181, 'Ответ на отзыв'),
(232, 'Огромное спасибо Константину за отличную работу, за профессионализм в решении проблем в поиске вариантов продажи и покупки квартиры. В команде с юристом они проявили себя как слаженная и грамотная команда.\r\nСпасибо им большое!!!', 33, 186, 'Ответ на отзыв'),
(233, 'Заказали букет для именинницы. Букет оказался шикарным, доставили по времени. Букет у всех вызвал восторг!', 25, 156, 'Ответ на отзыв'),
(234, 'Я в восторге! Нарастила волосы к свадьбе. Невероятно мягкие, как свои. Волосы не путаются, из капсул не лезут, хотя капсулы были очень миниатюрные. Огромное спасибо за вашу работу, и за вкуснейший каппучино.', 10, 63, 'Ответ на отзыв'),
(235, 'Ребенок занимается второй год, все нравиться,. Многое зависит от тренера, а нам с ним повезло. Уделяют много времени детям и передают свои знания и опыт ребятам. Рекомендую.', 29, 167, 'Ответ на отзыв'),
(236, 'Обратился с поломкой двух ноутбуков. Сразу же договорились о времени встречи и цене. Цены, кстати, очень понравились. Работы выполнена была в срок и на высшем уровне, также сделана очистка и обслуживание всех систем ноутбуков, отремонтирована петля на экране и заменена матрица на втором ноуте. Навязывание работ не было, оговоренные цены не менялись. Очень порядочный и квалифицированный специалист.', 17, 171, 'Ответ на отзыв'),
(237, 'Мастер своего дела. Делал ТО ноутбука. Сделал все быстро, качественно и с объяснением нюансов. Рекомендую однозначно.', 17, 171, 'Ответ на отзыв'),
(238, 'Оформлял страховку по ипотеке. Всё быстро и чётко за приятный ценник. Еще и скидку сделали. Спасибо', 36, 178, 'Ответ на отзыв'),
(239, 'Выбора много, хорошее качество и часто акции. Удобно, что недалеко от дома и время работы магазина даёт возможность посетить его вечером, когда поменьше покупателей, а не только в выходной. Товар разбирают быстро. ', 14, 83, 'Ответ на отзыв'),
(240, 'Оклеил свой Lincoln в круг в полиуретановую плёнку, ребята подошли очень серьезно к делу, забронировали так же хромированные молдинги и решетку радиатора, я оценил . Сделали все аккуратно, уложились в поставленные сроки. ', 2, 195, 'Рады стараться, приезжайте еще!'),
(241, 'Распечатал всё быстро и качественно.Будем приходить ещё!', 41, 197, 'Ответ на отзыв'),
(242, 'Благодарю, все на отлично! Вкусные блюда, красивая и оригинальная подача.', 19, 114, 'Ответ на отзыв'),
(243, 'В Прянике уже останавливались несколько лет назад и приехав в Орел, решили поселиться здесь же. У них открылся новый двухэтажный корпус, в котором мы и жили на втором этаже. Номера очень светлые, все чистенько и уютно. Мы останавливались в Люкс Гжель. Гжель и вправду есть :-) На стенах, постельное белье и другие мелочи в стиле гжель. Хорошая душевая. В общем, Пряник и в этот раз очень порадовал. Вернемся обязательно еще не раз. ', 5, 35, 'Ответ на отзыв'),
(244, '👍👍👍.всё отлично. Спасибо за хорошую работу! Сделали всё быстро и самое главное качественно.', 18, 106, 'Ответ на отзыв'),
(245, 'Сервис не разочаровал, планшет смогли оперативно починить. Дисплей заменили.', 17, 103, 'Ответ на отзыв'),
(246, 'Огромная благодарность работникам ЖИЦ. Подобрали отличную квартиру по отличной цене. Юрист осуществила\r\nпрекрасное сопровождение наших сделок. Это суперсервис!', 33, 186, 'Ответ на отзыв'),
(247, 'Компания очень любит своих клиентов и это прям во всем видно ! Очень понравилось', 43, 199, 'Ответ на отзыв'),
(248, 'Хочу вас поблагодарить за оперативное решение проблемы с продажей маркированной продукции.  Так же огромное спасибо за настройку 1с. Теперь будем работать только с вами!', 27, 161, 'Ответ на отзыв'),
(249, 'Все всегда на « отлично» ! От подборки продукции до обслуживания . Высочайший уровень профессионализма во всем . Очень рекомендую.', 26, 160, 'Ответ на отзыв'),
(250, 'Притемнил  оптику переднюю и заднюю на своем Land Rover. Показали варианты, посоветовали как будет лучше. Сделали все качественно и красиво.', 2, 194, 'Рады стараться! '),
(251, 'Выражаю огромную благодарность  \"Юристер\" !!! Вы очень надёжная и сплоченная команда! Всё чётко, ясно, грамотно! Рекомендую всем, кто сомневался! Не пожалеете!!!! Команде успехов в дальнейшем! 💐👍👏', 28, 182, 'Ответ на отзыв'),
(252, 'Очень хорошо организованное место для покатушек на картингах! Квалифицированный персонал, доходчивый инструктаж, защитная экипировка.  Погонять компанией друзей просто ОГОНЬ 🔥', 30, 168, 'Ответ на отзыв'),
(253, 'Спасибо риелтору Оксане Шев и ее помощнику Дмитрию Клопову, все прошло отлично, продажа нашей дачи без лишних заморочек и покупка нового дома.', 33, 172, 'Ответ на отзыв'),
(254, 'Спасибо за слаженную работу на всех этапах организации похорон. Без вас было бы сложно все хорошо организовать, очень морально были подавлены. Спасибо за человечность.', 39, 187, 'Ответ на отзыв'),
(255, 'я делала здесь первое в жизни тату, было страшновато, но мастер Александр так надежно взял всë в свои руки,что я сразу перестала бояться - помог с эскизом, подобрал размер, объяснил, как подготовиться... на следующую тату решиться будет уже намного проще и делать ее приду обязательно сюда❤', 10, 188, 'Ответ на отзыв'),
(256, 'В процессе удаления татуировки в \"Битом небитого\".Очень грамотный,приятный и квалифицированный специалист..Лазерное удаление не самый приятный процесс,но с таким подходом,консультациями и рекомендациями всё проходит максимально хорошо) Рекомендую!!!', 10, 189, 'Ответ на отзыв'),
(257, 'Магазин с доступными ценами,достаточно большим ассортиментом детской и подростковой одежды и обуви', 14, 83, 'Ответ на отзыв'),
(258, 'Божественно! Были компанией 5 человек в новой большой бане. Парилка большая,  все разместились с комфортом, очень понравилась. Трех часов нам оказалось мало. Так что, если идёте большой компанией - позаботьтесь о достаточном лимите времени) ', 3, 200, 'Корректировка : парилка большая '),
(259, 'Сегодня сдавал изделия из золота и серебра.\r\nВсе профессионально и по делу, расчет на месте.\r\nПо моему мнению, цена за грамм одна из самых высоких в городе!\r\n\r\n', 31, 202, 'Ответ на отзывСпасибо за отзыв, ждем вас снова!'),
(260, 'Я обязательно вернусь снова!', 11, 66, 'Ответ на отзыв'),
(261, 'Среди качественной и красивой, модной мебели у этой фирмы самая адекватная цена на кровати. Есть возможность изменения опций в конструкции кровати. Привезли ее раньше срока. Сборщики после себя упаковку и мусор даже компактно сложили. Кровать радует.Мы купили именно то, что хотели. Без всяких компромиссов. Уже целый месяц наслаждаемся ароматом древесины в комнате. Исходя из всего сказанного, советую всем ищущим качественную кровать или другую мебель.\r\n\r\n', 12, 74, 'ФОТО ПРИКРЕПИТЬ!'),
(262, 'Отличное место. Прекрасный отдых в любое время года! Ходим уже постоянно и много лет всей семьей. ', 40, 190, 'Ответ на отзыв'),
(263, 'Спасибо большое за такое качество обслуживания и своевременное выполнение! Теперь только к Вам! И всем друзьям буду рекомендовать только Вас!', 14, 173, 'Ответ на отзыв'),
(264, 'Хотела бы поблагодарить всю команду \"Импульса\". Устанавливали камеры на жилой дом. Всё очень понравилось, прошло все быстро и чётко. Ребята знают своё дело. Спасибо вам огромное!', 34, 174, 'Ответ на отзыв'),
(265, 'Два месяца назад решили купить квартиру, воспользовались услугами данной компании. Покупатели мы оказались привередливые, но наша агент - Дарья- все же смогла подобрать вариант. Помогла со всеми документами, встречами, все было во время и в срок.  Сделка прошла замечательно, мы довольны. Говорим спасибо и выражаем благодарность за профессионализм и верность делу!', 33, 186, 'Ответ на отзыв'),
(266, 'Хочется оставить отзыв о \"Центр новых технологий\" . Делала процедуру лазерное удаление веснушек, пигментных пятен . И что я могу сказать результат порадовал на 100%, долго выбирала и не ошиблась чутье мое привело сюда! Обязательно приеду на повторные процедуру. Да кстати я приезжала из другого города)))', 10, 177, 'Ответ на отзыв'),
(267, 'Прекрасный салон)\r\nПомещение светлое, просторное, очень красивое, гармонично подобраны цвета. Персонал вежливый, отзывчивый. Мастера очень внимательно относятся к пожеланиям гостя :) Хороший мастер, делаем LPG массаж, результат супер🌻\r\nЖелаю вам большого продвижения🌻', 10, 176, 'Ответ на отзыв'),
(268, 'Очень долго не могла выбрать квартиру, бюджет не очень большой, но что попало покупать не хотела. В 2 Гис нашла агентство «Альфа-Дом», по отзывам выбрала, и осталось довольна. За неделю мне нашли подходящий для меня вариант, заезжай и живи. Я счастлива, спасибо. 5* однозначно.', 33, 172, 'Ответ на отзыв'),
(269, 'Отличная компания, Огромное спасибо за помощь! Главное - быстро и результат 100%. Куда не обращалась, все только обещали, а тут взялись за дело и сделали. Моя ситуация - подсунули в универе договор не рассрочки платежа за обучение, а потребительский кредита с огромной % ставкой. Я поняла, что надо всё читать, когда пришло смс с суммой 1 платежа. Разбирательства с банками - это не реально... Это единственная компания, которая реально решила вопрос. Спасибо Вам! Рекомендую всем!!!', 28, 166, 'Ответ на отзыв'),
(270, 'Благодарим за всю процедуру, начиная с подготовки, организации и самим захоронением нашей бабушки. Вы взяли на себя самые сложные моменты и ответственно их выполнили. Огромное вам спасибо.', 39, 187, 'Ответ на отзыв'),
(271, 'Надоел цвет своей машины, красить не хотелось, специалиста найти сложно, посоветовали ребят из Fedenko wrap. Помогли определиться с цветом, у них на этот случай много вееров, с самыми разными вариантами, от черного матового до хамелеона. Оклеили всю машину с проемами, работой доволен, вид огонь, крутые ребята! Оклеить машину проще чем покрасить, да и пленку можно будет снять через время', 2, 195, 'Рады помочь)'),
(272, ' Месяц назад обратилась ы Юристер, по поводу развода и раздела имущества. В этом я толком не разбиралась, в начале я получила грамотную консультацию у Шарифа Бакировича,  проговорили все пути решения. Первым делом мне помогли оформить развод, вели меня по всем вопросам от начала до конца, а потому начали процесс раздела имущества. В итоге суд был на моей стороне, и большую часть имущества, как я в принципе и заслуживала, получила в свою собственность. Спасибо , Вы профессионалы!', 28, 182, 'Ответ на отзыв'),
(273, 'За это, столь короткое время, я получил огромнейший взрыв эмоций, и выброс адреналина, планирую собрать команду и арендовать уже на час,', 30, 168, 'Ответ на отзыв'),
(274, 'Посетили  баню с коллегами. Место шикарное.Баня чистая и уютная, хорошая  комната  для отдыха, бассейн. Очень приветливые сотрудники. Огромное спасибо администратору.', 3, 200, 'Ответ на отзывОтлично '),
(275, 'Я никогда не думала, что поход к стоматологу может превратиться в такое приятное и удивительное путешествие. Волшебные руки врача, профессиональный подход и уютная атмосфера в кабинете позволяют забыть обо всех страхах и насладиться процессом лечения.', 11, 66, 'Ответ на отзыв'),
(276, 'Хорошее турагенство! Два раза покупал путевки в Слетать.ру и нам очень нравится работать с офисом в ТЦ Акрополь! Грамотные менеджеры, гибкая ценовая сетка туров. И самое главное до конца путешествия на связи, по любому вопросу подскажут. Спасибо!', 44, 201, 'ЧЕРЕЗ 3-4 ДНЯ'),
(277, 'Отличный детский магазин рядом с домом, продавцы компетентные, всегда подскажут, спросят, обслужат на высшем уровне', 14, 83, 'Ответ на отзыв'),
(278, 'Мне всё понравилось,был в командировке.хороший номер,тихо,спокойно,дружелюбно.прожил неделю в новом корпусе,всё супер.', 5, 35, 'Ответ на отзыв'),
(279, 'Оформляла букет на свадьбу сестры. а так как времени с утра катастрофически было мало бегать по магазинам, я доверилась службе доставки. Не подвели меня На.Ромашке, привезли благоухающий букет точно по времени. Спасибо Вам огромное!', 25, 156, 'Ответ на отзыв'),
(280, 'Лучшая сеть магазинов парфюмерии в городе. Здесь можно найти то, чего нет нигде. Нишевая, селективная парфюмерия. Ценовые категории есть разные.', 26, 160, 'Ответ на отзыв'),
(281, 'Материалы отличного качества. Для меня было очень важно чтобы пленка была не корейская. Спасибо за достойно выполненную работу. Обязательно буду рекомендовать Вас свои знакомым!', 2, 194, 'Спасибо, ждем вас снова!'),
(282, 'Супер цены, Супер качество, давно одеваю детей в этом магазине. После стирки все отменного качества, что важно!', 14, 83, 'Ответ на отзыв'),
(283, 'Очень качественное обслуживание. Отремонтировали телефон очень быстро за день. Ремонт произведен качественно. Спасибо специалисту данного сервиса!!', 17, 171, 'Ответ на отзыв'),
(284, 'Если вы ищете место, где сделают идеальное наращивание волос, то вам в эту студию! Волшебные руки Анжелы творят настоящее искусство. От души благодарна за ее труд и мастерство!\"', 10, 63, 'Ответ на отзыв'),
(285, 'Я выражаю огромную благодарность Александре..я удаляла стрелочки лазером, процедура не из очень приятных, но чувствовала себя безопасно и полностью доверилась профессионалу.. все таки это глаза..все терпимо. 😊', 10, 189, 'Ответ на отзыв'),
(286, 'Не скажу за качество, но мои потребности закрыли полностью.  Подход к клиенту очень адекватный. Макс своё дело знает. Мне его работа понравилась на 100%.', 10, 188, 'Ответ на отзыв'),
(287, 'Сотрудники В трудный час очень помогли в организации похорон близкого нам человека. Все сделали грамотно и добросовестно. Спасибо!', 39, 187, 'Ответ на отзыв'),
(288, 'Прекрасная баня! Справляла в Кедровой бане день Рождения Очень хорошая парная и бассейн, уютная комната в русском стиле  со столом. На мой взгляд лучшая баня!! ', 3, 200, 'Ответ на отзывОтлично '),
(289, 'Название говорит за себя 💯\r\nЧасто катаемся с сыном  и друзьями. Максимум адреналина \r\nЧеткий инструктаж, хорошая экипировка ну и машины реально взрывные! А если застанете тренировку спортсменов, то ошалеете от скоростей, на которых гоняют ребята, даже маленькие дети 6❗️лет. Всем рекомендую попробовать! ', 30, 168, 'Ответ на отзыв'),
(290, 'Хотим выразить огромную благодарность компании \"Юристер\"\r\n за оказанную юридическую помощь и представительство в суде\r\nПрофессиональный, качественный и подробный ответ на наши вопросы и доброжелательное отношение!!! Вы-команда профессионалов!!! Мы рады, что попали к Вам, в Ваши надежные руки! Наши трудности успешно разрешились! \r\nУдачи Вам! И еще раз огромное СПАСИБО!!! Мы рекомендуем именно Вас!', 28, 182, 'Ответ на отзыв'),
(291, 'Спасибо стоматологам из клиники Maridentalmix . Мне делали имплант зуба). Я очень боялась, но все прошло просто замечательно. В доброжелательной атмосфере я в кресле у врача отдыхала. А результат вообще потрясающий – отличный новый зуб.', 11, 66, 'Ответ на отзыв');
