INSERT INTO `text_promo` (`id`, `promo_text`) VALUES
(1, 'Здравствуйте, пишу вам по поводу отзывов, расскажу, как все происходит: У нас есть подборка аккаунтов, которые мы ведём, как живых людей. То есть, ботами их назвать нельзя. Аккаунты ведутся от 2017 года и позднее. Далее либо вы пишите текст, и мы его публикуем, либо мы сами пишем текст, основываясь на вашей информации) Публикуем обычно 1 отзыв в 2-3 дня. Но *не менее 5 в месяц на один филиал*. lineSep\r\n    1 отзыв 2 гис - 200 рублей (>= 10шт.).\r\n    1 отзыв 2 гис - 250 рублей (до 10шт.).\r\n    1 отзыв 2 гис + текст ответа на отзыв - 300 рублей.\r\n    5 отзывов + Ведение яндекс рекламы  - 5000 руб/мес. lineSep\r\n    Для начала работы укажите:\r\n    1.	Необходимое количество отзывов.\r\n    2.	Ссылку на ваш филиал в 2гис (Либо город, адрес и название фирмы).\r\n    3.	Ваш email. lineSep\r\n    ✅Далее мы подготовим текста и вышлем вам на проверку и редакцию. После редакции публикуем.\r\n    Оплата по факту за опубликованные отзывы.  Если нужен чек, сообщаете об этом заранее.\r\n    Гарантия на каждый отзыв 3 месяца. lineSep'),
(2, 'Здравствуйте, хотелось бы узнать готовы ли вы начать сотрудничество или есть ли у вас необходимость в других услугах, в сфере интернет технологий, PR и маркетинга? С радостью поможем.'),
(3, 'Для начала работы укажите:\r\n    1.	Необходимое количество отзывов\r\n    2.	Ссылку на ваш филиал в 2гис (Либо город, адрес и название фирмы).\r\n    3.	Ваш email '),
(4, 'Мы подготовим текст ответа на наш отзыв. Этот текст вы сможете опубликовать через свой личный кабинет в 2гис. Каждый ответ пишется именно под конкретный отзыв! Минимум от 3 предложений. Клиентам важно понимать, что компания не оставляет без внимания отклики потребителей. Когда клиент увидит, что вы отвечаете не \"под копирку\", а лично каждому - это безусловно перевесит его выбор в вашу пользу. Отзывы с ответами лучше ранжируются в системе поисковиков. '),
(5, 'Здравствуйте, это тексты на проверку. Проверьте, пожалуйста, эти тексты в течении суток. lineSep\r\n    - Если замечаний нет, нажмите кнопку «РАЗРЕШИТЬ ПУБЛИКАЦИЮ». lineSep\r\n    - Если есть небольшие замечания, и вы можете отредактировать их вручную, внесите изменения и нажмите кнопку «СОХРАНИТЬ», а затем кнопку «РАЗРЕШИТЬ ПУБЛИКАЦИЮ». lineSep\r\n    - Если замечания существенные, опишите их в разделе «комментарий» и нажмите кнопку «КОРРЕКТИРОВАТЬ». lineSep lineSep'),
(6, 'Здравствуйте, напоминаю о необходимости оплатить за опубликованные отзывы. Ожидаем! lineSep'),
(7, 'К сожалению оплата от вас так и не поступила, к сожалению, мы будем вынуждены изменить результат нашей работы на противоположный. '),
(8, 'Здравствуйте, мы передали исполнителю поручение подготовить для вас на проверку новые тексты для отзывов. Если все хорошо и работаем дальше, отправьте +.'),
(9, 'Здравствуйте, не получили от вас ни подтверждения, ни отказа от новых отзывов. Пожалуйста отпишитесь.'),
(10, 'Здравствуйте, меня зовут Иван. У нас с женой у самих бизнес (несколько фирм) и одна из них теперь занимается отзывами. Они появились в результате \"призыва к справедливости\". У нас в среднем по 1000 клиентов в месяц, и в целом все хорошо, но так или иначе в этот месяц прилетало 3-4 плохих отзыва с единицей, причем чаще всего не очень справедливых \"шел мимо, ничего не покупал, но вывеска не нравится, единица!\" или \"все классно, но платье меня толстит, не нравится, единица\" и ставили не 3, или 4, а 1, что сильно роняло рейтинг). В итоге мы поняли, что, когда людям все нравится, они отзывы не пишут, а вот стоит оступиться и допустить едва заметный промах или не понравится конкуренту, плохой отзыв - пожалуйста. Общались с 2гис, им было плевать, на все отвечали \"звоните людям, договаривайтесь, но номер мы вам не дадим\")) в итоге пришлось искать выход и нашли его, на каждый плохой - писать 5 хороших, чтобы нивелировать оценку. ) Мы, как и раньше, призываем Вас к сотрудничеству и если вам интересно, отправьте «ОК» и мы продублируем вам предложение. Хорошего дня. ');
